(1, 'Nkuku', '2010-10-19 09:58:48', '2010-11-23 21:35:45', NULL, 2, 0, NULL, 1, 2, 'nkuku_logo.jpg', 'image/jpeg', 21496, '2010-11-01 17:09:14', 'Nkuku', '<p>It was when we first discovered Nkuku and their stunning fair trade bags that the penny finally dropped for us. We had already been blown away by the amazing cutting edge designs our upcycled brands like Alchemy Goods and Elvis &amp; Kresse were showing us, but we honestly didn&rsquo;t think we could find that same level of talent, design and craftsmanship if we went down the fair trade route. We couldn&rsquo;t have been more wrong if we&rsquo;d tried. If you think fair trade is only for people who wear socks with their sandals, then think again. Nkuku is well and truly cool.</p>\r\n<p>Based here in the UK, Nkuku is a family run business that has a unique and wonderfully refreshing approach to business. Not only are they committed to fair trade they are also eco-friendly and even advocate not buying something if you really don&rsquo;t need it.&nbsp; Not great for business but we can see their point &ndash; if you&rsquo;re going to buy, make sure your choice is a good one, in every way.</p>\r\n<p>Nkuku was set up by Ali and Alex after they spent a year travelling and working in Africa and India, meeting artisans, and witnessing their astounding skills but challenging living standards and restricted opportunities. Their objective became to promote and develop the traditional skills of these artisans and bring their work to the UK market. And the rest, as they say, is history!</p>\r\n<p>Nkuku&rsquo;s fair trade bags are inspired by the traditional skills of artisans in India &ndash; in fact many of their bags are handmade by just 40 families in Rajasthan. They combine contemporary designs with age-old techniques, natural materials and sustainable methods of production to ensure each bag is a truly unique work of art.</p>\r\n<p>Ali, Alex and the Nkuku team continue to make regular visits to India and have built up trusted and life-changing relationships with their suppliers and the artisans themselves, based on the principles of fair trade and equal opportunity. This means that everyone involved is paid a decent wage for their work, working conditions are safe and of a good standard and no children are exploited. They also work with as many natural dyes as possible, such as tree bark and vegetable extract &ndash; good for the environment and for the artisans too.</p>\r\n<p>Nkuku is now a fully fledged member of the World Fair Trade Organisation &ndash; a great achievement and one that clearly underlines their 100% commitment to fair trade. Perhaps Nkuku is the new Green and Blacks&hellip;</p>\r\n<p>And finally, if you&rsquo;re wondering about the name Nkuku, they&rsquo;ve borrowed it from a village in Zambia.</p>', 'NK013-D.jpg', 'image/jpeg', 300084, '2010-11-10 15:23:55', 'Nkuku'),
(2, 'Alchemy Goods', '2010-10-19 10:16:12', '2011-06-16 13:23:17', NULL, 2, 0, NULL, 1, 1, 'Alchemy Goods.jpg', 'image/jpeg', 37436, '2010-11-01 17:10:31', 'Alchemy Goods', '<p>For us, there will always be a special place in our hearts for Alchemy Goods. At the very start of our onfriday journey, we knew how exceptional these young upcycling designers were, however when we talked about our plans with friends and family you could just tell what they were thinking. Their eyes gave it away! The word &lsquo;bag&rsquo; isn&rsquo;t exactly a sexy word at the best of times. Add to that the word &rsquo;ethical&rsquo; and you can guarantee they were visualising their jute shopping bags shoved away in the car boot ready for the next Sainsbury&rsquo;s shop. We realised we had a bit of an image problem going on! Enter Alchemy Goods. We went everywhere armed with pictures of their upcycled bags. This is what it&rsquo;s all about, we would say, great cutting edge design and it&rsquo;s green too. It worked, people started to &lsquo;get it&rsquo;. Phew, we hadn&rsquo;t lost our marbles after all...</p>\r\n<p>People say that &ldquo;necessity is the mother of invention,&rdquo; and that&rsquo;s exactly how Seattle-based Alchemy Goods got started. Eli, founder of Ag, had his messenger bag stolen. Finding the perfect replacement however was proving to be impossible.&nbsp; Being a lad with a pad, there were always extra bike inner tubes lying around his apartment, so Eli set about building the perfect bag out of stuff he already had. The first prototype was born on his home sewing machine. It wasn&rsquo;t perfect, but it was exactly what he needed. It didn&rsquo;t take long before most of his friends wanted one too. Then local bike shops caught a glimpse and expressed interest. Each bag improved over the last. Word spread and demand grew and grew, which led to the founding of Alchemy Goods.</p>\r\n<p>While medieval alchemists sought to turn lead into gold, Alchemy Goods turn useless stuff like blown-out inner tubes and old seatbelts into useful stuff like bags. They source their inner tubes from Seattle bike shops. Each inner tube has distinctive details, like patches, logos and various textures, making each bag&rsquo;s exterior truly unique. The inner tubes are carefully checked for holes. Any blemishes that affect quality, such as punctures or glue, are removed. The tubes are then cut open, washed and stitched together, creating the bag&rsquo;s weatherproof shell. They develop a finish over time that gives them the soft feeling of fine Italian leather. And they&rsquo;re 100% waterproof and virtually stain proof too, so you can keep your stuff dry whatever the weather.</p>\r\n<p>They then scour local junkyards in search of car seatbelts. Each seatbelt is inspected for quality before being cleaned, splayed open and integrated in to your bag&rsquo;s design to form the strong, distinctive shoulder strap. These are way more comfortable than traditional messenger bag straps because they&rsquo;re wider and constructed of soft nylon material.</p>\r\n<p>Those of you with an eye for detail will have noticed the logos stitched to the bags have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag. They strive to make this number as high as possible by incorporating as much upcycled material as they can. You can show off this mark with pride!</p>\r\n<p>Each Alchemy Goods upcycled bag is assembled by hand in their Seattle workshop, a true work of art. So, we&rsquo;d like to thank whoever it was who stole Eli&rsquo;s bag &ndash; if it wasn&rsquo;t for you who knows whether we&rsquo;d still have our marbles.</p>', 'brands_alchemy_goods.jpg', 'image/jpeg', 38118, '2010-11-04 10:03:22', 'Alchemy Goods Union Backpack'),
(3, 'Neumatica', '2010-10-19 10:17:30', '2011-06-16 13:19:57', NULL, 2, 0, NULL, 1, 3, 'neumatica_logo.jpg', 'image/jpeg', 22433, '2010-11-01 17:08:14', 'Neumatica', '<p>When we discovered the amazing recycled inner tube bags made by a young design company called Neumatica out in Argentina, it signalled the start of our very first South American partnership. Soon, we were excitedly logging on to DHL each morning to watch as our parcel made its way across the Atlantic. At one point we did start to wonder whether the German customs people in Leipzig would ever chill out and get the parcel moving again, but eventually it found its way to us.</p>\r\n<p>4.50pm &ndash; 28 September - shipment picked up, Buenos Aires <br />8.50pm &ndash; 30 September - processed at DHL location, Madrid<br />2.30am &ndash; 1 October - clearance delay, Leipzig<br />10.07am &ndash; 8 October - clearance processing complete, East Midlands<br />8.11am &ndash; 9 October - arrived at DHL facility, Leeds<br />1.40pm &ndash; 11 October - shipment delivered, York</p>\r\n<p>After all that, thank goodness we were in!</p>\r\n<p>Wanting to find ways to help the environment brother and sister design duo Roberto and Debora Piwnica decided to start saving inner tubes of tyres and make them roll again, turning them into something they call daily design objects.</p>\r\n<p>When used rubber inner tubes from vehicles are discarded into landfill, it takes more than 500 years to decompose and if burned they are highly contaminating. In Argentina alone, around 100,000 tonnes of this stuff is disposed of each year. &ldquo;Recycling is a compromise with the planet&rdquo;, says Roberto, &ldquo;&hellip;and fashion has to do its part&rdquo;.</p>\r\n<p>So just three years ago, Neumatica starting doing some amazing things with rubber, transforming mountains of useless inner tubes into works of art and putting them back out onto the streets to start a second life. Working with inner tubes isn''t straightforward. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece and finally sealed with a special UV protection agent.</p>\r\n<p>All rubber inner tubes are plain when they''re new and have no texture. However after a few months and years out on the road, the heat of the tire transfers its own tread imprint to them, giving unique, multiple textures to all of Neumatica&rsquo;s upcycled bags. Each finished piece has the story of many miles driven. No two Neumatica bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind bag that will probably last you a lifetime!</p>', 'bradns_neumatica.jpg', 'image/jpeg', 44803, '2010-11-04 10:04:47', 'Neumatica Bag made from recycled inner tubes'),
(4, 'NV London Calcutta', '2010-10-19 10:18:02', '2011-06-16 13:24:49', NULL, 2, 0, NULL, 1, 4, 'nv_logo.gif', 'image/gif', 3006, '2010-11-01 17:07:15', 'NV London Calcutta', '<p>We just love working with NV London Calcutta!</p>\r\n<p>They seem to capture all that is elegant, chic and exciting about ethical fashion and are fast becoming one of the major players helping to bridge the gap between high fashion and traditional, ethical artisanship.</p>\r\n<p>Based in London, the driving force behind the emergence of NV London Calcutta is Naomi Cornelius-Reid. Voted the Future 100 Ethical Entrepreneur of the Year in 2009, Naomi is fundamentally committed to social change and she would like us all to join her revolution! NV London Calcutta combine the best of UK design talent with the promotion of age-old Indian craftsmanship and artisan skills, to produce entirely handmade, high quality fair trade bags and accessories.</p>\r\n<p>They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta, West Bengal who is a&nbsp; founding member of the Indian Fair Trade Forum and also a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NVLC&rsquo;s great bags all receive a fair wage and work in a healthy and happy environment.</p>\r\n<p>All materials are sourced locally in West Bengal and are of the highest possible quality, from butter soft buffalo hides, to rich hand-loomed silks.</p>\r\n<p>There is an amazing team spirit and working environment over in Calcutta &ndash; perhaps the annual company away week, where all 40 HQ employees travel to the coast to sing, dance and relax together, has something to do with it! Everyone is encouraged to learn new skills and develop their careers. In fact, anyone can use factory equipment out of hours to work on their own projects if they want to. Everyone is treated equally &ndash; one of the packing team is the only counter-signatory to the Managing Director. And in such a male dominated society, they have a woman in charge and apparently she&rsquo;s amazing!</p>\r\n<p>The manufacturer also partners with and supports over 26 grass roots producer groups, many rural based, providing an important source of income to the individuals and their families through the sale of their crafts whilst sustaining and nurturing their age-old artisan skills. It&rsquo;s a relatively small company and NV London Calcutta have got to know everyone on first name terms, including all the wonderful hand-picked artisan suppliers they partner with.</p>\r\n<p>&ldquo;Our products are not only unique in design, but also, crucially, in the story behind them&rdquo; says Naomi, &ldquo;We don&rsquo;t ask that you compromise your social or style standards. We wouldn&rsquo;t. We quite simply bring you an ethical alternative to the things you love and an opportunity for a brighter, more secure future to those who deserve it the most&rdquo;.</p>\r\n<p>Well said Naomi, we couldn&rsquo;t have put it any better ourselves!</p>', 'brands_nv.jpg', 'image/jpeg', 54799, '2010-11-04 10:05:20', 'NV London Calcutta Florence Weekend Bag'),
(5, 'Aura Que', '2010-10-19 10:19:45', '2011-06-16 13:04:17', NULL, 2, 0, NULL, 1, 6, 'Aura Que.gif', 'image/gif', 6918, '2010-11-01 17:11:49', 'Aura Que', '<p>One of the really exciting things about our onfriday adventure is that we are starting to work with some incredibly talented and passionate young designers and Laura Queening, founder of the ethical fashion label Aura Que is a perfect example. Ethical fashion is still in its infancy, which means there are very few old hands or really big players in the business who dominate current thinking or determine future direction.</p>\r\n<p>Unlike much of mainstream fashion where the bottom line is often a top line priority and so much practice pushes both our moral and ethical boundaries, we are starting to discover a growing number of truly remarkable young people who are successfully combining cutting edge design with an genuine commitment to and deep understanding of the concept of ethical production and fair trade. <br /><br />And Laura Queening is definitely a ''one-to-watch'' ethical fashion designer. Having graduated from Cordwainers at the London College of Fashion in 2007, Laura established her own ethical fashion label Aura Que a year later following the success of her graduate collection at the prestigious Drapers Award. So, with a passion for ethical fashion and her love of Nepal, Laura set about creating a production base in Kathmandu that would see her unique designs come to life.</p>\r\n<p>Her connection with Nepal started over six years ago when she taught English in a rural school in the south of the country for five months. Living with a local family, Laura soon became immersed in Nepalese culture, witnessing firsthand how the political situation had hit the country hard, stunting most development. So when Laura set up Aura Que, Nepal was a natural choice of country for the manufacture of her fair trade bags &ndash; a very practical and effective way of contributing to the country&rsquo;s regeneration.&nbsp;</p>\r\n<p>All Aura Que materials are sourced in Nepal and each design is brought to life in a Nepalese factory that employs local people, some affected by disabilities, providing an income and security for themselves and their families. Laura only works with manufacturers who are members of IFAT, the International Fair Trade Association, which means that working environments are healthy and safe and workers receive a fair wage. Laura is also keen to encourage trade directly with small Nepalese family businesses too, so she&rsquo;s working hard to build long term relationships with these skilled artisans based on the principles of fair trade.</p>\r\n<p>So, rest assured, our wonderful Aura Que fair trade bags are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer. Every Aura Que bag has its own unique story to tell, inspiring and uplifting, which only adds to its charm!</p>', 'brands_aura_que.jpg', 'image/jpeg', 36403, '2010-11-04 10:06:00', 'Aura Que Bucket Bag in Brown'),
(6, 'Feuerwear', '2010-10-19 10:20:14', '2011-06-16 13:35:50', NULL, 2, 0, NULL, 1, 5, 'feuer_logo.gif', 'image/gif', 5560, '2010-11-01 17:14:39', 'Feuerwear', '<p>We have to admit, we stumbled upon Feuerwear purely by chance during one of our long and often fruitless Google searches. They must have remained just below our radar due to the fact they&rsquo;re based over in Germany and at the moment we can&rsquo;t find anyone here in the UK selling their bags. We&rsquo;re pleased our persistence finally paid off because the guys at Feuerwear are a bit special. Give them an old fire hose and watch them go&hellip;</p>\r\n<p>Every Feuerwear bag is a one-of-a-kind piece that has its own individual story to tell. Their bags are all made from reclaimed fire hose that''s seen years of active duty in the German fire service. By the time they have found their way to the Feuewear team each fire hose has helped to save hundreds, if not thousands of lives.&nbsp; The reclaimed hoses can be either red or white and have a black rubber lining. Each hose is thoroughly cleaned before being cut to size and handcrafted using high-quality materials. The whole process requires high levels of skill and dexterity as well as some pretty sturdy machines capable of sewing such a tough material.&nbsp; Each hose bears the unique traces of its individual past meaning that every Feuerwear fire hose bag is unique in its colour and markings.</p>\r\n<p>Behind the Feuerwear label are brothers Martin and Robert Kl&uuml;sener. Martin is a textile engineer and responsible for design and production, whilst Robert heads up the marketing and distribution.</p>\r\n<p>The story started back in 2005 when Martin wrote his final year dissertation on the founding of a bag label and then promptly founded his own bag label.&nbsp; His goal was to recycle old, disused material and in doing so help the environment. After several attempts with jute bags and canvas sails, he began producing bags and accessories using recycled firefighting hose, working in the basement of his parents'' house.</p>\r\n<p>Today Feuerwear has grown into a successful company committed to producing great products that have little or no negative impact on the environment. Their concept is based on their mission to recycle material and create green, eco friendly fashion. They are also big supporters of the modern lifestyle known to many as LOHAS (Lifestyle of Health and Sustainability). As a business they also off-set their transport carbon emissions and keep their production within Europe, working with small family-run organisations.</p>\r\n<p>Feuerwear products are now sold in more than 80 shops in 11 countries on 3 continents. And now, finally, their great fire hose bags are in the UK thanks to onfriday! Definitely worth all that searching.</p>', 'brands_feuerwear.jpg', 'image/jpeg', 42699, '2010-11-04 10:05:38', 'Feuerwear Walter Messenger Bag'),
(7, 'Cyclus', '2010-10-19 10:20:49', '2013-03-27 20:34:17', NULL, 2, 0, NULL, 1, 7, 'Cyclus.jpg', 'image/jpeg', 30949, '2010-11-02 09:20:35', 'Logo Cyclus Reconexion Upcycled Bags', '<p>When you come across a design that almost takes your breath away you know it&rsquo;s going to be a good day! This happened to us when we saw the Anteos Backpack made by a young eco design company called Cyclus over in Colombia. We&rsquo;d never seen anything quite like it before &ndash; for us it was an absolute must-have, so unique and a real design statement. The rest of their range didn&rsquo;t disappoint us either.</p>\r\n<p>Cyclus started life back in 2002 with just two people with a vision to reconnect with nature and the world. They believed that great design and imagination mixed with a good dose of down to earth common sense could start to change the way we think about the environment and how we interact with it. It was time to challenge age-old preconceptions around resource consumption and waste generation.&nbsp; And so their journey began. Taking old vehicle tyres and other reclaimed materials they started to redefine the whole design and production process, creating innovative upcycled bags that not only stood out from the crowd but were also robust, durable and very eco-friendly.</p>\r\n<p>Nature is an important source of inspiration for the designers at Cyclus. The Anteos backpack which first caught our eye is from their Pangolin range. A Pangolin is a mammal found in tropical regions of Africa and Asia and can look a bit like a walking pine cone or globe artichoke. It can curl up into a ball when threatened, with its overlapping scales acting as armour and its face tucked under its tail. Its name comes from the Malay word pengguling, which means &lsquo;something that rolls up&rsquo;. So their Pangolin range, including our very own Anteos backpack is based on the armour, the biomechanics and the movement of the Pangolin. This form of design is known as biomimicry, where science and art emulate nature&rsquo;s best ideas to solve human problems. The pangolin design is so new that it&rsquo;s still patent pending &ndash; bet you&rsquo;ve never had a bag that&rsquo;s patent pending before!</p>\r\n<p>Today, Cyclus has grown into a team of over 25 people and leads the way in eco fashion design in Colombia. In 2009 Cyclus was awarded the National Export Award for Small Business. They believe that eco development has an important role to play in Colombia&rsquo;s future growth and are supporting the idea of a national laboratory for eco design.</p>\r\n<p>As a company, they are committed to social justice and provide employment for some of Colombia&rsquo;s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>\r\n<p>The best of eco design combined with a commitment to social justice &ndash; we like Cyclus and their upcycled bags a lot.</p>', 'brands_cyclus.jpg', 'image/jpeg', 36741, '2010-11-04 10:06:28', 'Cyclus Anteos Backpack made from truck tyre inner tubes'),
(8, 'Harveys', '2010-10-19 10:21:11', '2011-06-16 14:01:37', NULL, 2, 0, NULL, 1, 8, 'Harveys.jpeg', 'image/jpeg', 29546, '2010-11-02 09:22:20', 'Harveys', '<p>It&rsquo;s now just over 50 years since the first three-point seatbelt was invented by Volvo''s safety engineer Nils Bohlin. His invention has now gone on to save millions of lives worldwide however we wonder whether even the highly inventive and very talented Mr Bohlin could have predicted just how versatile the seatbelt would become.</p>\r\n<p>In the motor industry, miles upon miles of seatbelt material is produced each year. It must satisfy the highest of automotive standards before it can be used to make a car seatbelt. Unfortunately not all seatbelt material makes the grade so tonnes of it end up in landfill each year. It might not satisfy the stringent standards of the motor industry but it does meet the needs of Harvey&rsquo;s talented design team and their Treecycle range of seatbelt bags.</p>\r\n<p>It all began back in 1997, when husband and wife, Dana and Melanie Harvey, were installing seatbelts into their 1950&rsquo;s Buick. They hit upon an idea - why not use some of their spare seatbelt material and turn it into a bag. When friends and family saw the end result they all wanted one of their own.&nbsp; So Dana and Melanie decided to make a few more and then a few more &ndash; soon they were selling like hot cakes! Out of their small garage in California grew the very first seatbelt bag company and they haven&rsquo;t looked back since.</p>\r\n<p>Today, Harveys now lead the field in the design and manufacture of seatbelt bags and are based in a design studio in Santa Ana, California. They have an extensive range of seatbelt bags but there is one particular range that stands out for us &ndash; the Treecycle range. They take genuinely discarded seatbelts direct from the motor industry, weave them up and add some custom hemp lining to create a unique bag that is as eco-friendly as you can possibly get.</p>\r\n<p>No two Treecycle seatbelt bags are the same so if you want a bag that&rsquo;s going to make you stand out from the crowd, it&rsquo;s got to be a Harveys seatbelt bag &ndash; the original and still the best!</p>', 'brands_harveys.jpg', 'image/jpeg', 39565, '2010-11-04 14:30:19', 'Harveys Executive Briefcase made from seatbelts'),
(10, 'Namaste', '2010-10-19 10:21:53', '2011-06-16 15:05:08', NULL, 2, 0, NULL, 1, 10, 'namaste_logo.gif', 'image/gif', 4461, '2010-11-02 09:24:40', 'Namaste', '<p>Trade Fairs, especially some of the really big ones, can be quite daunting experiences. The Autumn Fair at the Birmingham NEC was no exception. We&rsquo;d just set up our new company so this was going to be our first trade fair as a fully fledged buyer. It soon became apparent that the type of ethical bag you or I would be proud to wear was obviously in short supply. If I had been buying greetings cards I would have been in my element. But I wasn&rsquo;t. I was beginning to wonder whether this was going to be a big waste of my time when suddenly the vibrant colours of the Namaste stand caught my eye. And then I glimpsed their brand new range of fair trade suede bags - it was love at first sight. The trip had been worthwhile after all.</p>\r\n<p>Namaste, the company, was inspired by a journey through India in 1995 on reconditioned ex-Indian Army Enfield Bullet motorbikes. In search of some adventure, founder Sam Brummitt, his sister and her partner flew off to Kathmandu with a round the world ticket. After an inspirational trek to Mount Everest base camp in the wake of the worst storms for a generation, they travelled overland to India for a quick visit that turned into a six month adventure.</p>\r\n<p>Sleeping under the stars most nights by the side of the road they quickly developed a passion for this amazing sub-continent and especially the warm, friendly and hospitable people they met. One day in Rajasthan, they got into conversation with the owner of a small textile business who suggested they went back home to England and started a business. So they did and the rest, as they say, is history!</p>\r\n<p>Namaste is now a thriving business with a strong ethical policy at its core. They believe that the best way to reduce poverty is through trade. So they work with both primary producers and some larger organisations, harnessing the incredible skills and age-old techniques of local artisans. All of their products, including our wonderful suede bags, have been fairly traded which means as a minimum the workers all receive a fair wage that is at or above the national average and they work in an environment that is both safe and secure. Sam and his team go out to visit their suppliers several times a year and speak to them regularly which helps to ensure that all their suppliers meet internationally recognised fair trade standards. Namaste is recognised by BAFTS, the British Association of Fair Trade Shops as a fair trade importer.&nbsp;</p>\r\n<p>And finally if you&rsquo;re wondering why they chose the name Namaste for their business, it&rsquo;s after the greeting which was so often extended to them back in 1995. Some say it simply means &lsquo;Hello&rsquo; but a better translation, perhaps, is &lsquo;I greet the spirit within you&rsquo;.</p>', 'NA042-B.jpg', 'image/jpeg', 244479, '2010-11-10 14:57:15', 'Namaste Suede Shoulder Bag in Brown'),
(11, 'Elvis and Kresse', '2010-10-19 10:22:21', '2011-11-18 10:01:26', NULL, 2, 0, NULL, 1, 11, 'elvis_logo.gif', 'image/gif', 3383, '2010-11-02 09:26:37', 'Elvis and Kresse', '<p>Oh my goodness me&hellip;or words to that effect, was our response when we opened up our first delivery of fire hose bags from James at Elvis &amp; Kresse. It was at that point, even with all the trials and tribulations of setting up the business, we realised life was good&hellip;really good! How could a fire hose become a thing of such amazing beauty?</p>\r\n<p>Elvis &amp; Kresse tick every box going. The coolest of brands, (ask Cameron Diaz and American Vogue), the best of cutting edge design and the greenest of credentials.&nbsp;</p>\r\n<p>Elvis &amp; Kresse are constantly thinking about waste. The instant they met the London Fire Brigade back in 2005, they fell in love with their old hose. And they didn&rsquo;t stop there. They now collect fire hoses right across the UK, in fact 45 tonnes of it so far and counting.</p>\r\n<p>They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>\r\n<p>All of Elvis &amp; Kresse&rsquo;s products have the environment at their core &ndash; industrial waste is the cornerstone of their brand. Every product is made from reclaimed materials that were otherwise on their way to landfill. So, in addition to the genuine decommissioned fire hoses, they also use other textiles including old office furniture, scrap sail cloth and waste parachute silk to line their bags.</p>\r\n<p>Their environmental philosophy permeates the whole business &ndash; all of their packaging is reclaimed or recycled too. Even the protective dust bag that your bag arrives in is made out of reclaimed parachute silk.</p>\r\n<p>And they are always on the look out for more waste, so if you know of anyone who has any spare hose (that&rsquo;s hose, not Os &ndash; you&rsquo;ll need to be over 40 to get that one!) then get in touch with us and we&rsquo;ll pass the message on.</p>\r\n<p>And just when you thought it couldn&rsquo;t get any better, by buying one of Elvis &amp; Kresse&rsquo;s fire hose bags, you&rsquo;ll be making a difference in lots of other ways too. They currently donate 50% of their profits to the Fire Fighters Charity and are supporting two coffee grower initiatives, one to build a spent domestic water filtration system at Jesus Maria in Nicaragua and the other to construct accommodation, kitchens and lavatories at Santa Ana La Huerta in Guatemala.</p>\r\n<p>So, would you agree? Life is good&hellip;really good.</p>', 'brands_elvis.jpg', 'image/jpeg', 29017, '2010-11-04 14:29:55', 'Elvis and Kresse'),
(13, 'Sativa', '2010-10-19 10:22:50', '2011-06-16 14:47:44', NULL, 2, 0, NULL, 1, 9, 'Sativa-Logo.jpg', 'image/jpeg', 4633, '2010-11-11 12:29:37', 'Sativa Bags Logo', '<p>According to design guru Calvin Klein, hemp is going to become the choice of fibre in the fashion industry - certainly the guys at Sativa are confident it will be. In fact, the New York Times is saying even now that hemp is the height of fashion. So when we met Alf from Sativa and saw how passionate he was about his hemp bags we knew this was definitely worth further investigation.</p>\r\n<p>We didn&rsquo;t know much about hemp. Cannabis sprang to mind, but that was about it. So we started doing some research and soon realised what the fuss was all about. We think we&rsquo;re pretty down to earth at onfriday, not prone to over-the-top exaggeration but we do have our moments. And this is one of our moments. Hemp is truly remarkable and its green, eco credentials are quite literally second to none. Wow...</p>\r\n<p>Hemp is an annual herbaceous plant of the species Cannabis Sativa meaning ''useful hemp''. Imagine a plant growing in harmony with the earth, harvested by the sun, flourishing without the need of herbicide or pesticide and needing considerably less water than cotton to grow. As it grows it suppresses weeds, returning nutrients to the earth via its roots and fallen leaves. Every part of the plant can be used commercially, nothing goes to waste. Its core, fibres, flowers and seeds yield raw material for almost every conceivable human need. It grows to maturity in just 100 days and its long root system conditions the soil so it is an ideal crop to grow in rotation. See what we mean..?!</p>\r\n<p>So, combine hemp&rsquo;s sustainable, organic and eco-friendly credentials with great design and functionality and you get Sativa, a company that&rsquo;s simply buzzing with passion and enthusiasm and who believe that good living shouldn&rsquo;t cost the earth. Established in 2002, Sativa is based here in the UK and has a production centre over in China. They make regular visits to China and only work with suppliers and contractors who have developed an environmental policy, conduct their business in an environmentally responsible manner and who share Sativa&rsquo;s values on important issues like child labour, discrimination, working hours, freedom of association and health and safety.</p>\r\n<p>And if you&rsquo;re as curious as we were about how hemp differs from cannabis, here goes. Cannabis has high levels of Tetrahydrocannabinol (THC) in its flowers and leaves, a chemical, which is produced to protect its leaves from sunlight. Southern latitude strains such as those from India and Africa are high in THC whereas the northern latitude strains from Europe and Russia have a very low content. The low-THC strain (less than 0.3%) is known as hemp and the high-THC strain (more than 4.0%) is known as cannabis. The blanket ban on the cannabis plant back in 1937 in the US made no exception for hemp, as the two plants look virtually identical. However by the 1970s, scientists had been able to isolate THC which made it possible to prove beyond any doubt the difference between the hemp and cannabis strains. It&rsquo;s always good to have a few facts up your sleeve to impress your friends with!</p>', 'SA049-B.jpg', 'image/jpeg', 256232, '2010-11-10 15:11:55', 'Sativa Rucksack made from organic hemp'),
(14, 'Hatti', '2010-10-19 10:23:22', '2010-11-10 10:00:07', NULL, NULL, 0, NULL, 1, 12, 'hatti_logo.gif', 'image/gif', 7251, '2010-11-02 09:31:49', 'Hatti', '<p>It&rsquo;s often tough getting back into the swing of things after a great holiday isn&rsquo;t it? We sit at our desks gazing out of the window wishing we could be transported back, thinking about our escape route. And that&rsquo;s usually as far as it goes - a dream that will never become a reality.</p>\r\n<p>In 2004, Emma Triplett was back at her desk after an amazing trekking holiday in Nepal. However, what makes Emma different from most of us is that she got up from her desk and decided enough was enough. She headed back to Nepal on a journey that was to change not only her life but the lives of many others, forever.</p>\r\n<p>Once over in Nepal, Emma got involved with a charity, the Esther Benjamins Trust and started teaching English at their new centre in Kathmandu. The centre looked after circus returnees who had been trafficked as children but were now coming of age and needed help and support reintegrating with their families and communities. Due to the stigma associated with being trafficked, they were often seen as an embarrassment and a burden to their families and treated as outcasts from society with no purpose and no future to look forward to. The centre gave the girls training in various skills with the aim of securing them a job so they could earn a living and become independent. However after just 3 months it become apparent that finding jobs for the girls just wasn&rsquo;t going to happen &ndash; no one was prepared to employ them.</p>\r\n<p>Having worked so closely with these girls, Emma couldn&rsquo;t bear to leave them with no sign of escaping the stigmatisation and poverty trap, so she approached the charity with the idea of forming an income generation project with them. The charity agreed to fund the training and equipment and Emma guaranteed to buy whatever they could make and take it back to England to sell. Emma and the girls haven&rsquo;t looked back since.</p>\r\n<p>In 2007, Hatti Productions was established in Nepal to formally take over the income generation scheme from the Esther Benjamins Trust &ndash; the transition from aid to a Fair Trade production centre had began. No one could have anticipated the unprecedented change that took place with the girls - they were no longer &lsquo;charity cases&rsquo;, rejected by society after a life trapped in brothels and bonded labour in circuses. They had become independent professional young women working for a foreign organisation. Finally they could leave their past behind and could hold their heads up high when asked where they were living and what they did. Their confidence went through the roof and their reintegration speeded up too. Their families started to visit, girls were invited to live with relatives locally and some even got married &ndash; the ultimate goal!</p>\r\n<p>The centre continues to thrive to this day. After a period of rehabilitation with the charity, the older girls (min age 17) are offered the opportunity to work at the production centre. They are provided with safe, secure accommodation with a house mother to care for them and are trained at the production centre. They are paid a good monthly wage, holiday, sickness, hospital fees and maternity pay and are helped to adjust to life.</p>\r\n<p>Many of our wonderful fair trade Hatti bags have been made by these amazing young women. Emma and her team, both here in England and over in Nepal are truly inspirational and we feel very honoured and really rather proud to be working with them. Thank you Emma!</p>', 'brands_hatti.jpg', 'image/jpeg', 47164, '2010-11-04 10:08:13', 'Hatti');
