(1, 'Get in touch', 'contact_us', 'Get in touch', 1, 0, 0, 1, '2010-04-29 08:55:42', '<p>&nbsp;</p>\r\n<p>For general enquiries, including all press and media enquiries, please e-mail <a href="mailto:enquiries@onfriday.co.uk">enquiries@onfriday.co.uk</a></p>\r\n<p>If you would like any specific information about any of our bags or need further information or advice about our terms and conditions, privacy policy, packaging, delivery options, gift service or how you can be part of the onfriday thing, please e-mail <a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a>&nbsp;</p>\r\n<p>For enquiries relating to your order, please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a>&nbsp;</p>\r\n<p>We would really like to hear what you think about onfriday - our bags, this website, our service to you, anything really, good or not so good! Please drop us a line on <a href="mailto:feedback@onfriday.co.uk">feedback@onfriday.co.uk</a></p>\r\n<p><a href="mailto:feedback@onfriday.co.uk"></a>Or...simply fill out this form and press submit! &nbsp;</p>\r\n<p>If snail mail is more your thing, here''s our address -&nbsp;</p>\r\n<p>Just Ethical Ltd, Headingley Enterprise and Arts Centre, Bennett Road, Leeds LS6 3HN</p>', '2010-06-29 15:18:17', '2012-05-11 13:33:38', 'For general enquiries, including all press and media enquiries, please e-mail enquiries@onfriday.co.uk\r\nIf you would like any specific information about any of our bags or need further information or advice about our terms and conditions, privacy policy, packaging, delivery options, gift service or how you can be part of the onfriday thing, please e-mail info@onfriday.co.uk \r\nFor enquiries relating to your order, please e-mail orders@onfriday.co.uk \r\nWe would really like to hear what you think about onfriday - our bags, this website, our service to you, anything really, good or not so good! Please drop us a line on ?feedback@onfriday.co.uk\r\nOr...simply fill out this form and press submit!  ', 'contact onfriday, contact on friday, get in touch onfriday, contact onfriday bags', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'The onfriday thing', 'the_on_friday_thing', 'The onfriday Thing', 2, 0, 0, 1, '2010-04-29 08:55:42', '<p>Are you starting to think more about the effect your purchases have on the environment and the people who produce the things you buy? If so, you''re part of a growing number of people who would like an alternative to our fast-fashion, materialist society. But the alternative needs to be a credible and appealing one and that''s why we only source and showcase the very best upcycled, recycled and fairly traded bags from designers and suppliers who share our values and who believe that it is possible to adopt a more ethical way of life without having to compromise on quality or design.&nbsp;</p>\r\n<p>onfriday is all about supporting and creating innovative, sustainable and design-led solutions that help to address some of today''s most pressing social and environmental challenges. Every bag within our onfriday range has already made a difference by either reducing the amount of waste that goes to landfill or improving the lives of people in greatest need. A bag you can be proud of. And they''re pretty cool too. We don''t advocate buying loads, just buying well. Some might say this approach doesn''t make good business sense. We don''t agree, we think it makes every bit of sense. Great design (and a great business) doesn''t have to cost the earth...&nbsp;</p>\r\n<p>We really don&rsquo;t like high horses or soap boxes and we&rsquo;re certainly not in-your-face ethical preacher people. All that stuff just turns us off. But we would like to see a more just and fair world. And a planet with a bright future too. We also happen to love great cutting edge design and really want to help support some of the most talented and exciting designers involved in ethical fashion today. And it''s this combination that gives us our ''reason to be''. We really hope it strikes a chord with you too. &nbsp;</p>\r\n<p>We hope you enjoy having a look around the website, getting to know our designers and reading all about the stories behind our onfriday bags.</p>\r\n<p>Happy mooching!</p>\r\n<p>&nbsp;</p>', '2010-10-12 15:59:09', '2011-11-30 17:40:16', 'Are you starting to think more about the effect your purchases have on the environment and the people who produce the things you buy? If so, you''re part of a growing number of people who would like an alternative to our fast-fashion, materialist society. But the alternative needs to be a credible and appealing one and that''s why we only source and showcase the very best upcycled, recycled and fairly traded bags from designers and suppliers who share our values and who believe that it is possible to adopt a more ethical way of life without having to compromise on quality or design.', 'ethical bags, fair trade bags, upcycled bags, recycled bags, eco friendly bags, designer bags, handmade bags, purses, accessories, onfriday, onfriday bags, on friday, on friday bags, ethical fashion designers, Ali Gane', NULL, 2, 0, NULL, 1, 0, 'Untitled-81.jpg', 'image/jpeg', 28748, '2010-11-01 13:56:22', 'Upcycled messenger bag by Alchemy Goods', 'Do you look forward to Fridays? We thought you might, because we do too. We think it''s the best day of the week - full of promise, anticipation and excitement. Fridays make us feel really good. It''s a day we pack our bags and go...\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'Big heart, small footprint', 'big_heart_small_footprint', 'Big Heart, Small Footprint', 4, 0, 0, 1, '2010-04-29 08:55:42', '<p>For us, the story behind the bags will always be at the heart of what we do. Finding, showcasing, selling and ultimately wearing bags that have either been upcycled or fairly traded gives us all a great opportunity to &lsquo;make a difference&rsquo;.</p>\r\n<p>Increasingly, we are all starting to think more about the effect our purchases have on the environment and the people who produce the things we buy. So we hope that through our onfriday bags we can help to raise awareness of some important ethical issues whilst providing some very real and tangible support to the people on the ground who are helping to make this world a fairer, greener one.</p>\r\n<p>In terms of our carbon footprint, we&rsquo;re very conscious that some of our onfriday bags travel many miles before they get to us &ndash; it&rsquo;s a concern and one that makes us feel uncomfortable. So, we aim to reduce our CO<sub>2&nbsp;</sub>emissions as much as possible in the way we run our business on a day to day basis. And with an eye to reducing our carbon footprint even further in the future, we are particularly keen to showcase more designers based here in the UK who are producing ethical, upcycled and fairly traded bags.</p>\r\n<p>We&rsquo;ve also tried really hard to ensure all of our packaging is eco-friendly too. Our brown wrapping paper and particularly attractive green bubblewrap are both recycled and recyclable; the padded envelopes are paper-filled, reusable and fully recyclable; the paper-based tape uses natural adhesive and can be recycled; the raffia is from sustainable sources and our tags are made of paper from sustainable sources too.&nbsp;</p>\r\n<p>We''d love to hear what you think, so if you have any suggestions or feel we should be doing things differently or better, please feel free to <a href="mailto:enquiries@onfriday.co.uk">get in touch</a>!&nbsp;</p>\r\n<p><br /><br /></p>', '2010-10-12 16:02:59', '2013-08-22 17:35:18', 'A just and fair world is something worth striving for, however big the barriers may be. A greener world is crucially important too. But knowing what to do, how to do it and ensuring it''s a contribution that counts can be a real challenge. For us, trying to respond to this challenge is at the very heart of onfriday. We know we''re far from perfect and have a long way to go, however we hope that with your help what we are doing now, coupled with our plans for the future, we''ll start to make a difference - it might be a small contribution in the big scheme of things but it all counts!', 'onfriday, on friday, onfriday ethical statement, on friday ethical, onfriday recycled packaging, onfriday recyclable packaging, onfriday carbon footprint, onfriday carbon emissions, onfriday carbon offsetting, onfriday bags, just ethical bags, just ethical ltd', NULL, 2, 0, NULL, 1, 0, 'Untitled-2.jpg', 'image/jpeg', 50799, '2010-11-01 15:28:53', 'Handmade fair trade leather bag by NV London Calcutta', 'A just and fair world is something worth striving for, however big the barriers may be. A greener world is crucially important too. But knowing what to do, how to do it and ensuring it''s a contribution that counts can be a real challenge. For us, trying to respond to this challenge is at the very heart of onfriday. We know we''re far from perfect and have a long way to go, however we hope that with your help we''ll start to make a difference - it might be a small contribution in the big scheme of things but it all counts!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'What you say', 'what_youre_saying_about_us', 'What Youre Saying About Us', 7, 0, 0, 1, '2010-04-29 08:55:42', NULL, '2010-10-14 14:26:49', '2010-10-26 08:31:04', '', '', NULL, NULL, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Terms and Conditions', 'terms_and_conditions', 'Terms and Conditions', 8, 0, 0, 1, '2010-04-29 08:55:42', '<h2>This is where we sound quite stern. It doesn&rsquo;t suit us but apparently   we&rsquo;ve got to say it. So, here goes&hellip;</h2>\r\n<p>This site is owned and operated by Just Ethical Ltd. Our Registered Office is Headingley Enterprise and Arts Centre, Bennett Road, Headingley, Leeds LS6 3HN. Our Company is registered in England and Wales and our Company No is 7330897. Unless we say otherwise, we use the terms "we", "us" and "onfriday" on this page to refer to Just Ethical Ltd. If you have any queries regarding our terms and conditions or have any comments or suggestions on or about our website, please e-mail us at <a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a></p>\r\n<h2>Password and account security</h2>\r\n<p>You are responsible for maintaining the confidentiality of your password and account and any activities that occur under your account. Just Ethical Ltd shall not be liable to any person for any loss or damage which may arise as a result of any failure by you to protect your password or account.</p>\r\n<h2>Ownership of rights</h2>\r\n<p>All rights, including copyright and other intellectual property rights, in and to this website are owned by or licensed to Just Ethical Ltd. Any use of this website or its contents, including copying or storing it or them in whole or part, other than for your own personal, non-commercial use is prohibited without the permission of Just Ethical Ltd. You may not modify, distribute or re-post anything on this website for any purpose.</p>\r\n<h2>Accuracy of content</h2>\r\n<p>We will take all reasonable care to ensure that all details, descriptions and prices of products appearing on the website are correct at the time when the relevant information was entered onto the system. However, orders will only be accepted if there are no material errors in the description of the goods or their prices as advertised on the website.</p>\r\n<p>We have made every effort to display as accurately as possible the colours of our products that appear on the website. However, as the actual colours you see will depend on your monitor, we cannot guarantee that your monitor''s display of any colour will accurately reflect the colour of the product on delivery. Some of our products are made from reclaimed materials and therefore each bag will vary in terms of its colour and overall markings and therefore will not be identical to the product shown on the website.</p>\r\n<p>All sizes and measurements are approximate however we do make every effort to ensure they are as accurate as possible. Our prices are subject to change without notice.</p>\r\n<p>To the extent permitted by applicable law, Just Ethical Ltd disclaims all warranties, express or implied, as to the accuracy of the information contained in any of the materials on this website. Just Ethical Ltd shall not be liable to any person for any loss or damage which may arise from the use of any of the information contained in any of the materials on this website.</p>\r\n<p>The views expressed in user generated content are the opinions of those users and do not represent the views, opinions, beliefs or values of Just Ethical Ltd.</p>\r\n<h2>Damage to your computer</h2>\r\n<p>Just Ethical Ltd uses reasonable efforts to ensure that this website is free from viruses and other malicious or harmful content. However, we cannot guarantee that your use of this website (including any content on it or any website accessible from it) will not cause damage to your computer or other device. It is your responsibility to ensure that you have the right equipment (including antivirus software) to use the website safely and to screen out anything that may damage or harm your computer or other device. Except where required by applicable law, Just Ethical Ltd shall not be liable to any person for any loss or damage they suffer as a result of viruses or other malicious or harmful content that they access from or via the website.</p>\r\n<h2>Accepting your order</h2>\r\n<p>Completion of the online checkout process does not constitute our acceptance of your order. Our acceptance of your order will take place only when we dispatch the product(s) that you ordered from us.</p>\r\n<p>We will notify you by e-mail as soon as possible to confirm that we have received your order. All products that you order through the website will remain the property of Just Ethical Ltd until we have received payment in full from you for those products.</p>\r\n<p>During the checkout process, you will be asked to complete your payment details. All fields indicated as compulsory must be completed. Please note that we use the encrypted Sagepay payment gateway for all card payment transactions. This means that Just Ethical Ltd does not collect or store any payment card information.</p>\r\n<p>All card payments are subject to authorisation by your card issuer and we take payment when we accept your order shortly before dispatch. If your payment is not received and you have already received the products you ordered from us, you must pay for the products or return those products to us in accordance with reasonable return instructions that we provide to you and in the same condition that you received them at your own expense. If you do not do this within 30 days of the date on which we cancel your order, we may collect or arrange for collection of the products at your expense. We reserve the right to charge you for any and all damage to (or other adverse interference with) any products that are the subject of an unpaid order.</p>\r\n<h2>Product availability</h2>\r\n<p>All products are subject to availability. If for any reason we cannot supply you with the product you ordered, we will not process your order and will inform you of this by e-mail. If you have already paid for the product, we will refund you in full as soon as reasonably possible. As there is a small delay between the time when the order is placed and the time when the order is accepted, the stock position relating to particular items may change. If an item you have ordered becomes out of stock before we accept the order we shall notify you (either by e-mail or telephone call) as soon as possible and you will not be charged for the out of stock item(s).</p>\r\n<h2>Delivery and delivery costs</h2>\r\n<p>Delivery within the UK: we aim to deliver all UK standard delivery orders in 5-7 working days. <br />Standard delivery within the UK is free.</p>\r\n<p>Delivery to Europe: we aim to deliver all standard delivery orders in 7-10 working days. <br />Standard delivery to Europe will cost &pound;11.50.</p>\r\n<p>Delivery to the rest of the world: we aim to deliver all standard delivery orders within 14 working days. <br />Standard delivery to the rest of the world will cost &pound;18.00.</p>\r\n<p>Sometimes during sale periods or other busy periods, deliveries may take slightly longer. If you have not received your delivery within 8 working days (UK), 11 working days (Europe), or 15 working days (rest of the world), please e-mail orders@onfriday.co.uk</p>\r\n<p>All Just Ethical Ltd products, purchased by customers outside the UK and Europe are sold on a delivery duty unpaid basis. You may have to pay import duty or a formal customs entry fee prior to or on delivery. Additional taxes, fees or levies may apply according to local legislation. We recommend you check these details before placing an order for international delivery.</p>\r\n<h2>Your right to cancel</h2>\r\n<p>Under the distance selling regulations you have the legal right to cancel your order within 14 days of receipt of the goods. You do not need to give us a reason for cancelling your order however you will need to notify us, by e-mailing <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a>. Where products are delivered to a third party you will only be able to exercise this right if you are able to return the products to us.</p>\r\n<h2>Returning products and getting a refund</h2>\r\n<p>We hope you will be very pleased with your purchase. However, if you are not completely satisfied and you want to return the product please take reasonable care of it and do not use it prior to posting it back to us. Please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a> to let us know prior to posting. Please note that unless the product is faulty, damaged or has been incorrectly supplied by us we do not refund the return postage costs. We recommend you obtain proof of posting from the Post Office when returning products to us as we cannot be held responsible for parcels that get lost in the post. Once we have received and verified the returned item we will initiate a refund.</p>\r\n<p><strong>RETURNS ADDRESS IS - Just Ethical Ltd, Headingley Enterprise and Arts Centre, Bennett Road, Headingley, Leeds LS6 3HN</strong></p>\r\n<p>Refunds given by us will be made to the debit/credit card account provided when you placed your order. However, this will be subject to our right to withhold amounts for products which are damaged on return or where we incur a cost of recovery of the products. Refunds will be processed within 14 days of receiving the returned product.</p>\r\n<h2>Links to other websites</h2>\r\n<p>We have placed links on this website to other websites we think you may want to visit. We do not vet these websites and do not have any control over their contents. Just Ethical Ltd cannot accept any liability in respect of the use of these websites.</p>\r\n<h2>Using this website from outside the UK</h2>\r\n<p>Except where otherwise specified on this website, the materials on this website are displayed solely for the purposes of promoting Just Ethical Ltd&rsquo;s products available in the UK. However Just Ethical Ltd may accept orders for delivery to locations outside of the UK subject to customs, legal, regulatory and certain practical restrictions. Those who choose to access this website from locations outside the UK or place orders for delivery to locations outside the UK are responsible for compliance with local laws if and to the extent local laws are applicable.</p>\r\n<h2>Exclusions of liability</h2>\r\n<p>Any disclaimers and exclusions of liability in these terms &amp; conditions shall not apply to any damages arising from death or personal injury caused by the negligence of Just Ethical Ltd or any of its employees or agents or fraud. These disclaimers and exclusions shall be governed by and construed in accordance with English Law. If any provisions of these disclaimers and exclusions shall be unlawful, void or for any reason unenforceable then that provision shall be deemed severable and shall not affect the validity and enforceability of the remaining provisions.</p>\r\n<h2>Other legal notices</h2>\r\n<p>There may be legal notices on other areas of this website which relate to your use of this website, all of which will, together with these terms &amp; conditions govern your use of this website.</p>\r\n<h2>Changes to these terms and conditions</h2>\r\n<p>We reserve the right to change and update these terms and conditions from time to time and recommend that you revisit this page regularly to keep informed of the current terms and conditions that apply to your use of the website. By continuing to access, browse and use this website, you will be deemed to have agreed to any changes or updates to our terms and conditions.</p>\r\n<h2>Law, jurisdiction and language</h2>\r\n<p>This website, any content contained herein and any contract brought into being as a result of usage of this website are governed by and construed in accordance with English Law. The parties to any such contract agree to submit to the exclusive jurisdiction of the courts of England. All contracts are concluded in English. These terms and conditions do not affect your legal rights.</p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<h2>Gift Wishlist Terms and Conditions</h2>\r\n<p>The onfriday Gift Wishlist is designed for a one bag purchase &ndash; it is not like Amazon where you choose a range of products and your friends and family buy individual, separate items for you. However you can create more than one Gift Wishlist.</p>\r\n<p>In order to ensure you receive your bag in time for your special occasion, your target deadline date should be set no less than 7 working days before you want to take delivery. Your actual purchase must happen no less than 6 working days before you want to take delivery.</p>\r\n<p>When you have reached your contribution target or your deadline date (whichever happens first), your wishlist will automatically close and no further donations can be accepted.</p>\r\n<p>Once your gift wishlist has closed you will need to click ''END'' in ''Your Gift Wishlists'' in order to convert your donations into credit.</p>\r\n<p>Once you have converted your donations into credit you can purchase your bag in the on-line shop.</p>\r\n<p>If you do not reach your contribution target by the deadline date, do not fear - you''ll have 2 options...</p>\r\n<ul>\r\n<li>we''ll credit your account with the total amount raised and then you can make your own top-up contribution in order to buy your chosen wishlist bag. Top-up is made at checkout using your debit/credit card</li>\r\n<li>if you''d prefer not to make your own top-up contribution, we''ll still credit your account with the total amount raised and then you can choose a different bag to the value of your credit or less. Any remaining balance will stay in your account until it''s been fully redeemed</li>\r\n</ul>\r\n<p>If any product purchased through the Gift Wishlist is subsequently exchanged for a product of a lower price or a refund, any money owing will be added as credit to your onfriday account.</p>\r\n<p>If for any reason you have not spent your Gift Wishlist credit within 24 months any remaining credit balance will be cancelled.</p>\r\n<p>Gift Wishlist credit cannot be exchanged for cash.</p>\r\n<p>We reserve the right to amend the terms and conditions of the Gift Wishlist at any time and to take appropriate action, including the cancellation of any credit if, at its discretion, it deems such action necessary. This does not affect your legal rights.</p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<h2>Gift Voucher Terms and Conditions</h2>\r\n<p>The onfriday gift voucher can only be redeemed at www.onfriday.co.uk</p>\r\n<p>Recipients will need to set up an onfriday account and associate the voucher code with the account prior to making a purchase.</p>\r\n<p>The gift voucher code remains active in your account for a period of 24 months so you have the option to spend all or some of your credit whenever you make a purchase.&nbsp;The remaining balance will be updated after each transaction.</p>\r\n<p>You can purchase a product of a higher price than the face value of the gift voucher by simply paying the difference as you go through checkout.</p>\r\n<p>After 24 months (from the date of purchase) the gift voucher code will expire and any remaining balance will be cancelled.</p>\r\n<p>Gift vouchers cannot be exchanged for cash.</p>\r\n<p>If any product purchased with a gift voucher is subsequently exchanged for a product of a lower price or a refund, any money owing will be added to the remaining gift voucher balance.</p>\r\n<p>Please treat gift vouchers as you would cash &ndash; we will not accept liability for lost or stolen gift voucher codes so we strongly recommend you associate your voucher code with your onfriday account immediately upon receipt.</p>\r\n<p>You will be able to view your gift voucher balance (credit) by logging in to your account.</p>\r\n<p>We reserve the right to amend the terms and conditions of gift vouchers at any time and to take appropriate action, including the cancellation of the gift voucher code if, at its discretion, it deems such action necessary. This does not affect your legal rights.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2010-10-18 15:05:56', '2014-06-30 20:56:37', 'This page gives you information about our Terms and Conditions relating to your use of the onfriday website.', 'onfriday terms and conditions, onfriday terms & conditions, onfriday account security, rights, content, accuracy, order, product availability, delivery, delivery costs, right to cancel, returning products, refunds, liability, legal notices', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'Behind the brands', 'behind_the_brands', 'Behind the brands', 9, 0, 0, 1, '2010-04-29 08:55:42', NULL, '2010-10-26 08:24:59', '2010-11-04 14:34:32', '', '', NULL, NULL, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Gift Wrapping', 'gift_service', 'Gift Wrapping', 11, 0, 0, 1, '2010-04-29 08:55:42', '<h3>So, this is how it works...</h3>\r\n<h3>Your 3 steps</h3>\r\n<ul>\r\n<li><span style="font-size: 12px; font-weight: normal;">have a good mooch around our <a href="../../../page/bags" target="_blank">on-line shop</a> and when you''re ready to make a decision simply click the ''Add to Basket'' button&nbsp;</span></li>\r\n<li><span style="font-size: 12px; font-weight: normal;">then, when going through the checkout process, add the delivery address where you''d like the gift sent</span></li>\r\n<li><span style="font-size: 12px; font-weight: normal;">on the next page, select &lsquo;Gift wrap my Order&rsquo; and enter your own personal message you&rsquo;d like to send with your gift</span></li>\r\n</ul>\r\n<h3>Our 3 steps</h3>\r\n<ul>\r\n<li>our onfriday wrapper-upperer will lovingly wrap your gift</li>\r\n<li>we''ll enclose your special personal message</li>\r\n<li>we''ll pop to the Post Office and send your gift on its way to the lucky recipient!</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>And that&rsquo;s it, job done.&nbsp;Could it be any easier?!</p>', '2010-11-01 14:15:43', '2014-06-15 15:16:34', 'This must be the easiest way of becoming a particularly popular  person! If you want none of the hassle but all of the kudos, we think our gift wrapping service provides the perfect solution. All you need to do is choose a bag and we''ll do the rest. And it will only cost you an extra £4.95. Sorted. Quite possibly the best present you''ll ever send!', 'onfriday gift service, send a present, upcycled bags, fair trade bags, birthday present, anniversary present, gift wrap, gift wrapping, gift wrapped present, present wrap, gift wrapping service, gift wrapping option', NULL, 2, 0, NULL, 1, 0, 'Hatti Medium Shopper.jpg', 'image/jpeg', 34418, '2011-08-17 11:23:22', 'Hatti Fair Trade Medium Shopper in Red_onfriday', 'This must be the easiest way of becoming a particularly popular  person! If you want none of the hassle but all of the kudos, we think our gift wrapping service provides the perfect solution. All you need to do is choose a bag and we''ll do the rest. And it will only cost you an extra £4.95. Sorted.\r\n\r\nQuite possibly the best present you''ll ever send!\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Delivery and Returns', 'delivery_and_returns', 'Delivery and Returns', 12, 0, 0, 1, '2010-04-29 08:55:42', '<h2>We offer a Standard Delivery service only</h2>\r\n<p>Standard delivery within the UK:&nbsp;<br />This will usually take 5-7  working days and is free to all UK addresses. &nbsp;</p>\r\n<p>Standard delivery to Europe: <br />This will usually take 7-10 working  days and will cost &pound;11.50.</p>\r\n<p>Standard delivery to the rest of the world: <br />This will usually  take about 14 days and will cost &pound;18.00.</p>\r\n<p>Sometimes during sale periods or other busy periods, deliveries may  take slightly longer. If you have not received your delivery within 8  working days (UK), 11 working days (Europe), or 15 working days (rest of  the world), please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a></p>\r\n<h2>Orders placed from outside the UK and Europe</h2>\r\n<p>Our bags are sold on a delivery duty unpaid basis. So if you live  outside the UK and Europe you may have to pay import duty or a formal  customs entry fee prior to or on delivery. Additional taxes, fees or  levies may apply according to local legislation. We recommend you check  these details before placing an order for international delivery.</p>\r\n<h2>Your right to cancel</h2>\r\n<p>Under the distance selling regulations you have the legal right to  cancel your order within 14 days of receipt of the goods. You  do not need to give us a reason for cancelling your order however you  will need to notify us, by e-mailing <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a>. Where products are delivered to a third party you will only be able to  exercise this right if you are able to return the products to us.</p>\r\n<h2>Returning products and getting a refund</h2>\r\n<p>We hope you will be very pleased with your purchase. However, if you  are not completely satisfied and you want to return the product please  take reasonable care of it and do not use it prior to posting it back to  us.</p>\r\n<p>Please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a> to  let us know prior to posting. Please note that unless the product is faulty,  damaged or has been incorrectly supplied by us we do not refund the  return postage costs. We recommend you obtain proof of posting from the  Post Office when returning products to us as we cannot be held  responsible for parcels that get lost in the post. Once we have received  and verified the returned item we will refund you within 14 days. Refunds will be made to the debit/credit card account provided  when you placed your order. However, this will be subject to our right  to withhold amounts for products which are damaged on return or where we  incur a cost of recovery of the products.</p>\r\n<h2>Our address for returning your order</h2>\r\n<p>Just Ethical Ltd (onfriday), Headingley Enterprise and Arts Centre, Bennett Road, Headingley, Leeds LS6 3HN</p>\r\n<h2>Any queries?</h2>\r\n<p>If you have any queries at all, relating to delivery times or how to return a product, please don''t hesitate to <a href="mailto:orders@onfriday.co.uk">contact us</a>.</p>', '2010-11-01 14:27:37', '2014-06-30 20:00:06', 'Standard delivery within the UK: \r\nThis will usually take 5-7 working days and is free to all UK addresses. \r\nStandard delivery to Europe: \r\nThis will usually take 7-10 working days and will cost £11.50.\r\nStandard delivery to the rest of the world: \r\nThis will usually take up to 14 days and will cost £18.00.\r\nSometimes during sale periods or other busy periods, deliveries may take slightly longer. If you have not received your delivery within 8 working days (UK), 11 working days (Europe), or 14 working days (rest of the world), please e-mail orders@onfriday.co.uk', 'onfriday delivery, onfriday postage and packaging, onfriday P&P, onfriday delivery charges, onfriday standard delivery, onfriday returns, Christmas deliveries, delivery length', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', 'Hopefully this page provides all the information you need about deliveries and returns, however if you have any queries please don''t hesitate to contact us - just click on the ''contact us'' link at the foot of this page. \r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(13, 'Safe and Easy Ordering', 'safe_and_easy_ordering', 'Safe and Easy Ordering', 13, 0, 0, 1, '2010-04-29 08:55:42', '<p>Our Payment Service Provider is Sage Pay (formerly Protx) &ndash; the largest independent payment service provider (PSP) in the UK and Ireland. Sage Pay provides a secure payment gateway (Level 1 PCI DSS), processing payments for thousands of online businesses, including ours.</p>\r\n<p>It is Sage Pay&rsquo;s utmost priority to ensure that transaction data is handled in a safe and secure way. Sage Pay uses a range of secure methods such as fraud screening, I.P address blocking and 3D secure. Once on the Sage Pay systems, all sensitive data is secured using the same internationally recognised 256-bit encryption standards.</p>\r\n<p>Sage Pay is PCI DSS (Payment Card Industry Data Security Standard) compliant to the highest level and maintains regular security audits. They are also regularly audited by the banks and banking authorities to ensure that their systems are impenetrable.</p>\r\n<p>Sage Pay is an active member of the PCI Security Standards Council (PCI SSC) that defines card industry global regulation. In addition, you know that your session is in a secure encrypted environment when you see https:// in the web address, and/or when you see the locked padlock symbol alongside the URL. So when buying through our site, you can be sure that you are completely protected. More information about shopping securely with Sage Pay can be found at <a href="http://www.sagepay.com/secure_shopping" target="_blank">www.sagepay.com/shoppers</a></p>\r\n<p>If you have any queries, please <a href="mailto:enquiries@onfriday.co.uk">get in touch</a>.</p>', '2010-11-01 14:28:18', '2011-06-10 14:32:13', 'Our Payment Service Provider is Sage Pay (formerly Protx) – the largest independent payment service provider (PSP) in the UK and Ireland. Sage Pay provides a secure payment gateway (Level 1 PCI DSS), processing payments for thousands of online businesses, including ours.', 'safe ordering, security, card processing, paypal, sage pay, credit card payment, debit card payment, checkout, onfriday, bags', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', 'We’ve tried to make the whole ordering process straightforward, fast and secure. You can dip in and out of your basket whenever you want and can add, edit or delete at any time. If you have any queries or encounter any problems when progressing through to payment please don''t hesitate to contact us.\r\n\r\n\r\n\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(14, 'Privacy Policy', 'privacy_policy', 'Privacy Policy', 14, 0, 0, 1, '2010-04-29 08:55:42', '<p>We&rsquo;ve undertaken a cookie audit on our website and can confirm that our site www.onfriday.co.uk only uses cookies for internal administration purposes (e.g for our staff to login to the content management system administration area of our website). We don&rsquo;t use cookies to directly collect data from users of this site. <br /><br />The site uses a cookie called ''eskimodules_session'' to manage your basket through the shopping and payment process. This is not used to store any personal information and is deleted immediately when you leave the site.<br /><br />We use some third party applications within the website. This includes Google Analytics which provides user insight so that we can better understand where our audience is coming from and which pages our audience is engaging with. The only other third party cookies on the site are Facebook and Twitter. These third party cookies don''t store or track any personal information.<br /><br />Therefore, by using our website and blog the user is giving ''implied consent'' to the use of cookies.</p>\r\n<h2>\r\n<hr />\r\nYour privacy and security is really important to us, so this is how we will protect you&hellip;</h2>\r\n<p>This privacy policy explains how Just Ethical Ltd collects, stores and uses personal information about you and when you browse our website. It provides you with details about the types of personal information that we collect from you, how we use your personal information and the rights you have to control our use of your personal information. Please read this privacy policy carefully. By using this website, you confirm that you have read, understood and agree to this privacy policy in its entirety. Just Ethical Ltd may change this privacy policy from time to time by updating this page. We recommend you check this page on a regular basis to ensure you are happy with any changes we make. Unless we say otherwise, we use the terms "we", "us" and "onfriday" on this page to refer to Just Ethical Ltd.</p>\r\n<p>Just Ethical Ltd is committed to ensuring your privacy is protected at all times. You can be assured that any information you give to us will only be used in accordance with this privacy policy.</p>\r\n<h2>What information might we collect about you?</h2>\r\n<p>If you sign up to our e-newsletter or take part in any events, competitions or promotions, we may ask you for your name, home address, e-mail address, telephone number and occasionally some other relevant information for example your age or gender. When a purchase is made on our site, in addition to the above, we also ask for a delivery address (if this is different from your home address) and your payment method details. Occasionally, through on-line surveys and other requests, we may ask for information about your usage of our website which will help us develop and improve your onfriday experience.</p>\r\n<h2>How will we use this information?</h2>\r\n<p>The information you provide will enable us to fulfil your order, respond to any enquiries you have, improve the design, content and functionality of the website and to understand the buying behaviour of our registered users. From time to time we may also send you (by e-mail) information about our products and services and details of promotions and special offers. Don&rsquo;t worry we will not bombard you with stuff!</p>\r\n<h2>How you can control your personal information</h2>\r\n<p>If you don&rsquo;t want us to use your personal information for any of these purposes, we offer a range of ways in which you can let us know:</p>\r\n<ul>\r\n<li>Whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by us for direct marketing purposes: or</li>\r\n<li>All e-mail messages and e-mail newsletters will contain information on how you can unsubscribe; or</li>\r\n<li>You can e-mail us at <a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a>,&nbsp;writing "unsubscribe" in the subject heading</li>\r\n</ul>\r\n<p>You may request details of personal information which we hold about you under the Data Protection Act 1998. If you would like a copy of the information held on you please e-mail <a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a>. If you believe that any information we are holding on you is incorrect or incomplete, please let us know as soon as possible. We will promptly correct any information found to be incorrect.</p>\r\n<h2>Do we share any of your information?</h2>\r\n<p>We will not sell, distribute or lease your personal information to any third parties unless you give us explicit permission to do so or we are required to by law. Very occasionally, we might use your personal information to send you promotional information about third parties which we think you might be interested in however this will only happen if you tell us you would like it to happen.</p>\r\n<p>We may contract with other companies to provide certain services, including credit card processing, shipping, e-mail distribution, market research and promotions management. However please be assured that we only provide these companies with the information they need to perform their particular services. These companies are prohibited by contract from using this information for their own marketing purposes or from sharing this information with anyone other than Just Ethical Ltd.</p>\r\n<h2>How do we use Cookies?</h2>\r\n<p>A cookie is a small data file that is stored by your web browser on your computer. It helps websites to recognise your computer each time you return to a site which means the site will be able to tailor data to your specifications. Cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer and they do not store any personal information relating to you or your credit cards.</p>\r\n<p>You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.</p>\r\n<h2>Links to third-party sites</h2>\r\n<p>Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy policy. We strongly recommend you exercise caution and look at the privacy statement applicable to the website in question.</p>\r\n<h2>We take your security seriously</h2>\r\n<p>We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p>', '2010-11-01 14:29:07', '2012-06-26 21:43:29', 'This privacy policy explains how Just Ethical Ltd collects, stores and uses personal information about you and when you browse our website. It provides you with details about the types of personal information that we collect from you, how we use your personal information and the rights you have to control our use of your personal information. Please read this privacy policy carefully. By using this website, you confirm that you have read, understood and agree to this privacy policy in its entirety. Just Ethical Ltd may change this privacy policy from time to time by updating this page. We recommend you check this page on a regular basis to ensure you are happy with any changes we make. Unless we say otherwise, we use the terms "we", "us" and "onfriday" on this page to refer to Just Ethical Ltd.\r\nJust Ethical Ltd is committed to ensuring your privacy is protected at all times. You can be assured that any information you give to us will only be used in accordance with this privacy policy.', 'onfriday privacy policy, personal information, sharing information, cookies, third party sites, safeguard, secure, security', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', 'We''ve updated our privacy policy because there has been a lot of talk recently about the use of cookies due to the new EU Cookie Law legislation.  \r\n\r\nSo, here''s our privacy policy cookie update... \r\n\r\n\r\n\r\n\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `page_contents` (`id`, `navigation_title`, `url_title`, `title`, `page_node_id`, `completed`, `published`, `active`, `last_updated_at`, `main_content`, `created_at`, `updated_at`, `meta_description`, `meta_tags`, `created_by`, `updated_by`, `recycled`, `recycled_at`, `display`, `position`, `image_file_name`, `image_content_type`, `image_file_size`, `image_updated_at`, `image_alt`, `introduction`, `be_part_of_it_content_1`, `be_part_of_it_content_2`, `be_part_of_it_content_3`, `be_part_of_it_content_4`, `be_part_of_it_content_5`, `be_part_of_it_content_6`, `brand_id`, `designer`, `company`) VALUES
(15, 'In the Spotlight', 'in_the_spotlight', 'In the Spotlight', 15, 0, 0, 0, '2010-04-29 08:55:42', '<h3>How did you get started as a designer?</h3>\r\n<p>Prior to launching NV London Calcutta I spent 4 years as the Design Consultancy Manager at Bill Amberg, learning the A-Z of not only designing products but also all the other factors that go into producing a collection like costing, production and promotion. Designing is only the starting point of a range; it&rsquo;s often being able to turn the drawings in to a commercially viable offering that is the tricky part! You need to learn to be flexible and accommodating, especially in the ethical fashion world.</p>\r\n<h3>What projects are you currently involved in?</h3>\r\n<p>We have just launched our Back To Black Collection for Christmas which includes our gorgeous silk scarf collaboration with the very talented paper cut artist Rob Ryan and long awaited Men&rsquo;s Accessories Collection. Plus our specially commissioned Ayesha Make-up Purse for Cowshed&rsquo;s new Living Collection has just hit the stores, so we&rsquo;ve been busy bees!</p>\r\n<h3>What&rsquo;s going to be your next big thing?</h3>\r\n<p>We have a fantastic new classic bag range in the pipe line for next year. We are adding a new cooperative into the mix , that our workshop in Calcutta partners with, and are making use of their polished buffalo horn which is just beautiful. We are also developing a Home Collection, some new silks and have a couple of exciting new collaborative projects planned, though we can&rsquo;t say just yet who they are with - but we&rsquo;ll keep you posted!</p>\r\n<h3>Who has inspired you the most during your career to date?</h3>\r\n<p>My mum. She is a constant inspiration and a huge support. I have always looked up to and admired her. She created a very successful business from her passion in life and did it all as a single mother. She is a testament to never giving up on your dreams.</p>\r\n<h3>What gets you up on a morning?</h3>\r\n<p>Multiple cups of coffee and a loud alarm!! Unfortunately, I am not a morning person.&nbsp; I wish I was one of those people who find it easy to leap out of bed and spring into action but it&rsquo;s simply not the case, I am a complete night owl and am rarely at my desk before 9am. Once I am up and running though it&rsquo;s plain sailing. I absolutely love what I do and enjoy all the aspects of the business. The variety keeps me on my toes - there is certainly never a dull moment that&rsquo;s for sure.</p>\r\n<h3>What advice would you give young designers struggling to get their first foot on the ladder?</h3>\r\n<p>Work experience is invaluable. Learn from those you admire. Be prepared to be flexible, be proactive, aim high and never give up. Never be afraid to ask questions. Never assume or keep quiet if you aren&rsquo;t quite clear about something. If it&rsquo;s difficult and off putting, that&rsquo;s probably what you need to tackle and overcome in order to make it work!</p>\r\n<h3>What does the future hold for ethical fashion?</h3>\r\n<p>I think the future is bright. The increase in high quality, well designed ethical product which can compete with the high street is on the up and I look forward to seeing more ethical fashion, not only online but also on our high streets. John Lewis are trail blazing with their People Tree concessions and I&rsquo;m sure it won&rsquo;t be too long before others follow in their footsteps. There are also fantastic initiatives bringing the best of boutique ethical fashion to consumers. I am heavily involved with Ethical Just Got Fabulous the first ever, bi annual, pop-up ethical department store. It&rsquo;s a unique shopping experience that combines a multitude of fashion focussed brands with live music and a host of other exciting add ons to give even the most jaded shopaholic a refreshing alterative to trawling the pavements! <a href="http://www.ethicaljustgotfabulous.com" target="_blank">www.ethicaljustgotfabulous.com</a></p>\r\n<h3>What&rsquo;s your favourite book?</h3>\r\n<p>That is a really tricky one to decide, I&rsquo;m a complete book worm, so it&rsquo;s almost impossible to narrow it down to just one! I read City of Joy by Dominique Lapierre recently, which was just brilliant. It&rsquo;s a true story about the slums of Calcutta, so I was completely hooked from the off and it has to be up there with the all time best reads. I&rsquo;d have to add A Fine Balance by Rohinton Mistry to the list too and A Thousand Splendid Suns by Khaled Hosseni. Both are just incredibly powerful stories which had a real effect on me.</p>\r\n<h3>What&rsquo;s your favourite film?</h3>\r\n<p>I don&rsquo;t really watch so many films but I absolutely loved The Lives of Others. It&rsquo;s an incredible story about East Germany, just before the fall of the Wall. I cried my eyes out and it was on my mind for days afterwards. On a lighter note, The Cohen Brother&rsquo;s The Big Lebowski has to be mentioned. I could watch it again and again, it&rsquo;s genius.</p>\r\n<h3>What&rsquo;s your favourite piece of music/song?</h3>\r\n<p>I think my favourite song of all time is &lsquo;So Good Today&rsquo; by a fairly little known singer called Ben Westbeech. It makes me happy no matter what my mood. Though I couldn&rsquo;t listen to just one song forever, so if I had to choose just one artist it would have to be Nina Simone. Her voice is phenomenal and has a song for every state of mind!</p>\r\n<h3>What would be your perfect weekend?</h3>\r\n<p>A long one! Preferably with my very wonderful and long suffering boyfriend, somewhere that has no internet or phone reception.&nbsp; Alternatively, a weekend away in the countryside with my friends or my family, cooking up a storm and going for long walks by the sea sounds like bliss.</p>\r\n<h3>If you were stranded on a desert island, what 3 things would you take with you?</h3>\r\n<p>A solar powered laptop, bikini and a bottle of red wine!</p>\r\n<h3>If you could meet anyone in the world (dead or alive) who would it be and what would you say to them?&nbsp;</h3>\r\n<p>Ghandi. I&rsquo;m not sure what I&rsquo;d say, I&rsquo;d just like to listen.</p>\r\n<h3>How would you describe yourself?</h3>\r\n<p>Determined, passionate and good with people.</p>\r\n<h3>How would your friends describe you?</h3>\r\n<p>Fun loving, enthusiastic, loyal and supportive.</p>\r\n<h3>How would you liked to be remembered?</h3>\r\n<p>As someone who gave it their all.</p>', '2010-11-02 10:47:29', '2011-06-17 11:11:48', 'Prior to launching NV London Calcutta I spent 4 years as the Design Consultancy Manager at Bill Amberg, learning the A-Z of not only designing products but also all the other factors that go into producing a collection like costing, production and promotion. Designing is only the starting point of a range; it’s often being able to turn the drawings in to a commercially viable offering that is the tricky part! You need to learn to be flexible and accommodating, especially in the ethical fashion world.', 'Naomi Cornelius Reid, NV London Calcutta, NVLC, ethical fashion accessories, ethical just got fabulous, ethical fashion designer, onfriday designer, ethical fashion accessories designer', NULL, 2, 0, NULL, 1, 0, 'spotlight_nv.jpg', 'image/jpeg', 27236, '2010-11-04 15:24:41', 'Naomi Cornelius-Reid founder of NV London Calcutta', '', NULL, NULL, NULL, NULL, NULL, NULL, 4, 'Naomi Cornelius-Reid', 'Founder of NV London Calcutta'),
(16, 'Be Part Of It', 'be_part_of_it', 'Be Part Of It', 16, 0, 0, 1, '2010-04-29 08:55:42', '<h2>&hellip;as an onfriday friend</h2>\n<p>Tell us what you think about our bags, how we can do things differently or better, what we&rsquo;re not doing but perhaps should and also what you love about onfriday too! Sign up for our e-newsletter, e-mail us or join us on Facebook where you&rsquo;ll be able to help us decide what designers we showcase, what bags we sell and what good causes we support. You&rsquo;ll also be the first to hear about our great offers, promotions and product launches too.</p>', '2010-11-02 11:30:57', '2011-06-10 14:26:29', 'How to get involved with onfriday as a customer, friend, champion, designer, craftsperson, supplier, college, university, student, recent graduate', 'onfriday champion, onfriday customer, student placement, graduate internship, work-based project, university, college, partnership, upcycling, designers, fair trade, upcycled bags, fair trade bags, ethical bags, fashion placements, ethical fashion internships', NULL, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', '', '<h2>&hellip;as an onfriday friend</h2>\r\n<p>Tell us what you think about our bags, how we can do things differently or better, what we&rsquo;re not doing but perhaps should and also what you love about onfriday too! <a href="../../../page/newsletter-signup">Sign up for our e-newsletter</a>, <a href="../../../page/contact-us">e-mail us</a> or join us on <a href="http://www.facebook.com/onfridaybags" target="_blank">Facebook</a> where you&rsquo;ll be able to help us decide what designers we showcase, what bags we sell and what good causes we support. You&rsquo;ll also be the first to hear about our great offers, promotions and product launches too.</p>', '<h2>&hellip;as an onfriday champion</h2>\r\n<p>We&rsquo;re looking for a group of people who love great design, love bags, love ethical, love the onfriday way of thinking and love talking about it! Marketing guru Seth Godin would call you an early adopter who also sneezes! You&rsquo;re the type of person who is always in at the start, ahead of the curve and really passionate. And importantly, to be a sneezer, you also need to tell everyone (yes, everyone) about it. In return, we&rsquo;ll give you some great freebies and also offer you big discounts. So if you&rsquo;re interested please <a href="../../../page/contact-us">e-mail us</a>.</p>', '<h2>&hellip;as an onfriday designer, craftsperson or supplier&nbsp;&nbsp;&nbsp;</h2>\r\n<p>We&rsquo;re always on the lookout for great designers and suppliers who share our philosophy however there will always be a limit to our searching capabilities. We have no doubt many will never appear on our radar however hard we try and that concerns us. So, please <a href="../../../page/contact-us">get in touch</a> if you would like us to stock and showcase your bags. You&rsquo;ll need to demonstrate your green and/or fair trade credentials through the materials you use, your production process and your supply chain. <a href="../../../page/contact-us">E-mail us</a> with your details and we&rsquo;ll get in touch.</p>', '<h2>&hellip;if you work in a College or University</h2>\r\n<p>This is something for the future, but please do <a href="../../../page/contact-us">get in touch</a> now and tell us what you think. In a past life, we&rsquo;ve been involved in work-based projects, placements and final year dissertations and we&rsquo;re determined that onfriday plays its part in the nurturing of young talent. As we grow we would like to develop rewarding and meaningful partnerships with a number of colleges and universities and explore ways in which we can add value to your curriculum and the student learning experience.</p>', '<h2>&hellip;if you&rsquo;re a student or recent graduate</h2>\r\n<p>Again, this is something for the future. Getting a foot in the door can be really difficult at the start of your career. Finding valuable and rewarding placements, work-based projects and internships can be tough. We know young talent will keep us fresh and on our toes so in the future we&rsquo;ll be working up some opportunities for you to get involved. We&rsquo;ll probably use <a href="http://www.facebook.com/onfridaybags" target="_blank">Facebook</a> to throw around some initial ideas so make sure you&rsquo;re part of our <a href="http://www.facebook.com/onfridaybags" target="_blank">Facebook</a> gang!</p>', '<h2>&hellip;as a member of the onfriday team</h2>\r\n<p>We&rsquo;re small at the moment but we don&rsquo;t want to stay that way for too long. As we grow, we&rsquo;ll be looking for very special people to join us &ndash; people who share our values, are passionate about life and are very, very good at what they do! Get involved in <a href="http://www.facebook.com/onfridaybags" target="_blank">Facebook</a>, drop into our <a href="http://onfriday-ethical-bags.blogspot.com/" target="_blank">blog</a> every now and then or <a href="../../../page/newsletter-signup">sign up to our e-newsletter</a> and we guarantee you&rsquo;ll get to hear about every opportunity as it arises.</p>\r\n<p>E-mail us: <a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a><br />Join us on <a href="http://www.facebook.com/onfridaybags" target="_blank">Facebook</a></p>', NULL, NULL, NULL),
