(22, 'Press and Media', 'press_and_media', 'Press and Media', 19, 0, 0, 1, '2010-04-29 08:55:42', '<p>We love bags, great cutting-edge design and all things ethical &ndash; in a nutshell, that&rsquo;s what onfriday is all about. We source and showcase the very best designers and suppliers of high quality, unique and handmade ethical bags for both men and women through our website <a href="../../../page/bags">www.onfriday.co.uk.</a></p>\r\n<p>At the start of our journey, it was the story behind the bags that acted as the catalyst and these stories continue to be at the heart of onfriday. Finding, showcasing, selling and ultimately wearing bags that have either been upcycled or fairly traded give us all a great opportunity to make a difference, particularly since&nbsp;many of us are starting to think more about the effect our purchases have on the environment and the people who produce the things we buy.</p>\r\n<p>By offering an ethical alternative,&nbsp;onfriday is helping to raise awareness of some important ethical issues whilst also dispelling the myth that ethical fashion can''t be cutting-edge, bang on-trend and uber cool too! &nbsp;</p>\r\n<p>onfriday source their bags from some of the very best up-and-coming ethical designers and suppliers in the UK and around the world - you''ll be hard-pressed to find any of these bags on the high street today. "We wanted to do away with the time-consuming and often fruitless drudge of searching on-line that so many of us find frustrating and at times overwhelming." says Ali, "So we have created an exciting and vibrant one-stop-shop for people keen to make both a fashion statement as well as an ethical statement. It''s all about creating a fulfilling and engaging customer experience that showcases not just the bag but the story behind the bag too." &nbsp;</p>\r\n<p>Ali Gane says "We don&rsquo;t like high horses or soap boxes and we&rsquo;re certainly not in-your-face ethical preacher people. All that stuff just turns us off. But we would like to see a more just and fair world and we care about the future of our planet too. We also happen to love great cutting-edge design and really want to help young designers develop and grow. And it''s this combination that gives onfriday our reason-to-be."&nbsp;</p>\r\n<p>Need to get in touch?</p>\r\n<p>Please e-mail <a href="mailto:enquiries@onfriday.co.uk">enquiries@onfriday.co.uk</a>&nbsp;or write to Just Ethical Ltd, Headingley Enterprsie and Arts Centre, Bennett Road, Headingley, Leeds LS6 3HN.</p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p><a href="../../../images/press_files/6_logo.gif"> <img src="../../../assets/page_contents/22/contained_images/34ff6bfbeb75_10_logo.gif?1297340038" border="0" alt="" hspace="0" vspace="0" width="250" /></a>&nbsp;&nbsp;</p>\r\n<p>Why the name ''onfriday''? Well, we think it''s the best day of the week. It''s packed full of promise, anticipation and excitement. It''s a day we all look forward to.&nbsp;It''s a day when we pack our bags and go...&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><a href="../../../images/press_files/2_AQ025.jpg"> <img class="image_left" src="../../../assets/page_contents/22/contained_images/18fc212b33f4_6_AQ025.jpg?1297270165" border="0" alt="" hspace="0" vspace="0" width="121" height="182" /> </a> Aura Que - Bucket Bag - Fairly Traded - Handmade - Leather and Knitted Banana Yarn - &pound;175.00</p>\r\n<p>Click the image for high res product shot</p>\r\n<p>Click here for more information about the Aura Que <a href="../../../products/25" target="_blank">Bucket Bag</a></p>\r\n<p>Click here for more information about <a href="../../../brands/5" target="_blank">Aura Que</a></p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><a class="image_left" href="../../../images/press_files/3_EK046.jpg"><img src="../../../assets/page_contents/22/contained_images/81b145e0c649_7_EK046.jpg?1297337204" border="0" alt="" hspace="0" vspace="0" width="134" height="200" /></a>Elvis &amp; Kresse - One Night Bag - Upcycled - Handmade - Decommissioned UK Fire Hose - &pound;215.00</p>\r\n<p>Click the image for high res product shot</p>\r\n<p>Click here for more information about the Elvis &amp; Kresse&nbsp;<a href="../../../products/39" target="_blank">One Night Bag</a></p>\r\n<p>Click here for more information about <a href="../../../brands/11" target="_blank">Elvis</a></p>\r\n<p>&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><a class="image_left" href="../../../images/press_files/4_CY033.jpg"><img src="../../../assets/page_contents/22/contained_images/f016becbc0c9_8_CY033.jpg?1297337242" border="0" alt="" hspace="0" vspace="0" width="124" height="186" /></a>Cyclus - Plaza Messenger Bag - Upcycled - Handmade - Inner Tubes of Tyres - &pound;92.00</p>\r\n<p>Click the image for high res product shot</p>\r\n<p>Click here for more information about the Cyclus <a href="../../../products/31" target="_blank">Plaza Messenger Bag</a></p>\r\n<p>Click here for more information about <a href="../../../brands/7" target="_blank">Cyclus</a></p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p><a class="image_left" href="../../../images/press_files/5_NV020.jpg"><img src="../../../assets/page_contents/22/contained_images/c53a839f78ac_9_NV020.jpg?1297337400" border="0" alt="" hspace="0" vspace="0" width="127" height="191" /></a>NV London Calcutta - Germaine Satchel - Fairly Traded - Handmade - Leather - &pound;125.00</p>\r\n<p>Click the image for high res product shot</p>\r\n<p>Click here for more information about the NV London Calcutta <a href="../../../products/22" target="_blank">Germaine Satchel</a></p>\r\n<p>Click here for more information about <a href="../../../brands/4" target="_blank">NV London Calcutta</a>&nbsp;</p>\r\n<hr />\r\n<br />\r\n<p>&nbsp;</p>', '2011-02-03 11:53:09', '2012-05-11 13:41:25', 'Welcome to the onfriday Press Page. Here you''ll find some information about onfriday, including some quotes from the founder of onfriday Ali Gane. We''re very happy for you to use any or all of this information. We have also included some sample product shots for you to use however please bear in mind that all photography remains the copyright of onfriday. If you require high res shots just ask! \r\nWe love bags, great cutting-edge design and all things ethical – in a nutshell, that’s what onfriday is all about. We source and showcase the very best designers and suppliers of high quality, unique and handmade ethical bags for both men and women.', 'onfriday press and media, onfriday, on friday, Ali Gane, onfriday ethical bags, onfriday upcycled bags, onfriday fair trade bags, onfriday fairly traded bags, onfriday product shots', 1, 2, 0, NULL, 1, 0, 'Elvis & Kresse fire hose One Night Bag.jpg', 'image/jpeg', 26169, '2011-11-30 17:47:25', 'Elvis & Kresse One Night Bag made from genuine de-commissioned UK fire hose', 'Welcome to the onfriday Press Page. Here you''ll find some information about onfriday, including some quotes from the founder of onfriday Ali Gane. We''re very happy for you to use any or all of this information. We have also included our logo and some sample product shots for you to use however please bear in mind that all photography remains the copyright of onfriday. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
