(24, 'In the Spotlight with Laura Queening, Founder of Aura Que', 'in_the_spotlight', 'In the Spotlight', 15, 0, 0, 1, '2010-04-29 08:55:42', '<h3><strong><span style="font-size: 12px;">How did you get started as a designer?</span></strong></h3>\r\n<p><span style="font-size: 12px; font-weight: normal;">I always wanted to do something creative that I was passionate about. I went to London College of Fashion to study Accessory Design at the Cordwainer&rsquo;s college, graduating in 2007. From then, I knew I wanted to produce my own collections and work &lsquo;hands on&rsquo; with manufacturers.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>So, as a designer, what do you get involved in?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I develop the designs and patterns for all AURA QUE products, as well as collaborating with the sample makers on some designs. I have to source all the materials and liaise with all my Nepalese suppliers and manufacturers to ensure the best quality for my products. Then there&rsquo;s the sales and marketing &ndash; working with all the boutiques that stock AURA QUE, as well as individual customer enquiries. &nbsp;At the moment, I work on most areas so it takes up most of my time!</span></p>\r\n<h3><strong><span style="font-size: 12px;">What are you planning or working towards at the moment?</span></strong></h3>\r\n<p><span style="font-size: 12px; font-weight: normal;">My A/W 2011 production is going on at the moment - it is coming together really nicely! I am trying to blog about our progress as it goes on over the summer. I am also getting together my Spring/Summer 2012 samples, mixing leather with heavy cottons for a summery collection.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What do you love most about what you do?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">It has to be the variety - everyday is different! It is a real challenge working in Nepal but I love the adventure!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>Who has inspired you the most during your career to date?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I have been inspired by SO many people, over the last few years especially &ndash; no one can get where they are without the help and inspiration of others. I suppose my list includes friends and family, great business mentors, ex-colleagues from my university who are working in some fantastic fashion houses, some of the Nepalese producers who work with me in the factory. I also find fashion forward brands such as MIISTA and Ada Zanditon really inspiring for their ethics and style.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What advice would you give young designers struggling to get their first foot on the ladder?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Of course, be determined and work hard, though networking and seeking advice is the best way to move forward.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What do you think the future looks like for &lsquo;ethical fashion&rsquo;?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I think its positive and will eventually become the standard practise &ndash; I am really hopeful for this.</span></p>\r\n<p><strong>What would be your perfect weekend?&nbsp;</strong></p>\r\n<p><span style="font-size: 12px; font-weight: normal;">Probably a bit of yoga, a motorbike trip out of the city and some beers in the sun with friends!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>If you could choose anyone, what 3 people would you invite over for a dinner party?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Off the top of my head&hellip;&hellip;Vivienne Westwood, Dalai Lama, and my sister Elspeth &ndash; she would provide the light entertainment!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>If you were stranded on a desert island, what 3 things would you take with you?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Bikini, iPod and a sketchbook &ndash; I would make the most of the time off &ndash; and be eternally optimistic someone would find me!!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last book you read?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Before I went on my road trip to Delhi for meetings with fittings suppliers, I was given &lsquo;The Alchemist&rsquo; to read by Rita, the previous marketing manager at Sana Hastakala where the Jogi Bag Range is made. I have never read it before and it was a perfect read for my 40 hour bus ride!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last film you watched at the cinema?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">There isn&rsquo;t much choice in Nepal for western films, though plenty of Bollywood films, but I did indulge by going to see the new Pirates of the Caribbean in 3D last week &ndash; a new thing in Nepal!!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last music download/CD you bought?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I rely on friends and family for new music really &ndash; my brother made me a great dance/electro iPod mix that gets me going in the mornings on the way to the factory. Otherwise, my friend Shirley recently introduced me to Tina Dickow, a Danish artist.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>How would you describe yourself?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I try not to take myself too seriously!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>Do you have a favourite quotation or a saying that has inspired you?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I still remember getting a card when I was a teenager that said &ldquo;Shoot for the moon because even if you miss, you&rsquo;ll land amongst the stars&rdquo;.<br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><em><strong><span style="font-size: 12px;">Big thanks Laura - we can''t wait for your Autumn/Winter collection to arrive - watch this space folks!&nbsp;</span></strong></em></p>', '2010-11-02 10:47:29', '2014-06-30 21:15:37', 'Aura Que''s founder Laura Queening has taken some time out from her busy schedule to give onfriday a little taster of her life as an ethical fashion designer. Currently in Nepal bringing to life her Autumn/Winter 2011 collection, Laura is fast becoming a ''one-to-watch'' designer and has just had one of her Jogi bags featured in Grazia magazine. ', 'Laura Queening, Aura Que, ethical fashion, ethical fashion designer, ethical fashion designers, fair trade bags, fair trade handbags, ethical bags, ethical bag, ethical handbag, ethical handbags, designer ethical bag, designer ethical handbag, designer ethical bags, designer ethical handbags, yorkshire ethical fashion designer, ', 2, 2, 0, NULL, 1, 0, 'Laura Queening, Founder of Aura Que.JPG', 'image/jpeg', 78735, '2011-06-17 11:02:09', 'Laura Queening, founder of Aura Que', 'Aura Que''s founder Laura Queening has taken some time out from her busy schedule to give onfriday a little taster of her life as an ethical fashion designer. We caught up with Laura in Nepal as she was bringing to life her Autumn/Winter 2011 collection, Laura is fast becoming a ''one-to-watch'' designer and has just had one of her Jogi bags featured in Grazia magazine too! ', NULL, NULL, NULL, NULL, NULL, NULL, 5, 'Laura Queening', 'Founder of Aura Que'),
(25, 'Gift Service', 'gift_service', 'Gift Service', 11, 0, 0, 0, '2010-04-29 08:55:42', '<h2>Gift Wrapping</h2>\r\n<p>This is the easiest way of becoming a very popular person. So, if you want none of the hassle but all of the kudos, our gift wrapping service is the perfect solution. And it will only cost you an extra &pound;4.95. All you need to do is choose the bag and we&rsquo;ll do the rest!</p>\r\n<h3>Here&rsquo;s how it works&hellip;</h3>\r\n<p><span style="font-weight: normal; font-size: 12px;">Step 1<span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>Choose a bag, add it to your basket and head for the&nbsp;&lsquo;checkout&rsquo;</span></p>\r\n<p><span style="font-weight: normal; font-size: 12px;">Step 2<span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>Add the name and address of the lucky person under &lsquo;delivery<span style="white-space: pre;">&nbsp;</span>address&rsquo;</span></p>\r\n<p><span style="font-weight: normal; font-size: 12px;">Step 3<span style="white-space: pre;"> <span style="white-space: pre;"> </span></span>Select &lsquo;gift wrap my order&rsquo; and enter your personal message&nbsp;for them</span></p>\r\n<p>We&rsquo;ll then wrap your present, handwrite your personal message and pop it in the post for you. It really is that simple!</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: 18px;">COMING SOON!!</span></p>\r\n<h2>Gift Vouchers</h2>\r\n<p>Choosing the perfect bag for your loved one can be a tricky business. If you&rsquo;re not too sure which one to plump for and don&rsquo;t want to take the risk then our Gift Vouchers may be just what you&rsquo;re after. They&rsquo;ll come in multiples of &pound;10 and will be available to download instantly as a beautifully designed gift certificate. If you&rsquo;d prefer, we&rsquo;ll also be able to send an email to the lucky person with the gift certificate attached. A great way to save your blushes if it&rsquo;s all a bit last minute!</p>\r\n<h2>Gift Wish List</h2>\r\n<p>We&rsquo;re very aware that some of our amazing, unique and handmade bags don&rsquo;t come cheap! And in this climate splashing out is either impossible or difficult to justify for a lot of us. However if you&rsquo;ve got a birthday, anniversary or special event coming up and your friends and family are already asking you what you might like as a present, our Gift Wish List is going to blow you away, seriously!</p>\r\n<p>You create your very own secure Wish List page on the website and choose your perfect bag. We&rsquo;ll then help you email friends and family to let them know how they can make a contribution. It&rsquo;s a bit like the &lsquo;Just Giving&rsquo; website, except this time you&rsquo;re the charity! So, watch this space&hellip;</p>', '2010-11-01 14:15:43', '2011-02-04 13:05:16', 'The onfriday gift service - probably the best present you''ll ever   send or receive! We currently offer a great gift wrapping service and will be introducing two very exciting extra services very soon - Gift Vouchers and a seriously cool Gift Wish List. So read on...', 'onfriday gift service, on friday gift service, gift wrapping, present wrapping, gift wrapping, gift voucher, gift vouchers, gift wish list, gift wishlist, birthday present, birthday gift, send a present, upcycled bags, fair trade bags, birthday present, anniversary present, ', 2, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', 'The onfriday gift service - probably the best present you''ll ever   send or receive! We currently offer a great gift wrapping service and will be introducing two very exciting extra services very soon - Gift Vouchers and a seriously cool Gift Wish List. So read on...\r\n\r\n\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Gift Voucher', 'gift_voucher', 'Gift Voucher', 21, 0, 0, 1, '2010-04-29 08:55:42', '<p>Gift vouchers are available in multiples of &pound;10, up to a maximum of   &pound;250. Once you''ve made your purchase, you will be able  to&nbsp;instantly&nbsp;download a beautifully designed and personalised gift   certificate which you can print off and then send to the lucky person.  Or, if  you prefer, we can send an instant email to them which will  include your own personal message and a unique gift voucher code.</p>\r\n<p>Gift vouchers are available from our website 24/7 and are processed  and despatched in less than 30 seconds so  it&rsquo;s also a great way to save  your blushes if it&rsquo;s all a bit last  minute!</p>\r\n<p>So, when you''re ready, just fill in the details below and then choose  either the print option (where we email you the gift  certificate for you to print off) or the email option (where we email your message and voucher code direct to the  recipient).</p>', '2011-08-17 10:40:40', '2013-12-04 18:24:22', 'Choosing the perfect present for your loved one can often be a tricky business. If you''re not too sure what to plump for and would prefer to avoid a mini gift disaster then an onfriday Gift Voucher could be the ideal solution for you! Just perfect if you''re stumped for an idea, want to avoid those long queues at the Post Office or you simply don’t want to take the risk. \r\n', 'onfriday gift voucher, onfriday gift certificate, onfriday, onfriday bags, voucher, vouchers, gift voucher, gift vouchers, gift certificate, gift certificates, birthday, present, birthday present ideas, gift, birthday gift, birthday gift ideas, christmas present, christmas present ideas, christmas gift, christmas gift ideas', 1, 2, 0, NULL, 1, 0, 'brands_aura_que.jpg', 'image/jpeg', 29297, '2011-08-17 10:50:42', 'Aura Que Bucket Bag_onfriday', 'Choosing the perfect present for your loved one can often be a tricky business. If you''re not too sure what to plump for and would prefer to avoid a mini gift disaster then an onfriday Gift Voucher could be the ideal solution for you! Just perfect if you''re stumped for an idea, want to avoid those long queues at the Post Office or you simply don’t want to take the risk. \r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Gift Wishlists', 'gift_wishlists', 'Gift Wishlists', 22, 0, 0, 1, '2010-04-29 08:55:42', '<h2 style="padding-top: 0px;">Here&rsquo;s how it works...</h2>\r\n<ul>\r\n<li>You choose a bag that you would like to receive as a gift</li>\r\n<li>We&rsquo;ll then help you create your very own personalised Gift Wishlist page  which will display a picture and a description of your chosen bag, a welcome message from you to all your friends and family, your contribution target and your  deadline date</li>\r\n<li>When you have set up your page, you&rsquo;ll have the opportunity to send  an email to everyone you think would like to make a contribution</li>\r\n<li>This email will contain a link which will take your friends and family straight to your Gift Wishlist page where they will be able to make  a contribution and leave a message for you </li>\r\n<li>Once you''ve reached your target or your deadline date (whichever  comes first), your wishlist automatically closes. You can then convert  your donations into credit and start shopping!&nbsp;</li>\r\n</ul>\r\n<br />\r\n<h2>So, when you&rsquo;re ready, this is what you&rsquo;ll need to do&hellip;</h2>\r\n<ul>\r\n<li>Either <a href="../../../login">log in to your account</a> or  <a href="../../../users/new">Register<br /></a></li>\r\n<li>Have a browse in the shop and choose your bag by clicking the ''Add this to my Wishlist''  button&nbsp;</li>\r\n<li>This will take you to your Wishlist page where you can name your campaign, add or edit your  ''welcome'' message and set the target deadline date.  At this point, you&rsquo;ll also be asked to accept the terms and conditions  (see below)</li>\r\n<li>You''re now ready to click &lsquo;Contact my Friends and Family&rsquo; where you can add all their email addresses</li>\r\n<li>To make it as easy as possible, we have created some standard email text however you&rsquo;ll have  the option to edit this text if you want so it&rsquo;s a bit more personal to  you. When you''re happy with the text, click the Send button</li>\r\n</ul>\r\n<p>As the days go by you can check how your total contributions are growing and&nbsp;have a  look at all the messages from friends and family at any time simply by  logging in to your account and clicking &lsquo;Your Gift Wishlists&rsquo;.</p>\r\n<p>Once your target has been reached or your deadline date has arrived  (whichever comes first), your wishlist automatically closes. You can  then convert all the donations into credit in your account and then hit  the shop! Purely for nostalgic sentimentality, once your&nbsp;Gift Wishlist  has closed you will still be able to view all those lovely messages  whenever you log into your account!</p>\r\n<p>&nbsp;</p>\r\n<h2 id="tac" class="underline">Gift Wishlist Terms and Conditions</h2>\r\n<p>These are the really important things you need to know about the Gift Wishlist so please take some time to have a read through&hellip;</p>\r\n<ul>\r\n<li>The onfriday Gift Wishlist is designed for a one bag purchase &ndash; it  is not like Amazon where you choose a range of products and your friends  and family buy individual, separate items for you. However you can  create more than one Gift Wishlist</li>\r\n<li>In order to ensure you receive your bag in time for your special  occasion, your target deadline date should be set no less than 7 working  days before you want to take delivery. Your actual purchase must happen  no less than 6 working days before you want to take delivery</li>\r\n<li>When you have reached your contribution target or your deadline date  (whichever happens first), your wishlist will automatically close and  no further donations can be accepted.&nbsp;</li>\r\n<li>Once your gift wishlist has closed you will need to click ''END'' in  ''Your Gift Wishlists'' in order to convert your donations into credit</li>\r\n<li>Once you have converted your donations into credit you can purchase your bag in the on-line shop</li>\r\n</ul>\r\nIf you do not reach your contribution target by the deadline date, do not fear - you''ll have 2 options<br /> <ol>\r\n<li>We''ll credit your account with the total amount raised and then you  can make your own top-up contribution in order to buy your chosen  wishlist bag. Top-up is made at checkout using your debit/credit card</li>\r\n<li>If you''d prefer not to make your own top-up contribution, we''ll  still credit your account with the total amount raised and then you can  choose a different bag to the value of your credit or less. Any  remaining balance will stay in your account until it''s been fully  redeemed</li>\r\n</ol> \r\n<ul>\r\n<li>If any product purchased through the Gift Wishlist is subsequently  exchanged for a product of a lower price or a refund, any money owing  will be added as credit to your onfriday account</li>\r\n<li>If for any reason you have not spent your Gift Wishlist credit within 24 months any remaining credit balance will be cancelled</li>\r\n<li>Gift Wishlist credit cannot be exchanged for cash</li>\r\n</ul>\r\n<p>And the really stern stuff...</p>\r\n<ul>\r\n<li>onfriday reserves the right to amend the terms and conditions of the  Gift Wishlist at any time and to take appropriate action, including the  cancellation of any credit if, at its discretion, it deems such action  necessary. This does not affect your legal rights</li>\r\n</ul>\r\n<p>If you have any queries please feel free to drop us an email. Just click this link -&nbsp;<a href="mailto:info@onfriday.co.uk">info@onfriday.co.uk</a></p>', '2011-08-17 11:28:27', '2013-12-04 18:50:21', 'Have you got a birthday coming up? Perhaps Christmas is just around the corner or there''s a special occasion fast approaching... If so, then our very special onfriday Gift Wishlist could be just what you''re looking for! You can wave goodbye to those ''almost useful'', ''not quite perfect'' or ''so not me'' presents that, lets admit it, we all receive at some stage during our lives! With our wishlist, you choose your present and your friends and family all chip in to foot the bill! Now that''s what we call a good deal!', 'onfriday, onfriday gift wishlist, onfriday gift wish list, gift wish list, gift wishlist, gift wishlists, gift wish lists, birthday, birthday wishlist, birthday wish list, birthday present list, present list, bag, bags, upcycled bag, upcycled bags, fairtrade bags, fair trade bags, fairly traded bags, onfriday bags', 1, 2, 0, NULL, 1, 0, 'Elvis & Kresse One Night Bag.jpg', 'image/jpeg', 26168, '2011-08-17 11:34:12', '', 'Have you got a birthday coming up? Or perhaps Christmas is just around the corner. If so, then our very special onfriday Gift Wishlist could be just what you''re looking for! You can wave goodbye to those ''almost useful'' or ''so not me'' presents that, lets admit it, we all receive at some stage during our lives! With our wishlist, you choose your present and your friends and family all chip in to foot the bill! Cool. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'New Donation', 'new_donation', 'New Donation', 23, 0, 0, 1, '2010-04-29 08:55:42', '<p>You''re through to the onfriday Gift Wishlist contribution page. Here,  you can leave a special message and make your payment.&nbsp;Your message and   the amount you have contributed will appear on their personal Gift   Wishlist page - you can keep the value of your contribution secret if   you prefer. Payment is processed through our Sagepay payment gateway so   it is completely safe and secure. As an added security measure we do  ask  that you register with onfriday before you make your payment,  however  we do not use or share this information. Because we use Sagepay   as our payment gateway, we do not have access to or keep on record any   payment card details. Thanks for making a contribution to the Gift   Wishlist and making their wish come true!</p>', '2011-08-17 11:34:50', '2011-08-17 11:35:26', '', '', 1, 1, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'Delivery and Returns', 'delivery_and_returns', 'Delivery and Returns', 12, 0, 0, 0, '2010-04-29 08:55:42', '<h2>Standard Delivery&nbsp;</h2>\r\n<p>Standard delivery within the UK:&nbsp;<br />This will usually take 5-7  working days and is free to all UK addresses. &nbsp;</p>\r\n<p>Standard delivery to Europe: <br />This will usually take 7-10 working  days and will cost &pound;11.50.</p>\r\n<p>Standard delivery to the rest of the world: <br />This will usually  take about 14 days and will cost &pound;18.00.</p>\r\n<p>Sometimes during sale periods or other busy periods, deliveries may  take slightly longer. If you have not received your delivery within 8  working days (UK), 11 working days (Europe), or 15 working days (rest of  the world), please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a></p>\r\n<h2>Next Working Day Delivery</h2>\r\n<p>This is only available to addresses  within the UK and will cost &pound;8.99. To guarantee next working day  delivery, your order must be placed before 12noon, Monday &ndash; Friday. Please  note Saturday and Sunday (and all Bank Holidays) are not classed as a working day so if you place  your order before 12noon on Friday and select next working day delivery,  your order will arrive on Monday. Likewise, orders placed over the weekend will arrive on the Tuesday. A signature is required at the  delivery address as confirmation and acceptance of delivery.</p>\r\n<h2>Orders placed from outside the UK and Europe</h2>\r\n<p>Our bags are sold on a delivery duty unpaid basis. So if you live  outside the UK and Europe you may have to pay import duty or a formal  customs entry fee prior to or on delivery. Additional taxes, fees or  levies may apply according to local legislation. We recommend you check  these details before placing an order for international delivery.</p>\r\n<h2>Your right to cancel</h2>\r\n<p>Under the distance selling regulations you have the legal right to  cancel your order within seven working days of receipt of the goods. You  do not need to give us a reason for cancelling your order however you  will need to notify us, by e-mailing <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a>. Where products are delivered to a third party you will only be able to  exercise this right if you are able to return the products to us.</p>\r\n<h2>Returning products and getting a refund</h2>\r\n<p>We hope you will be very pleased with your purchase. However, if you  are not completely satisfied and you want to return the product please  take reasonable care of it and do not use it prior to posting it back to  us.</p>\r\n<p>Please e-mail <a href="mailto:orders@onfriday.co.uk">orders@onfriday.co.uk</a> to  let us know prior to posting. All products should be returned in their  original packaging. Please note that unless the product is faulty,  damaged or has been incorrectly supplied by us we do not refund the  return postage costs. We recommend you obtain proof of posting from the  Post Office when returning products to us as we cannot be held  responsible for parcels that get lost in the post. Once we have received  and verified the returned item we will refund you within a maximum of  30 days. Refunds will be made to the debit/credit card account provided  when you placed your order. However, this will be subject to our right  to withhold amounts for products which are damaged on return or where we  incur a cost of recovery of the products.</p>\r\n<h2>Our address for returning your order</h2>\r\n<p>Just Ethical Ltd, Headingley Enterprise and Arts Centre, Bennett Road, Headingley, Leeds LS6 3HN</p>\r\n<h2>Any queries?</h2>\r\n<p>If you have any queries at all, relating to delivery times or how to return a product, please don''t hesitate to <a href="mailto:orders@onfriday.co.uk">contact us</a>.</p>', '2010-11-01 14:27:37', '2014-06-15 14:49:18', 'Standard delivery within the UK: \r\nThis will usually take 5-7 working days and is free to all UK addresses. \r\nStandard delivery to Europe: \r\nThis will usually take 7-10 working days and will cost £11.50.\r\nStandard delivery to the rest of the world: \r\nThis will usually take up to 14 days and will cost £18.00.\r\nSometimes during sale periods or other busy periods, deliveries may take slightly longer. If you have not received your delivery within 7 working days (UK), 10 working days (Europe), or 12 working days (rest of the world), please e-mail orders@onfriday.co.uk\r\nNext working day delivery:\r\nThis is only available to addresses within the UK and will cost £8.99. To guarantee next working day delivery, your order must be placed before 12noon, Monday – Friday. Please note Saturday and Sunday is not classed as a working day so if you place your order before 12noon on Friday and select next working day delivery, your order will arrive on Monday. Likewise, orders placed over the weekend will arrive on the Tuesday. A signature is required at the delivery address as confirmation and acceptance of delivery.', 'onfriday delivery, onfriday postage and packaging, onfriday P&P, onfriday delivery charges, onfriday next working day delivery, onfriday standard delivery, onfriday returns, Christmas deliveries', 2, 2, 0, NULL, 1, 0, NULL, NULL, NULL, NULL, '', 'Hopefully this page provides all the information you need about deliveries and returns, however if you have any queries please don''t hesitate to contact us - just click on the ''contact us'' link at the foot of this page. \r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
