INSERT INTO `products` (`id`, `name`, `summary`, `description`, `price`, `stock`, `created_at`, `updated_at`, `created_by`, `updated_by`, `recycled`, `recycled_at`, `display`, `position`, `fair_trade`, `upcycled`, `brand_id`, `stock_message`, `size`, `men`, `women`, `product_code`, `sale_price`, `sale`, `cached_slug`, `new_in`) VALUES
(4, 'Haversack Bag', 'The Alchemy Goods upcycled Haversack bag is a small messenger bag that''s been handmade using recycled bike inner tubes. It’s big enough for a warm layer, some snacks, a bottle of water and a small notebook or camera – ideal for everyday use. \r\n', '<ul>\r\n<li>Durable, water resistant exterior constructed from upcycled bike inner tubes</li>\r\n<li>Shoulder strap made from upcycled seatbelt (colours may vary slightly)</li>\r\n<li>Green piping with aqua lining</li>\r\n<li>Zippered exterior pocket</li>\r\n<li>One internal pocket plus pen slots</li>\r\n<li>Internal key clip</li>\r\n<li>73% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>', 72, 0, '2010-10-19 11:00:04', '2013-03-10 12:58:29', NULL, 2, 0, NULL, 1, 34, 0, 1, 2, '', 'L15cm x W15cm x H28cm', 1, 1, 'AG001', NULL, 0, 'haversack-bag', 0),
(5, 'Pike Messenger Bag', 'The Alchemy Goods upcycled Pike Messenger Bag has been handmade using recycled bike inner tubes. With two separate compartments, it will accommodate a netbook or small laptop (up to 15") and all those daily essentials to keep you going throughout the day. Cool urban design and 100% waterproof too - perfect for anyone wanting a messenger bag with real attitude! \r\n', '<ul>\r\n<li>Durable, water resistant      exterior constructed from upcycled bike inner tubes</li>\r\n<li>Shoulder strap made from      upcycled seatbelt (colours may vary slightly)</li>\r\n<li>Green piping with aqua lining</li>\r\n<li>Waterproof zippered exterior      pocket</li>\r\n<li>Zipper pull made from an      upcycled inner tube valve stem</li>\r\n<li>Internal divider keeps files or      laptop secure</li>\r\n<li>Two internal pockets plus pen      slots</li>\r\n<li>High quality reflective tape      for night time visibility</li>\r\n<li>Internal key clip</li>\r\n<li>76% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>', 95, 0, '2010-10-19 11:02:30', '2012-07-20 08:05:17', NULL, 2, 0, NULL, 1, 35, 0, 1, 2, '', 'Size L42cm x W14cm x H26cm (it will accommodate a 15” laptop)', 1, 1, 'AG002', NULL, 0, 'pike-messenger-bag', 0),
(6, 'Urban Messenger Bag', 'The Alchemy Goods Urban is a large upcycled courier messenger bag featuring an outside zippered pocket for easy access to your phone or MP3 player. A great eco friendly commuter bag with a tiny ecological footprint. Back in stock very soon - contact us to reserve one for you. \r\n', '<ul>\r\n<li>Durable, water resistant      exterior constructed from upcycled bike inner tubes</li>\r\n<li>Shoulder strap made from      upcycled seatbelt (colours may vary slightly)</li>\r\n<li>T-strap to stabilize your load while cycling</li>\r\n<li>High quality reflective tape for night time visibility</li>\r\n<li>Waterproof zippered exterior      pocket</li>\r\n<li>Zipper pull made from an      upcycled inner tube valve stem</li>\r\n<li>Two internal pockets plus pen      slots</li>\r\n<li>Blue piping with bordeaux red lining</li>\r\n<li>Internal key clip</li>\r\n<li>76% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>\r\n<ul>\r\n</ul>', 109, 0, '2010-10-19 11:10:13', '2012-03-01 09:14:21', NULL, 2, 0, NULL, 1, 37, 0, 1, 2, '', 'L48cm x W20cm x H26cm (it will accommodate a 17” laptop)', 1, 1, 'AG003', NULL, 0, 'urban-messenger-bag', 0),
(7, 'Messenger Bag', 'This is the original and largest Alchemy Goods upcycled courier messenger bag and features the most reflective material of any Ag bag meaning you’ll be seen and will stay safe on dark nights. It''s made with two seatbelt straps stitched together for a shoulder strap with more body. Perfect for bike messengers, students or anyone else with a lot of stuff to carry around. Back in stock very soon - contact us to reserve one for you. \r\n ', '<ul>\r\n<li>Durable, water resistant      exterior constructed from upcycled bike inner tubes</li>\r\n<li>Shoulder strap made from two      upcycled seatbelts sewn together</li>\r\n<li>T-strap to stabilize your load while cycling</li>\r\n<li>Maximum visibility - the most reflective tape of any AG bag</li>\r\n<li>Zippered exterior pocket</li>\r\n<li>Zipper pull made from an      upcycled inner tube valve stem</li>\r\n<li>Blue piping with bordeaux red lining</li>\r\n<li>Two internal pockets plus pen      slots</li>\r\n<li>Internal key clip</li>\r\n<li>73% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcyled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n</ul>', 125, 0, '2010-10-19 11:10:17', '2012-03-01 09:14:48', NULL, 2, 0, NULL, 1, 38, 0, 1, 2, '', 'L48cm x W22cm x H28cm (it will accommodate a 17” laptop)', 1, 1, 'AG004', NULL, 0, 'messenger-bag', 0),
(8, 'Magnolia Handbag', 'The Alchemy Goods Magnolia is a unique and stylish upcycled handbag for women. The elegant inner tube shell wears like soft leather and bears the subtle markings of a former life. Inside you’ll find a roomy interior with two zippered pockets and two slip pocket organisers. A designer ethical bag that''s got real attitude!', '<ul>\r\n<li>Durable, water resistant exterior constructed from upcycled bike inner tubes</li>\r\n<li>Shoulder strap made from upcycled seatbelt (colours may vary slightly)</li>\r\n<li>Zipper pull made from an upcycled inner tube valve stem</li>\r\n<li>Two internal zippered pockets plus two internal slip pockets</li>\r\n<li>Exterior highlight stitching in aqua with matching lining</li>\r\n<li>78% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>', 68, 0, '2010-10-19 11:19:49', '2013-02-05 12:29:45', NULL, 2, 0, NULL, 1, 40, 0, 1, 2, '', 'L26-30cm x W10cm x H21cm', 0, 1, 'AG005', NULL, 0, 'magnolia-handbag', 0),
(9, 'Union Backpack', 'The Alchemy Goods upcycled Union Backpack is perfect for the urban commuter or bike courier. Vertical padding on your back means the fit is secure and comfortable, whilst allowing sufficient airflow to keep you cool on your cross-town journey. Whether you commute by bike, by foot or on four wheels, this well balanced Alchemy Goods upcycled backpack will keep your valuables safe and dry.', '<ul>\r\n<li>Durable, water resistant      exterior constructed from upcycled bike inner tubes</li>\r\n<li>Back incorporates upcycled advertsing banner material (patterns and colours will vary) </li>\r\n<li>Internal divider accommodates      laptop sleeve</li>\r\n<li>Four internal slip pockets</li>\r\n<li>Zippered front pocket with rain      flap</li>\r\n<li>Zipper pull made from an      upcycled inner tube valve stem</li>\r\n<li>High quality reflective tape      for night time visibility</li>\r\n<li>Adjustable, durable shoulder      straps made from upcycled seatbelt (colours may vary slightly)</li>\r\n<li>Grab handle</li>\r\n<li>Highlight stitching</li>\r\n<li>Light grey lining helps you see      contents</li>\r\n<li>82% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n</ul>', 109, 0, '2010-10-19 11:23:17', '2013-02-05 12:30:24', NULL, 2, 0, NULL, 1, 39, 0, 1, 2, '', 'L30cm x W14cm x H42cm (will accommodate a 17” laptop)', 1, 1, 'AG006', NULL, 0, 'union-backpack', 0),
(10, 'Messenger Bag', 'The Nkuku Messenger Bag is a wonderfully stylish fair trade brown leather bag that has been handmade by one craftsperson from start to finish with exceptional attention to detail. An ethical bag with oodles of style and one of our most popular ones too!\r\n', '<ul>\r\n<li>Handmade from luxuriously thick,      dark chocolate brown leather</li>\r\n<li>Lined in dark chocolate brown      cotton </li>\r\n<li>Mobile phone and zip pocket      inside</li>\r\n<li>Adjustable, long leather strap</li>\r\n</ul>\r\n<p>Nkuku&rsquo;s wonderful fairtrade leather bags are all handmade and have been inspired by the traditional skills of artisans in India. They are produced by a fairtrade co-operative in Rajasthan which provides work for 40 local families. They combine contemporary designs with age-old techniques, natural materials and sustainable methods of production to ensure each bag is a truly unique work of art.</p>', 124.95, 0, '2010-10-19 11:39:31', '2014-06-11 07:42:08', NULL, 2, 0, NULL, 1, 48, 1, 0, 1, '', '34cm x 28cm x 8cm', 1, 1, 'NK013', NULL, 0, 'messenger-bag--2', 0),
(11, 'Prisha Bag', 'The Nkuku Prisha Bag is a beautifully soft and versatile brown leather fair trade handbag that''s been handmade with incredible attention to detail. It can be worn either as a fold-over or, if you prefer, you can open out the fold, giving you a completely new look and a bit more space. The Prisha is a fabulous ethical bag that combines sleek design and functionality. Just 1 left in stock!', '<ul>\r\n<li>Handmade from luxuriously thick, dark chocolate brown leather</li>\r\n<li>Lined in dark chocolate brown cotton </li>\r\n<li>Mobile phone and zip pocket inside</li>\r\n<li>Adjustable, long leather strap</li>\r\n<li>Functional and versatile &ndash; it can be worn either folded or unfolded</li>\r\n</ul>\r\n<p>Nkuku&rsquo;s wonderful fairtrade leather bags are all handmade and have been inspired by the traditional skills of artisans in India. They are produced by a fairtrade co-operative in Rajasthan which provides work for 40 local families. They combine contemporary designs with age-old techniques, natural materials and sustainable methods of production to ensure each bag is a truly unique work of art.</p>', 99.99, 0, '2010-10-19 11:41:27', '2014-12-05 16:04:55', NULL, NULL, 0, NULL, 1, 22, 1, 0, 1, '', '24-32cm x 28cm x 8cm', 0, 1, 'NK014', 75, 1, 'prisha-bag', 0),
(12, 'Ovla Slouch Bag in Brown', 'The Nkuku Ovla is a fair trade brown suede slouch bag that''s been designed to fit comfortably on your shoulder and will look great when you’re out and about day or night. A handmade ethical bag that successfully combines classic elegance with cool casual design. \r\n', '<ul>\r\n<li>Handmade using beautifully soft and textured brown suede</li>\r\n<li>Straps are handmade from soft brown leather </li>\r\n<li>Unlined</li>\r\n<li>The bag is held closed at the top with a magnetic button</li>\r\n</ul>\r\n<p>Nkuku&rsquo;s wonderful fairtrade suede leather bags are all handmade and have been inspired by the traditional skills of artisans in India. They are produced by a fairtrade co-operative in Rajasthan which provides work for 40 local families. They combine contemporary designs with age-old techniques, natural materials and sustainable methods of production to ensure each bag is a truly unique work of art.</p>', 74.99, 0, '2010-10-19 11:42:49', '2014-11-30 21:33:32', NULL, 2, 0, NULL, 1, 23, 1, 0, 1, '', '32cm x 30cm x 18cm', 0, 1, 'NK015', NULL, 0, 'ovla-slouch-bag-in-brown', 0),
(13, 'Savannah Case', 'The Nkuku Savannah Case is a great example of the very best in handmade leather fair trade satchel bags. It''s a really stylish alternative to the predictable, black briefcase and definitely one for both the guys and the girls. It simply oooozes quality and is packed full of character!\r\n', '<ul>\r\n<li>Handmade from leather, dyed      using vegetable extract and tree bark </li>\r\n<li>Lined with a natural coloured      cotton canvas lining </li>\r\n<li>Sections for your laptop,      mobile phone and pens</li>\r\n<li>Adjustable and removable over-the-shoulder strap</li>\r\n</ul>\r\n<p>Nkuku&rsquo;s wonderful fairtrade bags are inspired by the traditional skills of artisans in India. They are produced by a fairtrade co-operative&nbsp;in Rajasthan&nbsp;which provides work for 40 local families. Each bag is cut and hand-sewn (tanki) using meticulously handmade leather thread (sallu). Solid brass buckles are used, each individually hand made. It can take one craftsperson a whole day to complete. These traditional crafting techniques give the Savannah Case a unique character, durability and distinctiveness, making each bag by its own nature a limited edition.</p>', 119, 0, '2010-10-19 11:44:16', '2014-06-11 07:43:26', NULL, 2, 0, NULL, 1, 49, 1, 0, 1, '', '38cm x 28cm x 13cm', 1, 1, 'NK017', NULL, 0, 'savannah-case', 0),
(14, 'Savannah Shopper', 'The Nkuku Savannah is a fair trade and handmade leather shopper bag and is a great example of a wonderfully stylish ethical bag. It''s one of our best sellers and is a real feel good bag with a great fair trade story to tell. \r\n', '<ul>\r\n<li>Handmade from leather, dyed using extracts of tree bark and plants</li>\r\n<li>Lined with a pretty floral cotton fabric</li>\r\n<li>Large inside pocket with zip to secure your valuables</li>\r\n</ul>\r\n<p>Nkuku&rsquo;s wonderful fairtrade leather bags are inspired by the traditional skills of artisans in India. They are produced by a fairtrade co-operative in Rajasthan which provides work for 40 local families. Each bag is cut and hand-sewn (tanki) using meticulously handmade leather thread (sallu). Solid brass buckles are used, each individually hand made. It can take one craftsperson a whole day to complete. These traditional crafting techniques give the Savannah Shopper a unique character, durability and distinctiveness making each bag by its own nature a limited edition.&nbsp;</p>', 89, 0, '2010-10-19 11:45:05', '2012-01-18 17:18:58', NULL, 2, 0, NULL, 1, 25, 1, 0, 1, '', '34cm x 28cm x 14cm', 0, 1, 'NK018', NULL, 0, 'savannah-shopper', 0),
(15, 'Irregular Bag', 'Neumatica''s eco-friendly Irregular Bag is a really stylish upcycled bag that''s been handmade from recycled vehicle inner tubes. It will look stunning wherever you go and is guaranteed to turn a few heads! An entirely unique recycled handbag, wow.\r\n', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Incredibly soft and pliable but strong and durable too</li>\r\n<li>Adjustable and removable shoulder strap made from a bycycle inner tube</li>\r\n<li>Beautiful, handmade metal clasp with antique finish</li>\r\n<li>Unlined</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless vehicle inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled handbag that is raring to start another journey!</p>', 74.99, 0, '2010-10-19 13:19:50', '2014-06-11 07:39:37', NULL, 2, 0, NULL, 1, 28, 0, 1, 3, '', 'L28cm x W7cm x H30cm (every bag is hand cut so sizes will vary slightly)', 0, 1, 'NE007', NULL, 0, 'irregular-bag', 0),
(16, 'Apaisada Bag', 'Neumatica''s Apaisada Bag is a stunning example of an eco-friendly upcycled bag that''s been handmade from recycled vehicle inner tubes. At first we thought Neumatica had decided to splash out when we saw the name of this bag since all their other ones are simply called ''Big'', ''Small'' ''Square'' or ''Irregular''. Until we checked the dictionary... Apaisada means ''oblong'', oh well. Hurry, just 1 left!\r\n', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Incredibly soft and pliable but strong and durable too</li>\r\n<li>Adjustable and removable shoulder strap made from a bicycle inner tube</li>\r\n<li>Metal clasp and buckle with antique finish</li>\r\n<li>Unlined</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless vehicle inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled handbag that is raring to start another journey!</p>', 74.99, 0, '2010-10-19 13:21:25', '2015-02-28 14:30:54', NULL, NULL, 0, NULL, 1, 29, 0, 1, 3, '', 'L30cm x W7cm x H19cm (every bag is hand cut so sizes will vary slightly)', 0, 1, 'NE008', 49.99, 1, 'apaisada-bag', 0),
(17, 'Square Bag', 'The Neumatica Small Bag is a stunning example of a handmade upcycled bag that combines cool design with top notch eco-friendly credentials. It''s the smallest bag in the Neumatica range and as the saying goes, small is beautiful. Great for work but a real crowd pleaser after hours too.\r\n', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Incredibly soft and pliable but strong and durable too</li>\r\n<li>Adjustable and removable shoulder strap made from a bicycle inner tube</li>\r\n<li>Metal clasp and buckle with antique finish</li>\r\n<li>Unlined</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled bag that is raring to start a new journey!</p>', 57.99, 0, '2010-10-19 13:22:07', '2014-06-11 07:40:09', NULL, 2, 0, NULL, 1, 30, 0, 1, 3, '', 'L22cm x W6cm x H22cm (every bag is hand cut so sizes will vary slightly)', 0, 1, 'NE009', NULL, 0, 'square-bag', 0),
(18, 'Basic Big Bag', 'Neumatica''s Basic Big Bag has been handmade from recycled inner tubes and is the largest upcycled bag in their range. It''s proving popular with both the guys as well as the girls and is a great example of an eco friendly bag at its designer best.\r\n ', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Incredibly soft and pliable but strong and durable too</li>\r\n<li>Adjustable and removable shoulder strap made from a bicycle inner tube</li>\r\n<li>Metal clasp and buckle with antique finish</li>\r\n<li>Unlined</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled bag that''s raring to start a new journey!</p>', 65, 0, '2010-10-19 13:23:48', '2014-06-11 07:40:43', NULL, 2, 0, NULL, 1, 50, 0, 1, 3, '', 'L30cm x W8cm x H26cm (every bag is hand cut so sizes will vary slightly)', 1, 1, 'NE010', NULL, 0, 'basic-big-bag', 0),
(19, 'Basic Small Bag', 'The Basic Small Bag from Neumatica - its name doesn''t really do it justice - there’s nothing basic about this handmade upcycled bag. A rectangular shaped bag made from reclaimed vehicle inner tubes - eco friendly, unique, stylish and oh so cool!\r\n', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Incredibly soft and pliable but strong and durable too</li>\r\n<li>Adjustable and removable shoulder strap made from a bicycle inner tube</li>\r\n<li>Metal clasp and buckle with antique finish</li>\r\n<li>Unlined</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled bag that is raring to start a new journey!</p>', 58, 0, '2010-10-19 13:24:16', '2014-06-11 07:41:17', NULL, 2, 0, NULL, 1, 31, 0, 1, 3, '', 'L21cm x W6cm x H26cm (every bag is hand cut so sizes will vary slightly)', 0, 1, 'NE011', NULL, 0, 'basic-small-bag', 0),
(20, 'Short Travel Bag', 'Neumatica''s Short Travel Bag is an upcycled bag that''s been handmade from reclaimed inner tubes. Ideal for an overnight stay or a quick trip to the gym or sports club. Cool design combines with great eco-friendly credentials to give this handmade upcycled bag a big thumbs up. \r\n', '<ul>\r\n<li>Black rubber inner tube exterior with unique textures and markings</li>\r\n<li>Two fixed handles and one adjustable long strap made from a bicycle inner tube</li>\r\n<li>Black lining inside</li>\r\n<li>Two external, zipped pockets </li>\r\n<li>Strong and durable</li>\r\n<li>Zips and external studs in silver finish</li>\r\n</ul>\r\n<p>Neumatica do some amazing things with rubber, transforming mountains of useless inner tubes into works of art. Sourced from all over Argentina, the inner tubes are put through a double cleaning process before each pattern is hand-cut, piece by piece. No two bags will ever be the same, guaranteeing you&rsquo;ll be getting a unique, one-of-a-kind handmade upcycled bag that is raring to start another journey!</p>', 130, 2, '2010-10-19 13:25:14', '2014-11-30 21:49:40', NULL, 2, 0, NULL, 1, 32, 0, 1, 3, '', 'L45cm x W20cm x H26cm', 1, 1, 'NE012', 75, 1, 'short-travel-bag', 0),
(21, 'Coco Large Handbag', 'The NV London Calcutta Coco Bag is a large fair trade and handmade brown leather handbag that''s simply oozing with elegant style. In fact, up close and personal this bag might just take your breath away! And it''s perfect for those of us who just can’t leave home without, well, everything! A truly stunning example of an ethical handbag at its very best.\r\n', '<ul>\r\n<li>Premium quality, Bourneville brown, textured and butter soft buffalo hide body</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Detachable handle</li>\r\n<li>Internal zipped pocket and leather mobile phone pouch</li>\r\n<li>Antiqued brass fittings</li>\r\n<li>YKK zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fairtrade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 160, 0, '2010-10-19 13:33:10', '2015-01-13 08:29:38', NULL, 2, 0, NULL, 1, 16, 1, 0, 4, '', '42cm x 34cm x 12cm', 0, 1, 'NV019', NULL, 0, 'coco-large-handbag', 0),
(22, 'Germaine Satchel', 'The NV London Calcutta Germaine is a fairtrade and handmade brown leather satchel that is absolutely bang on trend. With a contrasting cream canvas and leather shoulder strap, the Germaine satchel combines a lovely casual style with real eco-chic. Ethical at its designer best. Just 1 left in stock!\r\n', '<ul>\r\n<li>Premium quality, Bourneville brown, textured and butter soft buffalo hide body</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Cream webbing shoulder strap with leather detailing</li>\r\n<li>Internal mobile phone pocket and bits ''n'' pieces pouch</li>\r\n<li>Concealed, zipped safety pocket on reverse</li>\r\n<li>Antiqued brass fittings</li>\r\n<li>YKK zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fairtrade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 120, 1, '2010-10-19 13:41:12', '2014-11-30 21:22:39', NULL, 2, 0, NULL, 1, 18, 1, 0, 4, '', '31cm x 36cm x 7cm', 0, 1, 'NV020', 99, 1, 'germaine-satchel', 0),
(23, 'Anita Laptop Bag in Brown', 'The NV London Calcutta Anita is a stunning fair trade and handmade brown leather laptop case/bag that''s suitable for a netbook, iPad or 14" laptop. No laptop? Fear not! It''s proving a popular choice with our customers as a handbag or shoulder bag. Versatile and stylish – it’s a real feel good bag you''ll be proud to show off! Hurry, very limited stock!', '<ul>\r\n<li>Premium quality, Bourneville      brown, textured and butter soft buffalo hide body</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Removable, adjustable, cream      webbing shoulder strap with leather shoulder pad and detailing</li>\r\n<li>Padded base to cushion and      protect your laptop from impacts</li>\r\n<li>Excellent interior      organisational pocketing</li>\r\n<li>Will accommodate netbook or 14&rdquo;      laptop</li>\r\n<li>Antiqued brass fittings and YKK      zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fair trade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>', 135, 2, '2010-10-19 13:54:57', '2014-12-27 09:03:53', NULL, NULL, 0, NULL, 1, 17, 1, 0, 4, '', '38cm x 29cm x 8cm', 0, 1, 'NV021', 75, 1, 'anita-laptop-bag-in-brown', 0),
(24, 'Florence Weekender Bag', 'The NV London Calcutta Florence is a beautiful fair trade and handmade weekend or overnight bag. Practical yet elegant and just the right size for that long-awaited getaway. A great example of an ethical bag that''s full of designer chic. Always a popular choice, so hurry while we''ve still got some! Hurry, just 1 left!\r\n', '<ul>\r\n<li>Premium quality, printed cream and olive canvas body - screened by hand, using traditional methods and      environmentally friendly, AZO      free dyes</li>\r\n<li>Bourneville brown leather base,      handles and detailing</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Width-wide internal zipped      pocket plus two bits ''n'' pieces pouches</li>\r\n<li>Antiqued brass fittings</li>\r\n<li>Protective feet on base</li>\r\n<li>YKK zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fair trade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>', 155, 0, '2010-10-19 14:05:14', '2014-12-15 13:58:03', NULL, NULL, 0, NULL, 1, 21, 1, 0, 4, '', '51cm x 28cm x 25cm', 0, 1, 'NV024', 99, 1, 'florence-weekender-bag', 0),
(25, 'Bucket Bag in Brown', 'Aura Que''s Bucket Bag is a stunning fairtrade large brown leather bag that''s been handmade in Nepal. The perfect handbag for anyone who likes to carry around everything except the kitchen sink! Two completely different looks but just one bag – versatility at its very best. Hurry, very limited stock!', '<ul>\r\n<li>100% buffalo leather with beautiful, natural matt stone brown finish</li>\r\n<li>Matching banana yarn sections add warmth and texture</li>\r\n<li>Hand woven striped black and khaki brown shyama lining </li>\r\n<li>Two pairs of handles &ndash; short or over the shoulder</li>\r\n<li>Dual magnetic clasp closures &nbsp;</li>\r\n<li>Inside zipped pocket</li>\r\n<li>The photo of the bag with our model is the best colour representation</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 175, 1, '2010-10-19 14:11:23', '2015-01-15 22:03:30', NULL, NULL, 0, NULL, 1, 26, 1, 0, 5, '', '40cm x 24cm x 24cm', 0, 1, 'AQ025', 99, 1, 'bucket-bag-in-brown', 0),
(26, 'Walter Messenger Bag', 'Feuerwear''s Walter is an upcycled messenger and courier bag that''s been made from recycled German fire hose and truck tarpaulin. If you’re after a large, tough and durable bag with shed loads of street style, then this is the bag for you. Hurry, just 1 left!', '<ul>\r\n<li>White, textured, water resistant exterior made out of de-commissioned fire hose</li>\r\n<li>Adjustable and durable seat belt shoulder strap</li>\r\n<li>Two large internal compartments</li>\r\n<li>Two zipped pockets &ndash; one small inside, one large outside (under flap)</li>\r\n<li>Handy key finder </li>\r\n<li>Large enough to hold A4 ring binders</li>\r\n<li>Please note &ndash; all bags vary significantly in markings and whiteness. If you&rsquo;d prefer to choose your own bag you can view them on our <a href="http://www.facebook.com/album.php?aid=17201&amp;id=117729021621623" target="_blank">Facebook</a> site. Once you&rsquo;ve made your choice and placed your order, please <a href="../../../page/contact-us">get in touch</a> to let us know which one you&rsquo;ve chosen.</li>\r\n</ul>\r\n<p>Feuerwear has been making bags out of used fire hose since 2005. Each fire hose has seen many years of active service. They&rsquo;ve been dragged through soot, grease and mud, despite extreme heat and fire and have transported many thousands of cubic metres of water. Each bag has its own distinct markings and is guaranteed to be a unique, one-of-a-kind product.</p>', 109, 0, '2010-10-19 15:04:56', '2015-01-27 11:21:21', NULL, NULL, 0, NULL, 1, 52, 0, 1, 6, '', '34cm x 30cm x 12cm', 1, 1, 'FW028', 75, 1, 'walter-messenger-bag', 0),
(27, 'Jack Messenger Bag', 'Feuerwear''s Jack black upcycled messenger bag has been made from genuine de-commissioned recycled German fire hose and truck tarpaulin. Sleek and uber cool, the Jack messenger bag is smart enough for the office but will also look great after hours too. Hurry, just 1 left!', '<ul>\r\n<li>Black rubber, water resistant exterior made out of de-commissioned fire hose</li>\r\n<li>Adjustable and durable seat belt shoulder strap</li>\r\n<li>One internal compartment with inside back pocket</li>\r\n<li>Additional inside zipped pocket</li>\r\n<li>Handy key finder </li>\r\n<li>Perfect for the 10&rdquo; netbook or iPad</li>\r\n</ul>\r\n<p>Feuerwear has been making bags out of used fire hose since 2005. Each fire hose has seen many years of active service. They&rsquo;ve been dragged through soot, grease and mud, despite extreme heat and fire and have transported many thousands of cubic metres of water. Each bag has its own distinct markings and is guaranteed to be a unique, one-of-a-kind product.</p>', 85, 1, '2010-10-19 15:08:00', '2014-11-30 21:59:12', NULL, 2, 0, NULL, 1, 53, 0, 1, 6, '', '24cm x 32cm x 9cm', 1, 1, 'FW029', 59.99, 1, 'jack-messenger-bag', 0),
(28, 'Carl Messenger Bag', 'Feuerwear''s Carl upcycled red messenger bag has been made from genuine de-commissioned recycled German fire hose and truck tarpaulin - perfect for those occasions when you need a bit more than just pockets. It might be the smallest of the Feuerwear range but the Carl messenger bag is still capable of packing a punch or two. ', '<ul>\r\n<li>Red, textured and water resistant exterior made out of de-commissioned fire hose</li>\r\n<li>Adjustable and durable seat belt shoulder strap</li>\r\n<li>One internal compartment with inside back pocket</li>\r\n<li>Additional inside zipped pocket</li>\r\n<li>Handy key finder </li>\r\n<li>Perfect for A5 documents</li>\r\n</ul>\r\n<p>Feuerwear has been making bags out of used fire hose since 2005. Each fire hose has seen many years of active service. They&rsquo;ve been dragged through soot, grease and mud, despite extreme heat and fire and have transported many thousands of cubic metres of water. Each bag has its own distinct markings and is guaranteed to be a unique, one-of-a-kind product.</p>', 78, 5, '2010-10-19 15:19:27', '2014-11-30 22:04:26', NULL, 2, 0, NULL, 1, 54, 0, 1, 6, '', '24cm x 24cm x 9cm', 1, 1, 'FW030', 59.99, 1, 'carl-messenger-bag', 0),
(29, 'Carta 2010 Messenger Bag', 'The Cyclus Carta messenger bag is a sleek and stylish recycled bag and is without doubt one of the coolest upcycled messenger bags on the market. It''s made from recycled tyre inner tubes and combines great design with some impressive eco friendly credentials. ', '<ul>\r\n<li>Black rubber exterior made out of upcycled truck inner tubes</li>\r\n<li>Adjustable and durable bright red seat belt shoulder strap</li>\r\n<li>Inside multi-purpose pocket with key attachment</li>\r\n<li>Outer flap with Velcro fastening covering three pouches &ndash; one zipped and two smaller ones for your mobile and pens</li>\r\n<li>Unique external markings and textures</li>\r\n<li>Will accommodate an A4-sized ring binder</li>\r\n</ul>\r\n<p>Cyclus leads the way in eco fashion design in Colombia and was awarded the National Export Award for Small Business in 2009. They believe that eco development has an important role to play in Colombia''s future. As a company, they are committed to social justice and provide employment for some of Colombia''s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>', 86, 0, '2010-10-19 15:37:22', '2014-11-30 22:05:35', NULL, 2, 0, NULL, 1, 55, 0, 1, 7, '', '34cm x 33cm x 3cm', 1, 1, 'CY031', NULL, 0, 'carta-2010-messenger-bag', 0),
(30, 'Olmo Laptop Bag', 'The Olmo from Cyclus is an upcycled laptop bag that''s been made from recycled tyre inner tubes. It has plenty of space for all your work essentials and will provide solid protection for your laptop. It will see you through your working day with ease and has great eco-friendly credentials too, perfect if you''re looking to cut your carbon footprint but not your street cred!\r\n', '<ul>\r\n<li>Black rubber exterior made out of upcycled truck inner tubes</li>\r\n<li>Adjustable and durable black seat belt shoulder strap</li>\r\n<li>Removable grey laptop sleeve with 2 blackberry-sized pockets and 3 pen pockets</li>\r\n<li>Two front zipped pockets under outer flap</li>\r\n<li>Two back zipped pockets</li>\r\n<li>Double zipper closure with securing magnets for outer flap</li>\r\n<li>Unique external markings and textures</li>\r\n<li>Will accommodate laptops up to 15"</li>\r\n</ul>\r\n<p>Cyclus leads the way in eco fashion design in Colombia and was awarded the National Export Award for Small Business in 2009. They believe that eco development has an important role to play in Colombia''s future. As a company, they are committed to social justice and provide employment for some of Colombia''s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>', 134, 0, '2010-10-19 15:38:37', '2014-08-31 20:25:20', NULL, 2, 0, NULL, 1, 58, 0, 1, 7, '', '40cm x 37cm x 9cm', 1, 1, 'CY032', NULL, 0, 'olmo-laptop-bag', 0),
(31, 'Plaza Large Messenger Bag', 'The Plaza is an upcycled messenger bag that''s been made from recycled tyre inner tubes. Guaranteed to add a touch of eco-chic to your daily commute. If you’re looking for a tough workhorse that’s also packed full of style and understated cool, then the Plaza messenger bag is right up your street. \r\n ', '<ul>\r\n<li>Black rubber exterior made out of upcycled truck inner tubes</li>\r\n<li>Adjustable and durable olive green seat belt shoulder strap</li>\r\n<li>Padded base giving added protection</li>\r\n<li>Two small inside pockets and one multipurpose zipped pouch</li>\r\n<li>Outer flap with Velcro fastening covering two pouches &ndash; one zipped, one press stud</li>\r\n<li>Unique external markings and textures</li>\r\n<li>Big enough to take A4 ring binders</li>\r\n</ul>\r\n<p>Cyclus leads the way in eco fashion design in Colombia and was awarded the National Export Award for Small Business in 2009. They believe that eco development has an important role to play in Colombia&rsquo;s future. As a company, they are committed to social justice and provide employment for some of Colombia&rsquo;s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>', 92, 0, '2010-10-19 15:39:56', '2013-03-27 20:36:07', NULL, 2, 0, NULL, 0, 56, 0, 1, 7, '', '34cm x 29cm x 9cm', 1, 1, 'CY033', NULL, 0, 'plaza-large-messenger-bag', 0),
(32, 'Acacia Laptop Bag', 'The Acacia from Cyclus is a stylish upcycled black laptop bag that''s been made from recycled vehicle inner tubes. It will definitely add a touch of eco-chic to your daily commute and won’t look out of place in the bar or restaurant after work either. Style, elegance…you name it, the Acacia has it all. NOW LESS THAN HALF PRICE!\r\n', '<ul>\r\n<li>Black rubber exterior made out of upcycled truck inner tubes</li>\r\n<li>Removable and adjustable shoulder strap made out of bicycle inner tubes</li>\r\n<li>Handles with metallic hooks to secure in place when using the shoulder strap</li>\r\n<li>Zipper closure</li>\r\n<li>Soft and water-repellent inner lining</li>\r\n<li>Unique external textures and markings</li>\r\n<li>Internal pockets for laptop, smartphone and accessories</li>\r\n<li>It will accommodate a 15" laptop</li>\r\n</ul>\r\n<p>Cyclus leads the way in eco fashion design in Colombia and was awarded the National Export Award for Small Business in 2009. They believe that eco development has an important role to play in Colombia&rsquo;s future. As a company, they are committed to social justice and provide employment for some of Colombia&rsquo;s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>', 134, 3, '2010-10-19 15:45:00', '2015-07-13 08:19:26', NULL, NULL, 0, NULL, 1, 57, 0, 1, 7, '', '39cm x 30cm x 12cm', 0, 1, 'CY034', 59.99, 1, 'acacia-laptop-bag', 0),
(33, 'Anteos Backpack', 'The Anteos is an upcycled black backpack that''s been made from recycled truck inner tubes and waterproof canvas. A backpack with loads of space for your laptop, files and a change of clothing too. Guaranteed to turn a few heads, it''s the perfect solution for all you trendy urban commuters out there!  ', '<ul>\r\n<li>Black exterior made out of upcycled truck inner tubes and waterproof canvas</li>\r\n<li>Top handle and adjustable straps</li>\r\n<li>Padded laptop pocket ideal for a 15&rdquo; laptop</li>\r\n<li>Inside front netted compartment with zip</li>\r\n<li>Main compartment with one zipped pocket, two accessories pockets and one for pens</li>\r\n<li>Lined with waterproof material</li>\r\n<li>Zipper closure with three additional external zips that can be opened to increase capacity, revealing vivid green waterproof material</li>\r\n<li>Two external reflective safety lines running top to bottom &ndash; ideal for the cyclist</li>\r\n<li>Unique external textures and markings</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Cyclus leads the way in eco fashion design in Colombia and was awarded the National Export Award for Small Business in 2009. They believe that eco development has an important role to play in Colombia&rsquo;s future. As a company, they are committed to social justice and provide employment for some of Colombia&rsquo;s most disadvantaged communities, including displaced people and refugees, single mums and Indians of the Camentsa tribe.</p>', 199, 0, '2010-10-19 15:45:49', '2013-03-27 20:37:04', NULL, 2, 0, NULL, 0, 59, 0, 1, 7, '', '45cm x 36cm x 16cm', 1, 1, 'CY035', NULL, 0, 'anteos-backpack', 0),
(34, 'Large Suede Shoulder Bag', 'They say first impressions count and there’s no doubt this elegant fair trade suede shoulder bag in black/violet will definitely get you noticed for all the right reasons! A real feel good bag you can be proud of. ', '<ul>\r\n<li>Genuine suede leather in black and      vibrant violet</li>\r\n<li>Top zip closure</li>\r\n<li>Two inside slip pockets and one      zip pocket</li>\r\n<li>Matching black lining</li>\r\n</ul>\r\n<p>Namaste believe that the best way to reduce poverty is through trade. So they work with both primary producers and some larger organisations, harnessing the incredible skills and age-old techniques of local artisans. All of their products, including these wonderful suede bags, have been fairly traded which means as a minimum the workers all receive a fair wage that is at or above the national average and they work in an environment that is both safe and secure.</p>', 54.99, 5, '2010-10-19 16:03:50', '2014-11-30 22:11:16', NULL, 2, 0, NULL, 1, 67, 1, 0, 10, '', '39cm x 36cm x 10cm', 0, 1, 'NA040', 39.99, 1, 'large-suede-shoulder-bag', 0),
(35, 'Brown Suede Shoulder Bag', 'Namaste''s fair trade brown suede shoulder bag has been handmade in India and is a great example of an ethical bag that combines great design with superb quality. A feel good bag you can show off with pride! NOW WITH £20 OFF!', '<ul>\r\n<li>Genuine suede leather in deep,      dark chocolate</li>\r\n<li>Top zip closure</li>\r\n<li>One small inside slip pocket      and one zip pocket</li>\r\n<li>Black lining</li>\r\n</ul>\r\n<p>Namaste believe that the best way to reduce poverty is through trade. So they work with both primary producers and some larger organisations, harnessing the incredible skills and age-old techniques of local artisans. All of their products, including these wonderful suede bags, have been fairly traded which means as a minimum the workers all receive a fair wage that is at or above the national average and they work in an environment that is both safe and secure.</p>', 44.99, 3, '2010-10-19 16:05:29', '2014-01-01 15:52:26', NULL, 2, 0, NULL, 1, 68, 1, 0, 10, '', '36cm x 34cm x 8cm', 0, 1, 'NA042', 24.99, 1, 'brown-suede-shoulder-bag', 0),
(36, 'Saddle Bag', 'The Elvis & Kresse Saddle Bag must be one of the coolest iPad bags out there. It''s been handmade out of genuine de-commissioned British fire hose and a reclaimed coffee sack. It can also double as a small messenger bag with room for a few daily essentials too. Great design, great ethics, nuff said...', '<ul>\r\n<li>Handmade from genuine British fire hose</li>\r\n<li>Front flap made from reclaimed Caf&eacute; Direct coffee sack</li>\r\n<li>Super soft scratch-free lining made from reclaimed military grade parachute silk and waste closed cell foam</li>\r\n<li>External zip pocket</li>\r\n<li>Internal floating, padded pocket offering ultimate protection for your iPad</li>\r\n<li>Adjustable shoulder strap</li>\r\n<li>Reclaimed parachute cord and silk dust bag</li>\r\n<li>Each bag has its own unique coffee sack front flap - photos of the full range are available to view on our<a href="http://www.facebook.com/album.php?aid=17200&amp;id=117729021621623" target="_blank"> Facebook</a> site. If you''d like to choose your own coffee sack design, instead of us choosing for you, please <a href="../../../page/contact-us">get in touch</a> to let us know your choice when you place your order</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s upcycled bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 132, 2, '2010-10-19 16:09:33', '2014-11-30 21:52:42', NULL, 2, 0, NULL, 1, 41, 0, 1, 11, '', '20cm x 28cm x 5cm', 1, 1, 'EK043', 75, 1, 'saddle-bag', 0),
(37, 'Tote Bag', 'The ultimate designer fire hose bag! The Elvis & Kresse Tote Bag makes a stunning classic design statement and is the perfect day bag. It will keep its contents dry even in the heaviest of rainstorms - it''s handmade from fire hose so we really wouldn''t expect anything less! Practical, unique, beautiful and timeless.', '<ul>\r\n<li>Handmade from genuine British fire hose</li>\r\n<li>Beautifully soft lining made from reclaimed parachute silk</li>\r\n<li>Internal and external zip pockets and inside mobile phone holder </li>\r\n<li>Water resistant and wipe clean</li>\r\n<li>Handles long enough to sit comfortbaly on the shoulder</li>\r\n<li>Reclaimed parachute cord and silk dust bag</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 184, 0, '2010-10-19 16:11:47', '2014-06-11 07:36:29', NULL, 2, 0, NULL, 1, 42, 0, 1, 11, '', '35cm x 25cm x 10cm', 0, 1, 'EK044', NULL, 0, 'tote-bag', 0),
(38, 'Messenger Bag', 'The Elvis & Kresse Messenger Bag has been handmade from de-commissioned fire hose and is a truly stunning example of an upcycled bag at its designer best. With masses of space inside, it will carry around everything you might need during the day, including your laptop. Probably the best fire hose messenger bag you''ll ever stumble across and with top notch eco-friendly credentials too.', '<ul>\r\n<li>Handmade from genuine British fire hose</li>\r\n<li>Lining made from reclaimed military grade parachute silk</li>\r\n<li>Full length front flap with hidden magnetic closure</li>\r\n<li>Internal and external zip pockets</li>\r\n<li>Reclaimed parachute cord and silk dust bag</li>\r\n<li>Adjustable shoulder strap</li>\r\n<li>Water resistant and wipe clean</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s handmade bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 199, 0, '2010-10-19 16:14:07', '2013-02-05 12:53:11', NULL, 2, 0, NULL, 1, 44, 0, 1, 11, '', '40cm x 35cm x 12cm', 1, 1, 'EK046', NULL, 0, 'messenger-bag--3', 0);
INSERT INTO `products` (`id`, `name`, `summary`, `description`, `price`, `stock`, `created_at`, `updated_at`, `created_by`, `updated_by`, `recycled`, `recycled_at`, `display`, `position`, `fair_trade`, `upcycled`, `brand_id`, `stock_message`, `size`, `men`, `women`, `product_code`, `sale_price`, `sale`, `cached_slug`, `new_in`) VALUES
(39, 'One Night Bag', 'The Elvis & Kresse One Night Bag is an upcycled weekend bag that''s been handmade from de-commissioned recycled fire hose. It''s already had 25 years of putting out fires and saving lives. How many bags can you say that about?! Each bag has its own unique markings so you''ll be getting away in true style. Its classic, almost retro design is guaranteed to turn a few heads too.', '<ul>\r\n<li>Handmade from genuine British fire hose</li>\r\n<li>Lining made from reclaimed military grade parachute silk</li>\r\n<li>Really practical design &ndash; opens up fully for easy access</li>\r\n<li>Internal zip pocket</li>\r\n<li>Reclaimed parachute cord and silk dust bag</li>\r\n<li>Water resistant and wipe clean</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 215, 0, '2010-10-19 16:14:57', '2014-11-24 16:54:01', NULL, 2, 0, NULL, 1, 45, 0, 1, 11, '', '48cm x 26cm x 22cm', 1, 1, 'EK047', NULL, 0, 'one-night-bag', 0),
(40, 'Box Bag', 'The Elvis & Kresse Box Bag has been handmade from British recycled fire hose and is a great example of an upcycled handbag that''s simply oozing designer chic - there''s no doubt this bag will be the talk of the town! How can a fire hose become a thing of such amazing beauty? Elvis and Kresse, thank you! Hurry, just 1 left!', '<ul>\r\n<li>Made from genuine British fire hose</li>\r\n<li>Beautifully soft lining made from reclaimed parachute silk</li>\r\n<li>Unique, classic design</li>\r\n<li>Internal zip pocket</li>\r\n<li>Reclaimed parachute cord and silk dust bag</li>\r\n<li>Water resistant and wipe clean</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 122, 0, '2010-10-19 16:15:51', '2015-02-24 19:48:44', NULL, NULL, 0, NULL, 1, 43, 0, 1, 11, '', '24cm x 18cm x 13cm', 0, 1, 'EK048', 99.99, 1, 'box-bag', 0),
(41, 'Ovla Slouch Bag in Green', 'The Nkuku Ovla Slouch bag is a beautifully handmade and fair trade green suede shoulder bag that''s large enough to hold all your daily essentials. Classically elegant and cool casual all rolled into one. Real quality and a great example of an ethical bag at its very best. A perfect choice for day or evening. Hurry, just 1 left!\r\n', '<ul>\r\n<li>Beautifully soft and textured      light green-coloured suede</li>\r\n<li>Straps are handmade from soft      brown leather </li>\r\n<li>The bag is held closed at the      top with a magnetic button</li>\r\n</ul>\r\n<p>Nkuku''s wonderful bags are all fairly traded and are inspired by the traditional skills of artisans in India &ndash; in fact just 40 families in Rajasthan. They combine contemporary designs with age-old techniques, natural materials and sustainable methods of production to ensure each bag is a truly unique work of art.</p>', 74.95, 0, '2010-11-01 12:36:38', '2015-02-20 19:30:11', NULL, NULL, 0, NULL, 1, 24, 1, 0, 1, '', '32cm x 30cm x 18cm', 0, 1, 'NK016', 49.99, 1, 'ovla-slouch-bag-in-green', 0),
(42, 'Anita Black Laptop Bag/Case', 'The NV London Calcutta Anita is a fair trade and handmade black leather laptop bag/case that will hold a netbook, iPad or 14" laptop. Understated stylish elegance, the Anita laptop bag is a great example of an ethical bag that combines great design with exceptional quality. Hurry, just 1 left!', '<ul>\r\n<li>Premium quality, textured and      butter soft buffalo hide body</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Removable, adjustable, cream      webbing shoulder strap with leather shoulder pad and detailing</li>\r\n<li>Padded base to cushion and      protect your laptop from impacts</li>\r\n<li>Excellent interior      organisational pocketing</li>\r\n<li>Will accommodate netbook or 14&rdquo;      laptop</li>\r\n<li>Antiqued brass fittings and YKK      zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fair trade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>', 135, 0, '2010-11-01 12:58:44', '2015-04-01 22:35:45', NULL, NULL, 0, NULL, 1, 19, 1, 0, 4, '', '38cm x 29cm x 8cm', 0, 1, 'NV022', 75, 1, 'anita-black-laptop-bagcase', 0),
(43, 'Anita Canvas Laptop Bag/Case', 'The NV London Calcutta Anita Canvas Laptop bag/case will be just spot on if you’re someone who likes to mix work with play. It''s been beautifully handmade and is 100% fair trade too. Guaranteed to brighten up the dullest of winter days! Great design, great quality, great ethics - a laptop bag you can be proud to own. \r\n ', '<ul>\r\n<li>Premium quality, printed cream canvas      body - screened by hand, using traditional methods and environmentally      friendly, AZO free dyes</li>\r\n<li>Bourneville brown leather base,      handles and detailing</li>\r\n<li>Matching drill cotton lining</li>\r\n<li>Removable, adjustable, cream      webbing shoulder strap with leather shoulder pad and detailing</li>\r\n<li>Padded base to cushion and      protect your laptop from impacts</li>\r\n<li>Excellent interior      organisational pocketing </li>\r\n<li>Will accommodate a netbook or      14&rdquo; laptop</li>\r\n<li>Antiqued brass fittings and YKK      zips</li>\r\n</ul>\r\n<p>All NV London Calcutta&rsquo;s fair trade bags are handmade and ethically produced in Calcutta using locally sourced materials and suppliers. They work closely with a &lsquo;not for profit&rsquo; manufacturer based in Calcutta who is a member of IFAT, the World Fair Trade Organisation. This means that the people who produce NV&rsquo;s great handmade ethical bags all receive a fair wage and work in a healthy and happy environment.</p>', 110, 4, '2010-11-01 13:00:00', '2014-11-30 21:25:57', NULL, 2, 0, NULL, 1, 20, 1, 0, 4, '', '38cm x 29cm x 8cm', 0, 1, 'NV023', 75, 1, 'anita-canvas-laptop-bagcase', 0),
(44, 'Bucket Bag in Black', 'The Aura Que Bucket Bag in black is a fairtrade and handmade large leather handbag that''s simply brimming with designer chic. There''s loads of space inside so it will easily take all your daily essentials to keep you going throughout the day. A great example of an ethical bag at its designer best. ', '<ul>\r\n<li>100% buffalo leather with beautiful, natural matt black finish</li>\r\n<li>Black knitted banana yarn sections add warmth and texture</li>\r\n<li>Hand woven striped black and khaki brown shyama lining </li>\r\n<li>Two pairs of handles &ndash; short or over the shoulder</li>\r\n<li>Dual magnetic clasp closures &nbsp;</li>\r\n<li>Inside zipped pocket</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>\r\n<p>&nbsp;</p>', 175, 0, '2010-11-01 13:10:19', '2014-11-30 21:46:44', NULL, 2, 0, NULL, 1, 27, 1, 0, 5, '', '40cm x 24cm x 24cm', 0, 1, 'AQ026', NULL, 0, 'bucket-bag-in-black', 0),
(45, 'Large Suede Shoulder Bag', 'Namaste''s fair trade large suede shoulder bag has been beautifully handmade in India. There''s plenty of space inside for all the usual daily essentials. A great all-round ethical bag that will add a touch of colour to these dark winter days.', '<ul>\r\n<li>Genuine suede leather in deep      chocolate and pink</li>\r\n<li>Top zip closure</li>\r\n<li>Two inside slip pockets and one      zip pocket</li>\r\n<li>Black lining</li>\r\n</ul>\r\n<p>Namaste believe that the best way to reduce poverty is through trade. So they work with both primary producers and some larger organisations, harnessing the incredible skills and age-old techniques of local artisans. All of their products, including these wonderful suede bags, have been fairly traded which means as a minimum the workers all receive a fair wage that is at or above the national average and they work in an environment that is both safe and secure.</p>', 54.99, 1, '2010-11-01 13:28:34', '2014-12-11 11:43:47', NULL, NULL, 0, NULL, 1, 69, 1, 0, 10, '', '39cm x 36cm x 10cm', 0, 1, 'NA041', 39.99, 1, 'large-suede-shoulder-bag--2', 0),
(46, 'Shoulder Bag/Rucksack', 'Sativa''s organic hemp/cotton white shoulder bag is a really versatile bag that can also double as a rucksack or satchel. Packed full of useful pockets it will accommodate all your everyday essentials and is a great example of a quality eco-friendly unisex bag. ', '<ul>\r\n<li>Made from organic hemp in ice white with leather trim</li>\r\n<li>Adjustable shoulder strap &ndash; can be modified to use as a rucksack</li>\r\n<li>Numerous inside pockets</li>\r\n<li>Main compartment with rear inside zipper pocket</li>\r\n<li>Inside phone pocket and pen slots</li>\r\n<li>Two small pockets under the flap with magnetic fastenings</li>\r\n<li>Small leather tab inside to keep everything secure</li>\r\n<li>Key holder and key ring</li>\r\n<li>Large enough to hold A4 size folders </li>\r\n<li>All fastenings are magnetic making access super quick</li>\r\n</ul>\r\n<p>According to design guru Calvin Klein, hemp is going to become the choice of fibre in the fashion industry. In fact, the New York Times is saying even now that hemp is the height of fashion. Combine hemp&rsquo;s sustainable, organic and eco-friendly credentials with great design and functionality and you get Sativa, a company that&rsquo;s simply buzzing with passion and enthusiasm and who believe that good living shouldn&rsquo;t cost the earth.</p>', 49.99, 0, '2010-11-01 13:54:52', '2014-03-19 15:44:26', NULL, 2, 0, NULL, 1, 60, 1, 0, 13, '', '32cm x 28cm x 15cm', 1, 1, 'SA048', NULL, 0, 'shoulder-bagrucksack', 0),
(47, 'Shoulder Bag/Rucksack', 'Sativa''s organic hemp/cotton grey shoulder bag can also double as a rucksack and is packed full of useful pockets to keep you organised all day long. Real quality, with top notch eco-credentials. \r\n', '<ul>\r\n<li>Made from organic hemp/cotton mix in grey with leather trim</li>\r\n<li>Adjustable shoulder strap &ndash; can be modified to use as a rucksack</li>\r\n<li>Numerous inside pockets</li>\r\n<li>Main compartment with rear inside zipper pocket</li>\r\n<li>Inside phone pocket and pen slots</li>\r\n<li>Two small pockets under the flap with magnetic fastenings</li>\r\n<li>Small leather tab inside to keep everything secure</li>\r\n<li>Key holder and key ring</li>\r\n<li>Large enough to hold A4 size folders </li>\r\n<li>All fastenings are magnetic making access super quick</li>\r\n</ul>\r\n<p>According to design guru Calvin Klein, hemp is going to become the choice of fibre in the fashion industry. In fact, the New York Times is saying even now that hemp is the height of fashion. Combine hemp&rsquo;s sustainable, organic and eco-friendly credentials with great design and functionality and you get Sativa, a company that&rsquo;s simply buzzing with passion and enthusiasm and who believe that good living shouldn&rsquo;t cost the earth.</p>', 49.99, 0, '2010-11-01 13:56:31', '2012-01-18 17:32:32', NULL, 2, 0, NULL, 1, 61, 1, 0, 13, '', '32cm x 28cm x 15cm', 1, 1, 'SA049', NULL, 0, 'shoulder-bagrucksack--2', 0),
(48, 'Large Shopper', 'A shopper, a beach bag, a gym bag, an overnight bag…you’ll be spoilt for choice. A fantastically versatile and functional large ethical bag made from organic hemp.', '<ul>\r\n<li>Made from organic hemp/cotton mix in ice white with leather trim</li>\r\n<li>Two shoulder handles</li>\r\n<li>Large main compartment</li>\r\n<li>Zipped top for added security</li>\r\n<li>Two zipper pockets on front panel</li>\r\n<li>Key ring included</li>\r\n</ul>\r\n<p>According to design guru Calvin Klein, hemp is going to become the choice of fibre in the fashion industry. In fact, the New York Times is saying even now that hemp is the height of fashion. Combine hemp&rsquo;s sustainable, organic and eco-friendly credentials with great design and functionality and you get Sativa, a company that&rsquo;s simply buzzing with passion and enthusiasm and who believe that good living shouldn&rsquo;t cost the earth.</p>', 32.99, 0, '2010-11-01 13:58:40', '2014-05-28 10:40:52', NULL, 2, 0, NULL, 1, 62, 1, 0, 13, '', '36cm x 46cm x 15cm', 0, 1, 'SA050', NULL, 0, 'large-shopper', 0),
(49, 'Postman Bag', 'Sativa''s Postman Bag is a really versatile grey shoulder bag made from organic hemp/cotton. A great bag with plenty of useful pockets, pen slots and key rings for all your daily bits and pieces. And with top notch eco-friendly credentials too! \r\n', '<ul>\r\n<li>Made from organic hemp/cotton mix in grey with leather trim</li>\r\n<li>Adjustable shoulder strap</li>\r\n<li>Zipped top to main section for added security</li>\r\n<li>One inner zipped pocket and one phone pocket</li>\r\n<li>Large zipped pocket (under front flap) with numerous compartments and pen slots</li>\r\n<li>Two side pockets with flaps</li>\r\n<li>Key clip and key ring included</li>\r\n<li>All fastenings are magnetic making access super quick</li>\r\n</ul>\r\n<p>According to design guru Calvin Klein, hemp is going to become the choice of fibre in the fashion industry. In fact, the New York Times is saying even now that hemp is the height of fashion. Combine hemp&rsquo;s sustainable, organic and eco-friendly credentials with great design and functionality and you get Sativa, a company that&rsquo;s simply buzzing with passion and enthusiasm and who believe that good living shouldn&rsquo;t cost the earth.</p>', 49.99, 0, '2010-11-01 13:59:45', '2012-06-07 20:17:05', NULL, 2, 0, NULL, 0, 63, 1, 0, 13, '', '38cm x 30cm x 12cm', 1, 1, 'SA051', NULL, 0, 'postman-bag', 0),
(50, 'Red Leather Handbag', 'Hatti''s fair trade red leather handbag has been beautifully handmade by young women in Nepal. The leather is super soft and the long strap makes it a really versatile ethical bag for all occasions. There''s an inspiring fair trade story behind it too so you can wear it with great pride!\r\n', '<ul>\r\n<li>Beautifully soft leather in stunning red</li>\r\n<li>Adjustable leather strap long      enough to wear across the body</li>\r\n<li>Zipped top for added security</li>\r\n<li>Matching lining</li>\r\n<li>Inside one zipped pocket and      one small slip pocket</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 44.95, 0, '2010-11-01 14:03:19', '2014-11-30 22:15:03', NULL, 2, 0, NULL, 1, 70, 1, 0, 14, '', '24cm x 22cm x 3cm', 0, 1, 'HT052', NULL, 0, 'red-leather-handbag', 0),
(51, 'Purple Leather Handbag', 'Hatti''s fair trade purple long strap handbag is bright, beautiful and guaranteed to catch a few eyes! It''s been handmade by young women in Nepal and is full of fair trade goodness - a real feel-good ethical bag! Now just 1 left!', '<ul>\r\n<li>Beautifully soft leather in fabulous      purple</li>\r\n<li>Adjustable leather strap long      enough to wear across the body</li>\r\n<li>Zipped top for added security</li>\r\n<li>Matching lining</li>\r\n<li>Inside one zipped pocket and      one small slip pocket</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 44.95, 0, '2010-11-01 14:04:20', '2013-08-24 14:55:04', NULL, NULL, 0, NULL, 1, 71, 1, 0, 14, '', '24cm x 22cm x 3cm', 0, 1, 'HT053', NULL, 0, 'purple-leather-handbag', 0),
(52, 'Black Leather Shopper Bag', 'A stylish fair trade black leather shopper bag from Hatti. The leather is super smooth and has the feel of the finest Italian leather. It''s been handmade and has a truly uplifting fair trade story to tell. A real feel-good ethical bag!  \r\n', '<ul>\r\n<li>Beautiful premium leather in black</li>\r\n<li>Two handles, long enough to fit      over the shoulder</li>\r\n<li>Magnetic clasp for added      security</li>\r\n<li>Silky smooth lining in black</li>\r\n<li>Inside one zipped pocket</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 54.95, 0, '2010-11-01 14:05:50', '2014-11-30 22:15:59', NULL, 2, 0, NULL, 1, 72, 1, 0, 14, '', '28cm x 26cm x 11cm', 0, 1, 'HT054', NULL, 0, 'black-leather-shopper-bag', 0),
(53, 'Brown Leather Shopper Bag', 'Hatti''s fair trade brown leather shopper bag has been handmade in Nepal and has the feel of the finest Italian leather. The story behind this ethical bag is a truly inspiring fair trade one so you won''t just look great, you''ll feel great too knowing you''ve helped to change lives!\r\n', '<ul>\r\n<li>Beautiful premium leather in warm      brown</li>\r\n<li>Two handles, long enough to fit      over the shoulder</li>\r\n<li>Magnetic clasp for added      security</li>\r\n<li>Silky smooth lining in brown</li>\r\n<li>Inside one zipped pocket</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 54.95, 3, '2010-11-01 14:16:08', '2014-11-30 22:17:03', NULL, 2, 0, NULL, 1, 73, 1, 0, 14, '', '28cm x 26cm x 11cm', 0, 1, 'HT055', 39.99, 1, 'brown-leather-shopper-bag', 0),
(54, 'Red Leather Shopper Bag', 'Hatti''s fair trade red leather shopper bag has been handmade and has the feel of the finest Italian leather. Big enough to hold many of your daily essentials, it will provide a great splash of colour to your wardrobe.\r\n ', '<ul>\r\n<li>Beautiful premium leather in      stunning red</li>\r\n<li>Two handles, long enough to fit      over the shoulder</li>\r\n<li>Magnetic clasp for added      security</li>\r\n<li>Silky smooth lining in red</li>\r\n<li>Inside one zipped pocket</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>\r\n<p>&nbsp;</p>', 54.95, 3, '2010-11-01 14:18:39', '2014-11-30 22:18:00', NULL, 2, 0, NULL, 1, 74, 1, 0, 14, '', '28cm x 26cm x 11cm', 0, 1, 'HT056', 39.99, 1, 'red-leather-shopper-bag', 0),
(55, 'Lavender Gathered Bag', 'Hatti''s Lavender Gathered bag is a stylish fair trade shoulder bag that''s been handmade from sheep leather and the softest Indian goat suede. A wonderful ethical bag with a remarkable and uplifting story to tell.', '<ul>\r\n<li>Soft leather and suede in      brown, with pleated front and back panel</li>\r\n<li>One suede strap, long enough      to fit over the shoulder</li>\r\n<li>Zipped top for added security</li>\r\n<li>Matching brown lining</li>\r\n<li>Inside one zipped pocket and      one small slip pocket for your mobile phone</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 39.99, 0, '2010-11-01 14:20:26', '2014-11-30 22:18:55', NULL, 2, 0, NULL, 1, 75, 1, 0, 14, '', '30cm x 22cm x 6cm', 0, 1, 'HT057', NULL, 0, 'lavender-gathered-bag', 0),
(56, 'Tulip Bell Bag', 'Hatti''s fair trade Tulip Bell bag is a beautifully handmade brown suede and leather bag that''s plenty big enough for all your everyday essentials. A great example of an ethical bag that combines stylish design and excellent quality. And there''s an inspiring fair trade story behind the bag too - a real feel-good bag!\r\n', '<ul>\r\n<li>Soft leather and suede in brown</li>\r\n<li>Two suede straps, long enough      to fit over the shoulder</li>\r\n<li>Magnetic clasp for added      security</li>\r\n<li>Matching brown lining</li>\r\n<li>Inside one zipped pocket and      one small slip pocket for your mobile phone</li>\r\n</ul>\r\n<p>Although still a young company, Hatti Trading is rapidly becoming one of the UK&rsquo;s market leaders in design led, ethical handbags. It is a socially conscious business selling fair trade handbags in order to support Nepali survivors of human trafficking and other impoverished, marginalized and stigmatized women in Nepal.</p>', 59.99, 2, '2010-11-01 14:21:19', '2014-11-30 22:19:48', NULL, 2, 0, NULL, 1, 76, 1, 0, 14, '', '42cm x 30cm x 12cm', 0, 1, 'HT058', 39.99, 1, 'tulip-bell-bag', 0),
(57, 'Buffalo Bag', 'Hatti''s fair trade brown Buffalo bag is full of character, entirely handmade and strong enough to probably last you a lifetime! They''ve been made from buffalo hide by villagers high up in the Himalayan Kingdom of Nepal. A great ethical bag that''s a guaranteed conversation starter! \r\n', '<ul>\r\n<li>Strong and robust tan-coloured buffalo      leather </li>\r\n<li>Traditional, centuries-old and      eco-friendly tanning methods have been used </li>\r\n<li>Two straps, long enough to fit      over the shoulder</li>\r\n<li>Leather toggle and hoop to keep      bag secure at the top&nbsp;</li>\r\n</ul>\r\n<p>These bags are made in a small village in a remote area named Sidhukot, high up in the Himalayas. There are no phones or electricity, in fact no modern technology whatsoever. There is no work in the village and their subsistence farming doesn&rsquo;t provide enough food. So in order to work, they make a three-day trek to Kathmandu where they receive orders from Hatti for the buffalo bags and then return home to make them, collecting buffalo hide bit by bit as they go. These bags are currently responsible for the income and welfare of the whole community and contribute to many surrounding villages high up in the Himalayan mountains of Nepal.&nbsp;</p>', 44.99, 0, '2010-11-01 14:22:06', '2014-11-30 22:30:26', NULL, 2, 0, NULL, 0, 77, 1, 0, 14, '', '32cm x 29cm x 15cm', 0, 1, 'HT059', NULL, 0, 'buffalo-bag', 0),
(59, 'Scott N13 Laptop Bag', 'Feuerwear''s Scott laptop bag is made from genuine upcycled German fire hose and recycled truck tarpaulin - it''s rough, tough and full of character and bears all the marks of a former life in the fast lane putting out fires and saving lives. It''s an uber cool upcycled laptop bag that is guaranteed to give you shed loads of street cred.', '<ul>\r\n<li>White, textured, water resistant exterior made out of de-commissioned fire hose</li>\r\n<li>Adjustable and durable seat belt shoulder strap</li>\r\n<li>Removable and padded notebook sleeve</li>\r\n<li>Two inside pockets and one large zipped pocket</li>\r\n<li>Carrying handle</li>\r\n<li>Cushioned back</li>\r\n<li>Handy key finder</li>\r\n<li>Suitable for up to 13&rdquo; laptops</li>\r\n</ul>\r\n<p>Feuerwear has been making bags out of used fire hose since 2005. Each fire hose has seen many years of active service. They&rsquo;ve been dragged through soot, grease and mud, despite extreme heat and fire and have transported many thousands of cubic metres of water. Each bag has its own distinct markings and is guaranteed to be a unique, one-of-a-kind product.</p>', 112, 4, '2010-11-01 15:16:48', '2014-11-30 21:55:25', NULL, 2, 0, NULL, 1, 51, 0, 1, 6, '', '35cm x 25cm x 13cm', 1, 1, 'FW027', 75, 1, 'scott-n13-laptop-bag', 0),
(60, 'Treecycle Large Tote Bag', 'The Harveys Treecycle Seatbelt Large Tote Bag is made from genuine unused seatbelts, sourced directly from motor manufacturers. It''s a perfect day bag and will sit comfortably on your shoulder whilst being spacious enough for all your daily essentials. The quality is quite exceptional so it will cope with all the demands of everyday life for many years to come. The amazing combination of colours, shades and textures is a design masterpiece! Cool, elegant and oh so sophisticated, the Harveys Large Tote is one of the very best examples of an upcycled seatbelt bag. True eco-chic!\r\n', '<ul>\r\n<li>Made from unused, exceptionally durable multi-coloured automotive seatbelt</li>\r\n<li>60cm handles with 28cm drop</li>\r\n<li>Metal feet for protection</li>\r\n<li>Smooth zip-top closure</li>\r\n<li>Fully lined with Harveys Treecycle organic hemp lining (patterned with water-based inks)</li>\r\n<li>Four internal slip pockets </li>\r\n<li>One internal zip pocket </li>\r\n<li>D-ring for accessory or key ring</li>\r\n<li>Colours and weave may vary very slightly due to availability of reclaimed webbing</li>\r\n</ul>\r\n<p>Harveys lead the field in the design and manufacture of seatbelt bags. They have an extensive range but their Treecycle range ticks all of our onfriday boxes. They take genuinely discarded and unused seatbelts direct from the motor industry, weave them up and add some custom hemp lining to create a unique bag that is as eco-friendly as you can possibly get.</p>', 99, 0, '2010-11-01 15:27:12', '2014-08-18 19:15:09', NULL, 2, 0, NULL, 1, 1, 0, 1, 8, '', '29cm x 24cm x 10cm', 0, 1, 'HV036', NULL, 0, 'treecycle-large-tote-bag', 0),
(61, 'Treecycle Messenger Bag', 'The Harveys Treecycle Messenger Bag is made from genuine, unused seatbelts sourced directly from motor manufacturers and is a truly stylish and versatile upcycled seatbelt bag. It''s the perfect size for a netbook, a couple of notepads and the odd snack to keep you going. The quality is exceptional so there''s no doubt this bag will see you through many years of everyday life with ease. The Harveys design team have created an amazingly stylish mix of colour, shades and textures and in the process have produced a truly eco-chic upcycled messenger bag.\r\n', '<ul>\r\n<li>Made from unused and highly durable multi-coloured automotive seatbelt</li>\r\n<li>Adjustable strap - goes from 66cm with 30cm drop up to 137cm with 60cm drop so it''s plenty long enough to wear across the body too</li>\r\n<li>Brushed nickel hardware </li>\r\n<li>Metal feet for protection</li>\r\n<li>Smooth zip-top closure</li>\r\n<li>Fully lined with Harveys Treecycle organic hemp lining (patterned with water-based inks)</li>\r\n<li>Five internal slip pockets </li>\r\n<li>One internal zip pocket </li>\r\n<li>D-ring for accessory or key ring</li>\r\n<li>Colours and weave may vary very slightly due to availability of reclaimed webbing</li>\r\n</ul>\r\n<p>Harveys lead the field in the design and manufacture of seatbelt bags. They have an extensive range but their Treecycle range ticks all of our onfriday boxes. They take genuinely discarded and unused seatbelts direct from the motor industry, weave them up and add some custom hemp lining to create a unique bag that is as eco-friendly as you can possibly get.</p>', 109, 0, '2010-11-01 15:28:04', '2014-11-30 20:57:44', NULL, 2, 0, NULL, 1, 2, 0, 1, 8, '', '35cm x 29cm x 10cm', 0, 1, 'HV037', NULL, 0, 'treecycle-messenger-bag', 0),
(62, 'Treecycle Large Boat Tote', 'The Harveys Large Boat Tote Bag is made from genuine, unused seatbelts sourced directly from motor manufacturers and is the perfect choice if you’re after something that''s distinctive, ultra strong and capable of holding everything except the kitchen sink! It will see you through your day with ease and is big enough to carry all those extra essentials for an evening out with friends after work. In fact, it''s so versatile we''d definitely have it in our Top 10 of stunning holiday bags or gym bags too. You choose!\r\n', '<ul>\r\n<li>Made from unused and exceptionally durable multi-coloured automotive seatbelt </li>\r\n<li>Seatbelt material is sewn horizontally giving this bag a lightweight design</li>\r\n<li>56cm handles with 25cm drop length</li>\r\n<li>Fully lined with Harveys Treecycle organic hemp lining (patterned with water-based inks)</li>\r\n<li>Smooth zip-top closure</li>\r\n<li>Two internal slip pockets </li>\r\n<li>One internal zip pocket </li>\r\n<li>Colours and weave may vary very slightly due to availability of reclaimed webbing</li>\r\n</ul>\r\n<p>Harveys lead the field in the design and manufacture of seatbelt bags. They have an extensive range but their Treecycle range ticks all of our onfriday boxes. They take genuinely unused and discarded seatbelts direct from the motor industry, weave them up and add some custom hemp lining to create a unique bag that is as eco-friendly as you can possibly get.</p>', 99, 0, '2010-11-01 15:29:16', '2014-12-30 16:21:02', NULL, 2, 0, NULL, 1, 4, 0, 1, 8, '', '38cm x 33cm x 14cm', 0, 1, 'HV038', 69, 1, 'treecycle-large-boat-tote', 0),
(63, 'Treecycle Large Laptop Bag', 'The Harveys Treecycle Large Executive Laptop Bag has been made from genuine, unused seatbelts sourced directly from motor manufacturers. It''s just the ticket if you want to add a splash of colour to your working day! The design team at Harveys have excelled themselves by bringing together the perfect combination of colours, shades and textures which seem to blend so well. The quality is quite exceptional so there''s no doubt it will cope with everyday life for many years to come. It simply oozes style and sophistication and is as eco-friendly as you can get! \r\n', '<ul>\r\n<li>Made from unused and exceptionally durable multi-coloured automotive seatbelt</li>\r\n<li>Adjustable strap &ndash; goes from 66cm with 30cm drop up to 137cm with 60cm drop</li>\r\n<li>Fully lined with Harveys Treecycle organic hemp lining (patterned with water-based inks)</li>\r\n<li>Padded divider with Velcro strap to secure your laptop</li>\r\n<li>Smooth zip-top closure</li>\r\n<li>Two internal slip pockets and two pen pockets</li>\r\n<li>One internal zip pocket </li>\r\n<li>Colours and weave may vary very slightly due to availability of reclaimed webbing</li>\r\n<li>Will accommodate up to a 15&rdquo; laptop with plenty of space for additional documents and files</li>\r\n</ul>\r\n<p>Harveys lead the field in the design and manufacture of seatbelt bags. They have an extensive range but their Treecycle range ticks all of our onfriday boxes. They take genuinely unused, discarded seatbelts direct from the motor industry, weave them up and add some custom hemp lining to create a unique bag that is as eco-friendly as you can possibly get.</p>', 159, 3, '2010-11-01 15:30:24', '2014-11-30 20:59:39', NULL, 2, 0, NULL, 1, 3, 0, 1, 8, '', '39cm x 32cm x 10cm', 0, 1, 'HV039', 99, 1, 'treecycle-large-laptop-bag', 0),
(64, 'eskimosoup test product', 'product created by eskimosoup to test payment gateways', '', 1, 6, '2011-01-26 10:53:58', '2011-04-11 15:17:39', 1, 1, 0, NULL, 0, 78, 0, 0, 1, '', '', 1, 1, 'test', NULL, 0, 'eskimosoup-test-product', 0),
(65, 'iPhone Case in Red', 'Perhaps the coolest upcycled iPhone case on the market today! Made from genuine de-commissioned fire hose, it''s extremely hard wearing and will offer the ultimate protection for your iPhone. The hose itself is vintage and has already seen 25 years of active service fighting fires and saving lives. \r\n', '<ul>\r\n<li>Exterior in red, made from genuine British fire hose</li>\r\n<li>Lining is made from the softest reclaimed parachute silk ensuring your delicate screen stays protected and scratch-free</li>\r\n<li>Innovative ribbon pull makes accessing your iPhone really easy</li>\r\n<li>Fire hose is wipe-clean and water resistant</li>\r\n<li>Suitable for iPhone 3, 3GS and 4 and the Nokia E17 (you will need to remove any existing covers)</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 33.5, 0, '2011-01-31 18:44:02', '2012-05-15 19:28:01', 2, 2, 0, NULL, 1, 46, 0, 1, 11, '', '12.5cm x 7.5cm', 1, 1, 'EK060', NULL, 0, 'iphone-case-in-red', 0),
(66, 'iPhone Case in Yellow', 'Perhaps the coolest upcycled iPhone case on the market today! Made from genuine de-commissioned fire hose, it''s extremely hard wearing and will offer the ultimate protection for your iPhone. The hose itself is vintage and has already seen 25 years of active service fighting fires and saving lives.', '<ul>\r\n<li>Exterior in yellow, made from genuine British fire hose</li>\r\n<li>Lining is made from the softest reclaimed parachute silk ensuring your delicate screen stays protected and scratch-free</li>\r\n<li>Innovative ribbon pull makes accessing your iPhone really easy</li>\r\n<li>Fire hose is wipe-clean and water resistant</li>\r\n<li>Suitable for iPhone 3, 3GS and 4 and the Nokia E17 (you will need to remove any existing case)</li>\r\n</ul>\r\n<p>All of Elvis &amp; Kresse&rsquo;s bags and accessories have the environment at their core &ndash; industrial waste is the cornerstone of their brand. All their products are made from genuinely de-commissioned British fire hose that would otherwise have found its way into landfill. They scrub away all the soot, grease and everything else that builds up after 25 years of active duty and in the process reveal a truly remarkable, truly green textile.</p>', 33.5, 1, '2011-01-31 19:10:29', '2014-05-09 09:07:39', 2, NULL, 0, NULL, 1, 47, 0, 1, 11, '', '12.5cm x 7.5cm ', 1, 1, 'EK061', NULL, 0, 'iphone-case-in-yellow', 0),
(67, 'iPad Case in Black', 'Stylish and versatile, the Black Sativa iPad case is made from sustainably grown organic hemp and cotton. Your iPad slots straight into the case and is held securely allowing you to iPad-away your day with no loss of functionality. It also has a very useful detachable shoulder strap.\r\n', '<ul>\r\n<li>Made from organic hemp and cotton in Black</li>\r\n<li>iPad slots into the hardback casing offering excellent added protection</li>\r\n<li>Front flap opens up, giving you full functionality without the need to take the iPad out of it''s protective case&nbsp;</li>\r\n<li>Handy detachable shoulder strap, great when you''re on the move</li>\r\n<li>Also available in Ice White and Grey</li>\r\n<li>Photos of the opened iPad case are shown in Grey</li>\r\n</ul>', 34.99, 0, '2011-02-01 18:05:25', '2014-11-30 22:06:58', 2, 2, 0, NULL, 1, 64, 1, 0, 13, '', '25cm x 19cm ', 1, 1, 'SA062', NULL, 0, 'ipad-case-in-black', 0),
(68, 'iPad Case in Ice White', 'Stylish and versatile, the Ice White Sativa iPad case is made from sustainably grown organic hemp and cotton. Your iPad slots straight into the case and is held securely allowing you to iPad-away your day with no loss of functionality. It also comes with a really useful detachable shoulder strap.', '<ul>\r\n<li>Made from organic hemp and cotton in Ice White</li>\r\n<li>iPad slots into the hardback casing offering excellent added protection</li>\r\n<li>Front flap opens up, giving you full functionality without the need to take the iPad out of it''s protective case&nbsp;</li>\r\n<li>Handy detachable shoulder strap, great when you''re on the move</li>\r\n<li>Also available in Black and Grey</li>\r\n<li>Photos of the opened iPad case are shown in Grey</li>\r\n</ul>', 34.99, 0, '2011-02-01 18:07:08', '2014-11-24 16:55:04', 2, 2, 0, NULL, 1, 65, 1, 0, 13, '', '25cm x 19cm ', 1, 1, 'SA063', NULL, 0, 'ipad-case-in-ice-white', 0),
(69, 'iPad Case in Grey', 'Stylish and versatile, the Grey Sativa iPad case is made from sustainably grown organic hemp and cotton. Your iPad slots straight into the protective case and is held securely allowing you to iPad-away your day with no loss of functionality. It also has a really useful detachable shoulder strap.', '<ul>\r\n<li>Made from organic hemp and cotton in Grey</li>\r\n<li>Hardback casing for added protection</li>\r\n<li>Protective front flap opens up, giving you full functionality without the need to take your iPad out of it''s case</li>\r\n<li>Handy detachable shoulder strap, great when you''re on the move</li>\r\n<li>Also available in Black and Ice White</li>\r\n</ul>', 34.99, 0, '2011-02-01 18:13:37', '2014-11-30 22:07:42', 2, 2, 0, NULL, 1, 66, 1, 0, 13, '', '25cm x 19cm ', 1, 1, 'SA064', NULL, 0, 'ipad-case-in-grey', 0),
(70, 'Jogi Shopper in Light Grey', 'This fantastic Aura Que fairtrade Shopper Bag in Light Grey is roomy enough to hold all your everyday must-haves and is a great casual bag for all occasions. The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes. It’s also fairly traded too – a real feel good bag and perfect for those long summer days! \r\n\r\n', '<ul>\r\n<li>Made from hand-woven fabric dyed using azo-free dyes&nbsp;</li>\r\n<li>Handles are wide and long enough to sit comfortably on the shoulder and feature the trade mark Aura Que jogi twisted handles</li>\r\n<li>Two large internal compartments with large inside zip pocket in the centre panel</li>\r\n<li>Two internal slip pockets perfect for your mobile phone</li>\r\n<li>30cm loop tie connected to the handle - designed to attach to the Jogi Zip Purse (sold separately and available in all Jogi Shopper colours)</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.<br /> \r\n<ul>\r\n</ul>', 30, 0, '2011-03-24 14:25:29', '2012-08-31 14:56:21', 2, 2, 0, NULL, 0, 85, 1, 0, 5, '', 'H35cm x W35cm (opening up to 55cm) x  D22cm.\r\nHandle drop 40cm\r\n\r\n', 0, 1, 'AQ065', NULL, 0, 'jogi-shopper-in-light-grey', 0),
(71, 'Jogi Shopper in Slate Blue', 'This fantastic Aura Que slouchy Shopper in Slate Blue is roomy enough to hold all your everyday must-haves and is a great casual bag for all occasions. The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes. It’s also fairly traded too – a real feel good bag and perfect for those long summer days! ', '<ul>\r\n<li>Made from hand-woven fabric dyed using azo-free dyes&nbsp;</li>\r\n<li>Handles are wide and long enough to sit comfortably on the shoulder and feature the trade mark Aura Que jogi twisted handles</li>\r\n<li>Two large internal compartments with large inside zip pocket in the centre panel</li>\r\n<li>Two internal slip pockets perfect for your mobile phone</li>\r\n<li>30cm loop tie connected to the handle - designed to attach to the Jogi Zip Purse (sold separately and available in all Jogi Shopper colours)</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer. The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n</ul>', 30, 0, '2011-03-30 13:53:23', '2012-03-06 12:22:17', 2, 2, 0, NULL, 0, 87, 1, 0, 5, '', 'H35cm x W35cm (opening up to 55cm) x  D22cm.\r\nHandle drop 40cm', 0, 1, 'AQ066', NULL, 0, 'jogi-shopper-in-slate-blue', 0),
(72, 'Jogi Shopper in Raspberry', 'This fantastic Aura Que fair trade slouchy Shopper bag comes in a fruity raspberry colour - almost good enough to eat!  It''s a great casual bag for all occasions with loads of room to hold all your everyday must-haves. The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes. It conjures up lazy picnics and long summer days! ', '<ul>\r\n<li>Made from hand-woven fabric dyed using azo-free dyes&nbsp;</li>\r\n<li>Handles are wide and long enough to sit comfortably on the shoulder and feature the trade mark Aura Que jogi twisted handles</li>\r\n<li>Two large internal compartments with large inside zip pocket in the centre panel</li>\r\n<li>Two internal slip pockets perfect for your mobile phone</li>\r\n<li>30cm loop tie connected to the handle - designed to attach to the Jogi Zip Purse (sold separately and available in all Jogi Shopper colours)</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.', 30, 0, '2011-03-31 17:25:35', '2014-11-30 22:21:13', 2, 2, 0, NULL, 0, 86, 1, 0, 5, '', 'H35cm x W35cm (opening up to 55cm) x  D22cm.\r\nHandle drop 40cm', 0, 1, 'AQ067', NULL, 0, 'jogi-shopper-in-raspberry', 0),
(73, 'Jogi Shopper in Black & White Geometric', 'This beautiful fair trade Aura Que Jogi Shopper comes in a striking black and white geometric design and will hold all your everyday must-haves with ease. The fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes. A casual bag that''s just perfect for all occasions.  ', '<ul>\r\n<li>Made from hand-woven fabric dyed using azo-free dyes&nbsp;</li>\r\n<li>Handles are wide and long enough to sit comfortably on the shoulder and feature the trade mark Aura Que jogi twisted handles</li>\r\n<li>Two large internal compartments with large inside zip pocket in the centre panel</li>\r\n<li>Two internal slip pockets perfect for your mobile phone</li>\r\n<li>30cm loop tie connected to the handle - designed to attach to the Jogi Zip Purse (sold separately and available in all Jogi Shopper colours)</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.', 30, 0, '2011-03-31 17:40:50', '2012-03-05 09:34:37', 2, 2, 0, NULL, 0, 84, 1, 0, 5, '', 'H35cm x W35cm (opening up to 55cm) x  D22cm.\r\nHandle drop 40cm', 0, 1, 'AQ068', NULL, 0, 'jogi-shopper-in-black-white-geometric', 0),
(74, 'Jogi Shopper in Grey Shyama', 'This fantastic Aura Que slouchy Shopper in Grey Shyama is roomy enough to hold all your everyday must-haves and is a great casual bag for all occasions. The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes. It’s also fairly traded too – a real feel good bag and perfect for those long summer days! ', '<ul>\r\n<li>Made from hand-woven fabric dyed using azo-free dyes&nbsp;</li>\r\n<li>Handles are wide and long enough to sit comfortably on the shoulder and feature the trade mark Aura Que jogi twisted handles</li>\r\n<li>Two large internal compartments with large inside zip pocket in the centre panel</li>\r\n<li>Two internal slip pockets perfect for your mobile phone</li>\r\n<li>30cm loop tie connected to the handle - designed to attach to the Jogi Zip Purse (sold separately and available in all Jogi Shopper colours)</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.', 30, 0, '2011-03-31 17:45:46', '2012-03-05 09:34:12', 2, 2, 0, NULL, 0, 83, 1, 0, 5, '', 'H35cm x W35cm (opening up to 55cm) x  D22cm.\r\nHandle drop 40cm', 0, 1, 'AQ069', NULL, 0, 'jogi-shopper-in-grey-shyama', 0),
(75, 'Small Jogi Zip Purse in Light Grey', 'The Aura Que Small Jogi Zip Purse in Light Grey can be used as a coin purse but will comfortably take a couple of cards and a few notes too. The purse has a loop to one side that can be threaded to the loop ties on the Shoulder Jogi Bag or Jogi Shopper, as a detachable purse to keep your valuables in. And it''s pretty cute too!\r\n\r\n\r\n', '<ul>\r\n<li>One lined coin compartment with a covered zip closure</li>\r\n<li>Side loop allowing you to attach it to all our Aura Que Jogi bags</li>\r\n<li>Fabric made from cotton, hand-woven on wooden looms in Bhaktapur, East of Kathmandu and dyed with azo-free dyes</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade purses, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted purse is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 5, 0, '2011-03-31 18:20:40', '2014-08-30 17:09:01', 2, 2, 0, NULL, 0, 92, 1, 0, 5, '', '9cm x 12cm ', 0, 1, 'AQ074', NULL, 0, 'small-jogi-zip-purse-in-light-grey', 0);
