(79, 'Small Jogi Zip Purse in Grey Shyama', 'The Aura Que Small Jogi Zip Purse in Grey Shyama can be used as a coin purse but will comfortably take a couple of cards and a few notes too. The purse has a loop to one side that can be threaded to the loop ties on the Shoulder Jogi Bag or Jogi Shopper, as a detachable purse to keep your valuables in. And it''s pretty cute too!', '<ul>\r\n<li>One lined coin compartment with a covered zip closure</li>\r\n<li>Side loop allowing you to attach it to all our Aura Que Jogi bags</li>\r\n<li>Fabric made from cotton, hand-woven on wooden looms in Bhaktapur, East of Kathmandu and dyed with azo-free dyes</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade purses, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted purse is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 5, 5, '2011-03-31 20:09:54', '2014-01-01 16:30:57', 2, 2, 0, NULL, 0, 96, 1, 0, 5, '', '9cm x 12cm', 0, 1, 'AQ078', NULL, 0, 'small-jogi-zip-purse-in-grey-shyama', 0),
(80, 'Shoulder Jogi Bag in Light Grey', 'The Aura Que Light Grey Shoulder Jogi Bag is a really stylish fairtrade bag made from 100% cotton that has been woven by hand on wooden looms in Nepal. It''s cool, it''s casual, it''s roomy and just perfect for those long-awaited lazy summer days!\r\n', '<ul>\r\n<li>Made from hand-woven fabric, dyed using azo-free dyes&nbsp;</li>\r\n<li>Long handle with Aura Que signature twist detail, to be worn comfortably on the shoulder&nbsp;</li>\r\n<li>Tie closure inside the bag for added security</li>\r\n<li>60cm loop tie attached to the twist handle - designed to connect to the Jogi Zip Purse which then sits securely inside the bag (purse sold separately and available in all Shoulder Jogi colours)</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>\r\n<p><br /><br /></p>', 30, 0, '2011-03-31 21:41:05', '2014-11-30 22:22:18', 2, 2, 0, NULL, 0, 82, 1, 0, 5, '', '70cm (from top of handle to base) x 35cm', 0, 1, 'AQ070', NULL, 0, 'shoulder-jogi-bag-in-light-grey', 0),
(81, 'Shoulder Jogi Bag in Raspberry', 'The Aura Que Shoulder Jogi Bag is another wonderfully elegant fairtrade shoulder bag in sumptuous raspberry, made from 100% cotton that''s been woven by hand on wooden looms in Nepal. It''s cool, it''s casual, it''s roomy and just perfect for those long-awaited lazy summer days! Strawberries and cream, anyone?\r\n', '<ul>\r\n<li>Made from hand-woven fabric, dyed using azo-free dyes&nbsp;</li>\r\n<li>Long handle with Aura Que signature twist detail, to be worn comfortably on the shoulder&nbsp;</li>\r\n<li>Tie closure inside the bag for added security</li>\r\n<li>60cm loop tie attached to the twist handle - designed to connect to the Jogi Zip Purse which then sits securely inside the bag (purse sold separately and available in all Shoulder Jogi colours)</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 30, 0, '2011-03-31 22:11:41', '2014-11-30 22:22:55', 2, 2, 0, NULL, 0, 79, 1, 0, 5, '', '70cm (from top of handle to base) x 35cm', 0, 1, 'AQ071', NULL, 0, 'shoulder-jogi-bag-in-raspberry', 0),
(82, 'Shoulder Jogi Bag in Black & White', 'An elegant and striking fair trade shoulder bag with a black and white geometric pattern. It''s made from 100% cotton that has been woven by hand on wooden looms in Nepal. Spacious, sleek and definitely a stand-out-from-the-crowd bag! ', '<ul>\r\n<li>Made from hand-woven fabric, dyed using azo-free dyes&nbsp;</li>\r\n<li>Long handle with Aura Que signature twist detail, to be worn comfortably on the shoulder&nbsp;</li>\r\n<li>Tie closure inside the bag for added security</li>\r\n<li>60cm loop tie attached to the twist handle - designed to connect to the Jogi Zip Purse which then sits securely inside the bag (purse sold separately and available in all Shoulder Jogi colours)</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 30, 0, '2011-03-31 22:18:41', '2012-03-05 09:33:57', 2, 2, 0, NULL, 0, 81, 1, 0, 5, '', '70cm (from top of handle to base) x 35cm', 0, 1, 'AQ072', NULL, 0, 'shoulder-jogi-bag-in-black-white', 0),
(83, 'Shoulder Jogi Bag in Grey Shyama', 'The Aura Que Shoulder Jogi bag in grey shyama is a sleek and stylish handmade and fairtrade shoulder bag. It''s made from 100% cotton that has been woven by hand on wooden looms in Nepal. It''s a go anywhere type of bag and will be perfect if you like to mix work with pleasure every now and then.', '<ul>\r\n<li>Made from hand-woven fabric, dyed using azo-free dyes&nbsp;</li>\r\n<li>Long handle with Aura Que signature twist detail, to be worn comfortably on the shoulder&nbsp;</li>\r\n<li>Tie closure inside the bag for added security</li>\r\n<li>60cm loop tie attached to the twist handle - designed to connect to the Jogi Zip Purse which then sits securely inside the bag (purse sold separately and available in all Shoulder Jogi colours)</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade bags, designed by UK-based Laura Queening, are packed full of goodness! Each individually hand-crafted bag is created using the best natural materials and fibres Nepal has to offer.&nbsp;The beautiful fabric has been hand-woven on wooden looms in Bhaktapur, east of Kathmandu in Nepal and has been dyed using azo-free dyes.&nbsp;Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>', 30, 0, '2011-03-31 22:29:12', '2014-11-30 22:23:40', 2, 2, 0, NULL, 0, 80, 1, 0, 5, '', '70cm (from top of handle to base) x 35cm', 0, 1, 'AQ073', NULL, 0, 'shoulder-jogi-bag-in-grey-shyama', 0),
(84, 'Mercer Shoulder Bag', 'The Alchemy Goods Mercer is a great retro-looking upcycled shoulder bag made from reclaimed bicycle inner tubes. It''s sized perfectly to hold your iPad or netbook as well as a few extras for the day ahead and has an array of pockets both inside and out to keep you organised all day long!  ', '<div>\r\n<ul>\r\n<li>Durable and water resistant exterior constructed from upcycled bike inner tubes</li>\r\n<li>Tough and robust shoulder strap made from an upcycled seatbelt (colours may vary slightly)</li>\r\n<li>White external piping with a white waterproof lining</li>\r\n<li>Zipper pull made from an upcycled inner tube valve stem</li>\r\n<li>2 exterior slip pockets</li>\r\n<li>Internal iPad-sized sleeve pocket plus extra zipped pocket</li>\r\n<li>75% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>\r\n</div>', 79, 0, '2011-08-12 11:41:07', '2012-05-12 11:49:51', 2, NULL, 0, NULL, 1, 36, 0, 1, 2, '', '30cm x 24cm x 8cm ', 1, 1, 'AG074', NULL, 0, 'mercer-shoulder-bag', 0),
(85, 'Ravenna Handbag ', 'The Alchemy Goods Ravenna is a really stylish upcycled handbag made from reclaimed bicycle inner tubes. The rubber wears like fine leather and will develop a smooth lustre over time. So, if you''re looking for a brilliantly versatile bag that''s big enough to accommodate all your everyday must-haves and yet will still sit snugly on your shoulder then look no further! And with unique markings, each Ravenna is a guaranteed one-off - the ultimate designer handbag! \r\n', '<div>\r\n<ul>\r\n<li>Durable, water resistant exterior made from upcycled bike inner tubes</li>\r\n<li>Two strong inner tube handles with O-rings, plenty long enough to use as shoulder straps</li>\r\n<li>Inner tube strap and silver turnbuckle to keep your bag secured at the top</li>\r\n<li>One aqua-lined external silver-zipped pocket</li>\r\n<li>One large internal zipped pocket plus two internal slip pockets</li>\r\n<li>Lining in vibrant aqua blue, making it really easy to spot and find things lurking at the very bottom of your bag!</li>\r\n<li>66% upcycled material</li>\r\n</ul>\r\n<p>Alchemy Goods (Ag) are upcycling champions! Based in Seattle in the USA, they scour the local area for redundant bicycle inner tubes and seatbelts and work their magic on them, transforming them into some of the coolest upcycled bags on the market today. So far they have reclaimed 180,000 inner tubes and counting. The logos stitched to every Ag bag have a small number in the upper right corner. This tiny number has big significance. It represents the percent (by weight) of upcycled material that goes into each Alchemy Goods bag.</p>\r\n</div>', 72, 0, '2011-08-12 12:31:05', '2012-01-11 14:08:36', 2, 2, 0, NULL, 1, 33, 0, 1, 2, '', '32cm x 30cm x 12cm', 0, 1, 'AG075', NULL, 0, 'ravenna-handbag', 0),
(99, 'Small Handbag in Grey', 'Aura Que''s fairtrade small grey leather handbag has hand-knitted banana yarn side panels and is a wonderful example of a handcrafted ethical bag at its designer best! With short handles and an adjustable and detachable shoulder strap it can be worn across the body too so it''s a great versatile bag for all occasions. And because it''s been fairly traded you can wear it with pride knowing you are helping to improve people''s lives in Nepal. Hurry, just 2 left in stock!', '<ul>\r\n<li>Handmade using soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Hand-knitted side panels made from 100% natural banana fibre yarn, produced sustainably from the pruned excess outer layers of the banana tree after each fruit harvest</li>\r\n<li>Front panel has a roomy and secure outside zip pocket with leather pull tab</li>\r\n<li>Handy additional pocket on the back body</li>\r\n<li>Detachable and adjustable long shoulder strap (70cm &ndash; 100cm length) meaning you can wear the bag across your body too</li>\r\n<li>Secure main compartment with an antique brass zip and leather pull tab</li>\r\n<li>Reinforced base panel with antique brass base studs providing extra protection</li>\r\n<li>D-ring tabs on either side allow the bag to be pulled in  or loosened depending on how much you''re carrying</li>\r\n<li>Inside zip pocket</li>\r\n<li>Lining is woven on hand looms in Kathmandu</li>\r\n<li>Your bag also comes with a cotton dust bag with AURA QUE logo print</li>\r\n<li>Also available in black&nbsp;</li>\r\n</ul>\r\n<p>Our wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.</p>\r\n<ul>\r\n</ul>', 135, 1, '2011-10-06 13:38:25', '2014-12-23 08:03:15', 1, NULL, 0, NULL, 1, 8, 1, 0, 5, '', 'H23cm x W32cm x D11cm', 0, 1, 'AQ076', 75, 1, 'small-handbag-in-grey', 0),
(100, 'Small Handbag in Black', 'Aura Que’s fairtrade small black leather handbag has hand-knitted banana yarn side panels and is a wonderful example of a handcrafted ethical bag at its designer best! It has short handles but also comes with an adjustable and detachable shoulder strap so you can wear it across the body too. Designed by up-and-coming UK ethical fashion designer Laura Queening, it''s been handmade by skilled artisans in Nepal. Hurry only 1 left in stock! ', '<ul>\r\n<li>Handmade using soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Hand-knitted side panels made from 100% natural banana fibre yarn, produced sustainably from the pruned excess outer layers of the banana tree after each fruit harvest</li>\r\n<li>Front panel has a roomy and secure outside zip pocket with leather pull tab</li>\r\n<li>Handy additional pocket on the back body</li>\r\n<li>Detachable and adjustable long shoulder strap (70cm &ndash; 100cm length) meaning you can wear the bag across your body too</li>\r\n<li>Secure main compartment with an antique brass zip and leather pull tab</li>\r\n<li>Reinforced base panel with antique brass base studs providing extra protection</li>\r\n<li>D-ring tabs on either side allow the bag to be pulled in or loosened depending on how much you''re carrying</li>\r\n<li>Inside zip pocket</li>\r\n<li>Lining is woven on hand looms in Kathmandu</li>\r\n<li>Your bag also comes with a cotton dust bag with AURA QUE logo print</li>\r\n<li>Also available in grey</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.        \r\n<ul>\r\n</ul>', 135, 1, '2011-10-06 13:50:37', '2014-11-30 21:10:20', 2, 2, 0, NULL, 1, 9, 1, 0, 5, '', 'H23cm x W32cm x D11cm ', 0, 1, 'AQ077', 75, 1, 'small-handbag-in-black', 0),
(101, 'Large Pocket Bag in Black ', 'The Aura Que Large Pocket Bag in Black is a stylish and roomy fairtrade shoulder bag that’s simply brimming with designer chic! Designed by up-and-coming ethical fashion designer Laura Queening, it has been handmade in Nepal by local artisans using natural and sustainable materials and is a great example of a fairtrade bag that is bang on trend.', '<ul>\r\n<li>Handmade from high quality and wonderfully soft 100% buffalo leather and hand woven cotton drill &ndash; the leather is a bi-product of the Nepalese food industry and the cotton has been woven on hand looms in Kathmandu</li>\r\n<li>Large and secure main compartment with an antique brass zip and leather pull tab</li>\r\n<li>Deep outside slip pockets on both sides &ndash; perfect for easy access to all those essential bits and pieces</li>\r\n<li>Handcrafted leather handles with a 28cm drop so plenty long enough for it to sit comfortably on your shoulder</li>\r\n<li>Adjustable and detachable leather strap with antique brass fittings &ndash; long enough to wear across the body</li>\r\n<li>Inside pocket&nbsp;(16cm x 15cm)&nbsp;with an antique brass zip and leather pull tab&nbsp;</li>\r\n<li>Fully lined in hand woven black cotton</li>\r\n<li>Also available in Grey or Brown</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.        \r\n<ul>\r\n</ul>', 99, 0, '2011-10-06 15:11:17', '2014-11-30 21:04:53', 2, 2, 0, NULL, 1, 5, 1, 0, 5, '', 'H40cm x W50cm x D25cm', 0, 1, 'AQ078', NULL, 0, 'large-pocket-bag-in-black', 0),
(102, 'Large Pocket Bag in Brown ', 'The Aura Que fairtrade Large Pocket Bag in Brown is simply brimming with designer chic! Designed by up-and-coming ethical fashion designer Laura Queening, it is a stylish and roomy shoulder bag and is a great example of a designer fairtrade bag that is bang on trend! It''s been handmade in Nepal by local artisans using natural and sustainable materials. Hurry just 2 left in stock! ', '<ul>\r\n<li>Handmade from high quality and wonderfully soft 100% buffalo leather and hand woven cotton drill &ndash; the leather is a bi-product of the Nepalese food industry and the cotton has been woven on hand looms in Kathmandu</li>\r\n<li>Large and secure main compartment with an antique brass zip and leather pull tab</li>\r\n<li>Deep outside slip pockets on both sides &ndash; perfect for easy access to all those essential bits and pieces</li>\r\n<li>Handcrafted leather handles with a 28cm drop so plenty long enough for it to sit comfortably on your shoulder</li>\r\n<li>Adjustable and detachable leather strap with antique brass fittings &ndash; long enough to wear across the body</li>\r\n<li>Inside pocket&nbsp;(16cm x 15cm)&nbsp;with an antique brass zip and leather pull tab&nbsp;</li>\r\n<li>Fully lined in hand woven cotton</li>\r\n<li>Also available in Black or Grey</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.         \r\n<ul>\r\n</ul>', 99, 2, '2011-10-06 15:24:35', '2014-11-30 21:06:40', 2, 2, 0, NULL, 1, 6, 1, 0, 5, '', 'H40cm x W50cm x D25cm', 0, 1, 'AQ079', 69, 1, 'large-pocket-bag-in-brown', 0),
(103, 'Large Pocket Bag in Grey', 'The Aura Que fair trade Large Pocket Bag in Grey is a very stylish and fairly traded shoulder bag that''s brimming with designer chic! It has been designed by up-and-coming ethical fashion designer Laura Queening and has been handmade in Nepal by local artisans using natural and sustainable materials. ', '<ul>\r\n<li>Handmade from high quality and wonderfully soft 100% buffalo leather and hand woven cotton drill &ndash; the leather is a bi-product of the Nepalese food industry and the cotton has been woven on hand looms</li>\r\n<li>Large and secure main compartment with an antique brass zip and leather pull tab</li>\r\n<li>Deep outside slip pockets on both sides &ndash; perfect for easy access to all those essential bits and pieces</li>\r\n<li>Handcrafted leather handles with a 28cm drop so plenty long enough for it to sit comfortably on your shoulder</li>\r\n<li>Adjustable and detachable leather strap with antique brass fittings &ndash; long enough to wear across the body</li>\r\n<li>Inside pocket&nbsp;(16cm x 15cm)&nbsp;with an antique brass zip and leather pull tab&nbsp;</li>\r\n<li>Fully lined in hand woven cotton</li>\r\n<li>Also available in Black or Brown&nbsp;</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.          \r\n<ul>\r\n</ul>', 99, 0, '2011-10-06 15:36:14', '2014-11-30 21:07:45', 2, 2, 0, NULL, 1, 7, 1, 0, 5, '', 'H40cm x W50cm x D25cm', 0, 1, 'AQ080', NULL, 0, 'large-pocket-bag-in-grey', 0),
(104, 'Clutch in Black Leather', 'The Aura Que Black Leather Clutch is both stylish and practical and can be used as a large purse inside your handbag, as a clutch or even as a travel document folder for all your tickets, travel info and passport the next time you grab a weekend away. It also comes with an adjustable and detachable leather strap so can be worn over the shoulder or across the body too. A wonderful example of an ethical bag that’s full of versatility!', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Antique brass press-stud closure</li>\r\n<li>Variety of interior compartments including a secure zip pocket for coins and small valuables</li>\r\n<li>Adjustable and detachable leather shoulder strap &ndash; great when both hands are needed!</li>\r\n<li>The lining is woven on hand looms in Kathmandu and comes in black with small colour detail</li>\r\n<li>Handmade Aura Que brass logo plate is riveted and stitched to the front centre panel of the wallet</li>\r\n<li>Also available in grey leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.     \r\n<ul>\r\n</ul>', 65, 0, '2011-10-06 15:55:15', '2014-11-30 21:13:07', 2, 2, 0, NULL, 1, 10, 1, 0, 5, '', 'H14cm x W24cm x D3cm (when closed)', 0, 1, 'AQ081', NULL, 0, 'clutch-in-black-leather', 0),
(105, 'Clutch in Grey Leather', 'The Aura Que fairly traded Clutch in Grey Leather successfully combines style with practicality. You can use it as a large purse inside your handbag, as a clutch or even as a travel document folder for all your tickets, travel info and passport on your next weekend getaway. It also comes with an adjustable and detachable leather strap so can be worn over the shoulder or across the body too. A wonderful example of an ethical bag that’s full of versatility! Hurry, just 2 left!', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Antique brass press-stud closure</li>\r\n<li>Variety of interior compartments including a secure zip pocket for coins and small valuables</li>\r\n<li>Adjustable and detachable leather shoulder strap &ndash; great when both hands are needed!</li>\r\n<li>The lining is woven on hand looms in Kathmandu and comes in black with small colour detail</li>\r\n<li>Handmade Aura Que brass logo plate is riveted and stitched to the front centre panel of the wallet</li>\r\n<li>Also available in Black leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.     \r\n<ul>\r\n</ul>', 65, 2, '2011-10-06 16:07:16', '2014-11-30 21:14:27', 2, 2, 0, NULL, 1, 11, 1, 0, 5, '', 'H14cm x W24cm x D3cm (when closed)', 0, 1, 'AQ082', 49.99, 1, 'clutch-in-grey-leather', 0),
(106, 'Wallet in Black Leather', 'The Aura Que Wallet in black leather is a timeless classic. Designed by ethical fashion designer Laura Queening, it has been handmade by local artisans in Nepal using beautifully soft buffalo leather. It is also fairly traded so you’ll get a real feel-good feeling every time you use it knowing you’ve helped to change lives!', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Antique brass press-stud closure</li>\r\n<li>Inside secure zip pocket for your coins and valuables</li>\r\n<li>1 see through card display compartment and 4 credit card compartments</li>\r\n<li>3 additional pockets for notes and all those other purse essentials!</li>\r\n<li>Handmade Aura Que brass logo plate is riveted and stitched to the front centre panel of the wallet.</li>\r\n<li>The cotton lining is woven on hand looms in Kathmandu and comes in black with small colour detail</li>\r\n<li>Also available in grey leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.       \r\n<ul>\r\n</ul>', 35, 0, '2011-10-06 16:14:33', '2014-11-30 21:16:02', 2, 2, 0, NULL, 1, 12, 1, 0, 5, '', 'H9cm x W20cm (when closed)', 0, 1, 'AQ083', NULL, 0, 'wallet-in-black-leather', 0),
(107, 'Wallet in Grey Leather', 'The Aura Que Grey Leather Wallet is a real timeless classic. It''s been designed by up-and-coming ethical fashion designer Laura Queening and is handmade by local artisans in Nepal using beautifully soft buffalo leather. It is also fairly traded so you’ll get a real feel-good feeling every time you use it knowing you’ve helped to change lives!', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>Antique brass press-stud closure</li>\r\n<li>Inside secure zip pocket for your coins and valuables</li>\r\n<li>1 see through card display compartment and 4 credit card compartments</li>\r\n<li>3 additional pockets for notes and all those other purse essentials!</li>\r\n<li>Handmade Aura Que brass logo plate is riveted and stitched to the front centre panel of the wallet.</li>\r\n<li>The cotton lining is woven on hand looms in Kathmandu and comes in black with small colour detail</li>\r\n<li>Also available in black leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.       \r\n<ul>\r\n</ul>', 35, 0, '2011-10-06 16:20:40', '2014-11-30 21:17:20', 2, 2, 0, NULL, 1, 13, 1, 0, 5, '', 'H9cm x W20cm (when closed)', 0, 1, 'AQ084', NULL, 0, 'wallet-in-grey-leather', 0),
(108, 'Black Leather Zip Purse', 'The Aura Que fair trade black leather purse is sleek and stylish in its simplicity and just the right size to pop in your handbag or coat pocket. It has been handmade by local artisans in Nepal and combines superb quality with excellent ethical credentials. Now just 1 left!', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>15cm zip closure with leather pull attached with rivet</li>\r\n<li>Roomy enough to fit several credit cards, coins and notes</li>\r\n<li>Fully lined in black cotton drill, woven on hand looms in Kathmandu</li>\r\n<li>Handmade brass Aura Que logo plate is riveted and stitched to the front centre panel of the purse</li>\r\n<li>Also available in grey leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.       \r\n<ul>\r\n</ul>', 19, 1, '2011-10-06 16:29:11', '2014-01-01 16:26:55', 2, 2, 0, NULL, 1, 14, 1, 0, 5, '', 'W16cm x H10cm', 0, 1, 'AQ085', 15.99, 1, 'black-leather-zip-purse', 0),
(109, 'Grey Leather Zip Purse', 'The Aura Que Grey Leather Purse is sleek and stylish in its simplicity and just the right size to pop in your handbag or coat pocket. It has been handmade by local artisans in Nepal and has been fairly traded too.  ', '<ul>\r\n<li>Handmade from ultra soft buffalo leather produced in South  Nepal &ndash; the leather is a by-product of the Nepalese food industry</li>\r\n<li>15cm zip closure with leather pull attached with rivet</li>\r\n<li>Roomy enough to fit several credit cards, coins and notes</li>\r\n<li>Fully lined in black cotton drill woven on hand looms in Kathmandu</li>\r\n<li>Handmade brass Aura Que logo plate is riveted and stitched to the front centre panel of the purse</li>\r\n<li>Also available in black leather</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.   \r\n<ul>\r\n</ul>', 19, 0, '2011-10-06 16:32:22', '2012-03-05 09:33:33', 2, 2, 0, NULL, 0, 15, 1, 0, 5, '', 'W16cm x H10cm', 0, 1, 'AQ086', NULL, 0, 'grey-leather-zip-purse', 0),
(110, 'Knitted Zip Purse in Dark Grey', 'The Aura Que fairly traded knitted zip purses are packed full of fun and have been hand knitted from 100% natural banana fibre yarn that’s produced sustainably from the pruned excess outer layers of the Banana tree after each fruit harvest in South Nepal. How many purses can you say that about..? Funky and guaranteed to be a great conversation-starter! Now just 1 left!', '<ul>\r\n<li>Textured and hand knitted in a dark grey cable (top one in photo showing 4 purses)</li>\r\n<li>15cm zip and leather zip pull</li>\r\n<li>Black lining</li>\r\n<li>Also available in Cream, Black/Cream Stripe and Black/Dark Grey Stripe</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.    \r\n<ul>\r\n</ul>', 16, 1, '2011-10-06 16:43:37', '2012-03-05 09:37:24', 2, 2, 0, NULL, 0, 89, 1, 0, 5, '', 'W16cm x H10cm', 0, 1, 'AQ087', NULL, 0, 'knitted-zip-purse-in-dark-grey', 0),
