(112, 'Knitted Zip Purse in Black/Cream Stripe', 'The Aura Que fairly traded knitted zip purses are packed full of fun and have been hand knitted from 100% natural banana fibre yarn that’s produced sustainably from the pruned excess outer layers of the Banana tree after each fruit harvest in South Nepal. How many purses can you say that about..? Funky and guaranteed to be a great conversation-starter!', '<ul>\r\n<li>Textured and hand knitted in a Black/Cream thin stripe (bottom one in photo showing 4 purses)</li>\r\n<li>15cm zip and leather zip pull</li>\r\n<li>Black lining</li>\r\n<li>Also available in Cream, Dark Grey and Black/Dark Grey Stripe</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.    \r\n<ul>\r\n</ul>', 16, 0, '2011-10-06 16:52:18', '2012-03-05 09:33:03', 2, 2, 0, NULL, 0, 88, 1, 0, 5, '', 'W16cm x H10cm', 0, 1, 'AQ089', NULL, 0, 'knitted-zip-purse-in-blackcream-stripe', 0),
(113, 'Knitted Zip Purse in Black/Dark Grey', 'The Aura Que fairly traded knitted zip purses are packed full of fun. They have been hand knitted from 100% natural banana fibre yarn produced sustainably from the pruned excess outer layers of the Banana tree after each fruit harvest in South Nepal. How many purses can you say that about..? Funky and guaranteed to be a great conversation-starter!', '<ul>\r\n<li>Textured and hand knitted in a black/dark grey thin stripe (second from top in photo showing 4 purses)</li>\r\n<li>15cm zip and leather zip pull</li>\r\n<li>Black lining</li>\r\n<li>Also available in Cream, Dark Grey and Black/Cream Stripe</li>\r\n</ul>\r\nOur wonderful Aura Que fair trade collection, designed by UK-based Laura Queening, is packed full of goodness! Each individually hand-crafted piece is created using the best natural materials and fibres Nepal has to offer. The banana yarn comes from the pruned excess outer layers of the banana tree after the fruit harvest. Each design is brought to life in a Nepalese factory that employs local people, providing an income and security for themselves and their families. Aura Que only work with manufacturers who are IFAT (Fair Trade) recognised, which means that working environments are healthy and safe and workers receive a fair wage.     \r\n<ul>\r\n</ul>', 16, 0, '2011-10-06 16:55:27', '2012-03-05 09:32:51', 2, 2, 0, NULL, 0, 91, 1, 0, 5, '', 'W16cm x H10cm', 0, 1, 'AQ090', NULL, 0, 'knitted-zip-purse-in-blackdark-grey', 0);
