INSERT INTO `spotlights` (`id`, `designer`, `company`, `summary`, `content`, `brand_id`, `created_at`, `updated_at`, `created_by`, `updated_by`, `recycled`, `recycled_at`, `display`, `position`, `image_file_name`, `image_content_type`, `image_file_size`, `image_updated_at`, `image_alt`, `highlight`) VALUES
(1, 'Naomi Cornelius-Reid', 'Founder of NV London Calcutta', '', '<h3>How did you get started as a designer?</h3>\r\n<p>Prior to launching NV London Calcutta I spent 4 years as the Design   Consultancy Manager at Bill Amberg, learning the A-Z of not only   designing products but also all the other factors that go into producing   a collection like costing, production and promotion. Designing is only   the starting point of a range; it&rsquo;s often being able to turn the   drawings in to a commercially viable offering that is the tricky part!   You need to learn to be flexible and accommodating, especially in the   ethical fashion world.</p>\r\n<h3>What projects are you currently involved in?</h3>\r\n<p>We have just launched our Back To Black Collection for Christmas   which includes our gorgeous silk scarf collaboration with the very   talented paper cut artist Rob Ryan and long awaited Men&rsquo;s Accessories   Collection. Plus our specially commissioned Ayesha Make-up Purse for   Cowshed&rsquo;s new Living Collection has just hit the stores, so we&rsquo;ve been   busy bees!</p>\r\n<h3>What&rsquo;s going to be your next big thing?</h3>\r\n<p>We have a fantastic new classic bag range in the pipe line for next   year. We are adding a new cooperative into the mix , that our workshop   in Calcutta partners with, and are making use of their polished buffalo   horn which is just beautiful. We are also developing a Home Collection,   some new silks and have a couple of exciting new collaborative  projects  planned, though we can&rsquo;t say just yet who they are with - but  we&rsquo;ll keep  you posted!</p>\r\n<h3>Who has inspired you the most during your career to date?</h3>\r\n<p>My mum. She is a constant inspiration and a huge support. I have   always looked up to and admired her. She created a very successful   business from her passion in life and did it all as a single mother. She   is a testament to never giving up on your dreams.</p>\r\n<h3>What gets you up on a morning?</h3>\r\n<p>Multiple cups of coffee and a loud alarm!! Unfortunately, I am not a   morning person.&nbsp; I wish I was one of those people who find it easy to   leap out of bed and spring into action but it&rsquo;s simply not the case, I   am a complete night owl and am rarely at my desk before 9am. Once I am   up and running though it&rsquo;s plain sailing. I absolutely love what I do   and enjoy all the aspects of the business. The variety keeps me on my   toes - there is certainly never a dull moment that&rsquo;s for sure.</p>\r\n<h3>What advice would you give young designers struggling to get their first foot on the ladder?</h3>\r\n<p>Work experience is invaluable. Learn from those you admire. Be   prepared to be flexible, be proactive, aim high and never give up. Never   be afraid to ask questions. Never assume or keep quiet if you aren&rsquo;t   quite clear about something. If it&rsquo;s difficult and off putting, that&rsquo;s   probably what you need to tackle and overcome in order to make it work!</p>\r\n<h3>What does the future hold for ethical fashion?</h3>\r\n<p>I think the future is bright. The increase in high quality, well   designed ethical product which can compete with the high street is on   the up and I look forward to seeing more ethical fashion, not only   online but also on our high streets. John Lewis are trail blazing with   their People Tree concessions and I&rsquo;m sure it won&rsquo;t be too long before   others follow in their footsteps. There are also fantastic initiatives   bringing the best of boutique ethical fashion to consumers. I am heavily   involved with Ethical Just Got Fabulous the first ever, bi annual,   pop-up ethical department store. It&rsquo;s a unique shopping experience that   combines a multitude of fashion focussed brands with live music and a   host of other exciting add ons to give even the most jaded shopaholic a   refreshing alterative to trawling the pavements! <a href="http://www.ethicaljustgotfabulous.com" target="_blank">www.ethicaljustgotfabulous.com</a></p>\r\n<h3>What&rsquo;s your favourite book?</h3>\r\n<p>That is a really tricky one to decide, I&rsquo;m a complete book worm, so   it&rsquo;s almost impossible to narrow it down to just one! I read City of Joy   by Dominique Lapierre recently, which was just brilliant. It&rsquo;s a true   story about the slums of Calcutta, so I was completely hooked from the   off and it has to be up there with the all time best reads. I&rsquo;d have to   add A Fine Balance by Rohinton Mistry to the list too and A Thousand   Splendid Suns by Khaled Hosseni. Both are just incredibly powerful   stories which had a real effect on me.</p>\r\n<h3>What&rsquo;s your favourite film?</h3>\r\n<p>I don&rsquo;t really watch so many films but I absolutely loved The Lives   of Others. It&rsquo;s an incredible story about East Germany, just before the   fall of the Wall. I cried my eyes out and it was on my mind for days   afterwards. On a lighter note, The Cohen Brother&rsquo;s The Big Lebowski has   to be mentioned. I could watch it again and again, it&rsquo;s genius.</p>\r\n<h3>What&rsquo;s your favourite piece of music/song?</h3>\r\n<p>I think my favourite song of all time is &lsquo;So Good Today&rsquo; by a fairly   little known singer called Ben Westbeech. It makes me happy no matter   what my mood. Though I couldn&rsquo;t listen to just one song forever, so if I   had to choose just one artist it would have to be Nina Simone. Her   voice is phenomenal and has a song for every state of mind!</p>\r\n<h3>What would be your perfect weekend?</h3>\r\n<p>A long one! Preferably with my very wonderful and long suffering   boyfriend, somewhere that has no internet or phone reception.&nbsp;   Alternatively, a weekend away in the countryside with my friends or my   family, cooking up a storm and going for long walks by the sea sounds   like bliss.</p>\r\n<h3>If you were stranded on a desert island, what 3 things would you take with you?</h3>\r\n<p>A solar powered laptop, bikini and a bottle of red wine!</p>\r\n<h3>If you could meet anyone in the world (dead or alive) who would it be and what would you say to them?&nbsp;</h3>\r\n<p>Ghandi. I&rsquo;m not sure what I&rsquo;d say, I&rsquo;d just like to listen.</p>\r\n<h3>How would you describe yourself?</h3>\r\n<p>Determined, passionate and good with people.</p>\r\n<h3>How would your friends describe you?</h3>\r\n<p>Fun loving, enthusiastic, loyal and supportive.</p>\r\n<h3>How would you liked to be remembered?</h3>\r\n<p>As someone who gave it their all.</p>\r\n<hr />\r\n<p><a href="../../../spotlights">Click here to view Laura Queening, Founder of Aura Que in the spotlight.</a></p>', 4, '2011-06-20 16:19:49', '2011-06-23 09:58:09', 1, 1, 0, NULL, 1, 0, 'spotlight_nv.jpg', 'image/jpeg', 29543, '2011-06-20 16:19:49', 'NV London Calcutta', 0),
(2, 'Laura Queening', 'Founder of Aura Que', 'Aura Que''s founder Laura Queening has taken some time out from her busy schedule to give onfriday a little taster of her life as an ethical fashion designer. Currently in Nepal bringing to life her Autumn/Winter 2011 collection, Laura is fast becoming a ''one-to-watch'' designer and has just had one of her Jogi bags featured in Grazia magazine too! ', '<h3><strong><span style="font-size: 12px;">How did you get started as a designer?</span></strong></h3>\r\n<p><span style="font-size: 12px; font-weight: normal;">I  always wanted to do something creative that I was passionate about. I  went to London College of Fashion to study Accessory Design at the  Cordwainer&rsquo;s college, graduating in 2007. From then, I knew I wanted to  produce my own collections and work &lsquo;hands on&rsquo; with manufacturers.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>So, as a designer, what do you get involved in?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I  develop the designs and patterns for all AURA QUE products, as well as  collaborating with the sample makers on some designs. I have to source  all the materials and liaise with all my Nepalese suppliers and  manufacturers to ensure the best quality for my products. Then there&rsquo;s  the sales and marketing &ndash; working with all the boutiques that stock AURA  QUE, as well as individual customer enquiries. &nbsp;At the moment, I work  on most areas so it takes up most of my time!</span></p>\r\n<h3><strong><span style="font-size: 12px;">What are you planning or working towards at the moment?</span></strong></h3>\r\n<p><span style="font-size: 12px; font-weight: normal;">My  A/W 2011 production is going on at the moment - it is coming together  really nicely! I am trying to blog about our progress as it goes on over  the summer. I am also getting together my Spring/Summer 2012 samples,  mixing leather with heavy cottons for a summery collection.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What do you love most about what you do?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">It has to be the variety - everyday is different! It is a real challenge working in Nepal but I love the adventure!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>Who has inspired you the most during your career to date?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I  have been inspired by SO many people, over the last few years  especially &ndash; no one can get where they are without the help and  inspiration of others. I suppose my list includes friends and family,  great business mentors, ex-colleagues from my university who are working  in some fantastic fashion houses, some of the Nepalese producers who  work with me in the factory. I also find fashion forward brands such as  MIISTA and Ada Zanditon really inspiring for their ethics and style.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What advice would you give young designers struggling to get their first foot on the ladder?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Of course, be determined and work hard, though networking and seeking advice is the best way to move forward.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What do you think the future looks like for &lsquo;ethical fashion&rsquo;?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I think its positive and will eventually become the standard practise &ndash; I am really hopeful for this.</span></p>\r\n<p><strong>What would be your perfect weekend?&nbsp;</strong></p>\r\n<p><span style="font-size: 12px; font-weight: normal;">Probably a bit of yoga, a motorbike trip out of the city and some beers in the sun with friends!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>If you could choose anyone, what 3 people would you invite over for a dinner party?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Off the top of my head&hellip;&hellip;Vivienne Westwood, Dalai Lama, and my sister Elspeth &ndash; she would provide the light entertainment!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>If you were stranded on a desert island, what 3 things would you take with you?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Bikini, iPod and a sketchbook &ndash; I would make the most of the time off &ndash; and be eternally optimistic someone would find me!!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last book you read?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">Before  I went on my road trip to Delhi for meetings with fittings suppliers, I  was given &lsquo;The Alchemist&rsquo; to read by Rita, the previous marketing  manager at Sana Hastakala where the Jogi Bag Range is made. I have never  read it before and it was a perfect read for my 40 hour bus ride!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last film you watched at the cinema?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">There  isn&rsquo;t much choice in Nepal for western films, though plenty of  Bollywood films, but I did indulge by going to see the new Pirates of  the Caribbean in 3D last week &ndash; a new thing in Nepal!!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>What&rsquo;s the last music download/CD you bought?&nbsp;</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I  rely on friends and family for new music really &ndash; my brother made me a  great dance/electro iPod mix that gets me going in the mornings on the  way to the factory. Otherwise, my friend Shirley recently introduced me  to Tina Dickow, a Danish artist.</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>How would you describe yourself?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I try not to take myself too seriously!</span></p>\r\n<span style="font-size: 12px; font-weight: normal;"><br /><strong>Do you have a favourite quotation or a saying that has inspired you?</strong></span>\r\n<p><span style="font-size: 12px; font-weight: normal;">I  still remember getting a card when I was a teenager that said &ldquo;Shoot  for the moon because even if you miss, you&rsquo;ll land amongst the stars&rdquo;.<br /></span></p>\r\n<p>&nbsp;</p>\r\n<p><em><strong><span style="font-size: 12px;">Big thanks Laura - we can''t wait for your Autumn/Winter collection to arrive - watch this space folks! </span></strong></em></p>\r\n<hr />\r\n<p><a href="../../../spotlights/1">Click here to view Naomi Cornelius-Reid, Founder of NV London Calcutta in the spotlight.</a></p>', 5, '2011-06-21 08:50:16', '2011-06-23 08:11:42', 1, 1, 0, NULL, 1, 0, '13_Laura Queening, Founder of Aura Que.JPG', 'image/jpeg', 78711, '2011-06-21 08:50:15', 'Laura Queening, founder of Aura Que', 1);
