INSERT INTO `testimonials` (`id`, `writer`, `statement`, `created_at`, `updated_at`, `created_by`, `updated_by`, `recycled`, `recycled_at`, `display`, `position`) VALUES
(1, 'eskimosoup', 'The website is top notch!', '2010-10-14 14:17:29', '2010-11-02 11:08:44', NULL, NULL, 0, NULL, 1, 11),
(6, 'George from Hull', 'Loving the bags and the website!', '2010-11-09 14:50:43', '2010-11-10 14:08:05', NULL, NULL, 0, NULL, 1, 12),
(7, 'Patrick from Suffolk', 'Thanks for sending the Walter Feuerwear bag. It''s great for school and holds my laptop and a couple of files. Good bag. Thanks onfriday. ', '2010-11-10 09:16:35', '2010-11-10 09:16:35', NULL, NULL, 0, NULL, 1, 7),
(8, 'Clare from Bury St Edmunds', 'Really enjoyed last week''s sneak preview. I honestly had no idea there were people out there turning useless things like inner tubes or fire hoses into such great bags. The stories behind the fairly traded bags are amazing too. I''ve got a real dilemma now - which one am I going to get!', '2010-11-10 13:57:49', '2010-11-10 13:57:49', NULL, NULL, 0, NULL, 1, 8),
(9, 'Christopher (via Facebook)', 'What a wonderful collection of bags, looking forward to your launch date!', '2010-11-10 13:59:25', '2010-11-10 13:59:25', NULL, NULL, 0, NULL, 1, 9),
(10, 'Andy (via Facebook)', 'Wow, I''m so impressed by these bags. I can see some that would be ideal for me. They''d make great presents too. I like how you''ve gone straight to the designers. And they''re ethical too!', '2010-11-10 14:05:56', '2010-11-10 14:05:56', NULL, NULL, 0, NULL, 1, 10),
(11, 'Harriet from Leeds', 'I love my new Aura Que bucket bag, it''s both stylish and practical. I use it everyday without fail. Knowing that it''s fair trade only adds to my enjoyment of the bag. ', '2010-11-11 15:21:26', '2010-11-11 15:21:26', NULL, NULL, 0, NULL, 1, 5),
(12, 'Louise from Middlesex', 'Thanks so much for my Elvis & Kresse tote bag that arrived today. I am absolutely thrilled with it. Even my husband has agreed it is cool and I''m so impressed with the idea of using recycled material and also giving half of the profits back to Fire Service charities. I have never spent so much on a bag before and will treasure this one. \r\n\r\nThanks for great service and speedy delivery. I''ve already recommended the bag and your website to two friends this afternoon! ', '2011-01-17 15:27:51', '2011-01-17 15:27:51', 2, NULL, 0, NULL, 1, 2),
(13, 'Claire from South Norwood, London', 'I was a very happy girl on Christmas Day - a joy to receive my Hatti Buffalo bag. I have been using it everyday since and everyone is asking about it. Fabrilliant! (it is a real word, honest). I LOVE my bag. ', '2011-01-17 17:03:52', '2011-01-17 17:03:52', 2, NULL, 0, NULL, 1, 4),
(14, 'Bran from Acton, London', 'Received my Cyclus Reconexion as a surprise pressie back in November and have been using it regularly ever since. Perfect for walking to work with my packed lunch, couple of books, phone, phone charger and all the gubbins that I can''t seem to make it through the day without. Because it''s made from recycled inner tubes it''s nicely waterproof which has been invaluable given the weather we''ve had so far. Love it! ', '2011-01-17 17:07:18', '2011-01-17 17:07:18', 2, NULL, 0, NULL, 1, 6),
(15, 'Alison (via Facebook)', 'I have just got my Walter Feuerwear bag! I love it and it''s soooo coool!! Thank you onfriday, I am loving your work.', '2011-03-29 17:48:00', '2011-03-29 17:48:00', 2, NULL, 0, NULL, 1, 3),
(16, 'Tracey from Lytham St Anne''s ', 'Thank you SO much - this bag (Nkuku Savannah Shopper) is just beautiful and it arrived yesterday - I am so impressed by the service, price and speed of delivery. I''ve told all my friends and colleagues about you - had a LOT of compliments on my bag yesterday on its first outing. Many, many thanks. ', '2011-11-29 16:46:03', '2011-11-29 16:46:03', 2, NULL, 0, NULL, 1, 1),
(17, 'Clare from Suffolk', 'Just wanted to say that I have now bought several bags from this website for myself and friends.  Every single one has amazed me when it arrived - the quality is superb!  It''s a real treat opening a package from onFriday, the service has been exceptional every time.  ', '2012-04-29 14:09:34', '2012-04-29 14:09:34', 2, NULL, 0, NULL, 1, 0);
